INSERT INTO `Recipe` VALUES (1,'한방삼계탕','멀티쿠커로 30분이면 충분한 한방삼계탕!더운 날씨에 푹푹 끓이면 집에 더 더워지잖아요!그럴 때 필요한 멀티쿠커 레시피!초복, 중복에 못 챙긴 대표 보양식 \"삼계탕\"말복에 꼭 챙겨 기력보충하세요 ♥',2,'0001.jpg','30분 이내'),(2,'전복죽','미세먼지 혹은 갑자기 추워진 날씨때문에아프세요? 아니면 가족이나 소중한 사람이 아프신가요?그렇다면 정성으로 만든 전복죽을 만들어보세요!',2,'0002.jpg','60분 이내'),(3,'누룽지삼계탕','더운 날씨 누룽지삼계탕으로 힘내요!힘 불끈불끈 나게 보양식 제대로 챙겨먹자!!',2,'0003.jpg','60분 이내'),(4,'전복버터밥','성시경 최요비 데뷔?!초보MC 김동완과 초보 셰프 성시경의 합작!전복손질까지 알 수있는 기력보충요리!입동의 찬바람에 기력이 떨어지기 전에성시경의 전복버터밥 만들어보세요 ♥',2,'0004.jpg','60분 이내'),(5,'문어솥밥','어떻게 지냈지는 모르겠는 지난 한 해를 보낸지벌써 한달이 지났어요~모두가 힘든 시기에 건강을 생각해서 만든푸짐한 따뜻한 밥 한끼로다가오는 설날을 기다려봐요!',2,'0005.jpg','30분 이내'),(6,'낙지찜','힘이 불끈불끈 !!!!겨울을 잘 보내기 위한 낙지레시피를 준비했어요~!수능에 힘쓴 수험생들의 원기 회복을 위해 쫄깃쫄깃한 낙지찜을 하는 건 어때요?',2,'0006.jpg','30분 이내'),(7,'들깨삼계탕','더 더워질텐데 몸보신은 하고 휴가가야지~!들큰하게 한입 두입 먹다보면 어느새 빈그릇 ★',2,'0007.jpg','60분 이내'),(8,'신라면볶음밥','오잉 짠짠한 맛의 라죽이 생각나는 맛!입에 넣으면 뿌셔진 라면이 스윽~~ 들어와씹히는 맛은 bb혼자사는 자취생들! 오늘 점심은 신라면 볶음밥 완전추천!다른 컵라면으로 만들어도 진리라는 건 안해도 맛보장',1,'0009.jpg','5분 이내'),(9,'백종원미역국','생일였던것을 깜박했다!백종원의 5분 미역국만 있으면 고민 해결!!!5분 미역국에도 소고기 버전 & 들깨 버전을 함께 공개!초간단하게 미역국 끓이는 백종원 레시피로!생일상만큼은 미역국은 직접 끓여보세요!',1,'0010.jpg','5분 이내'),(10,'5분육포','69데이를 맞이해서 만드는 5분수제육포!냉부에서 나왔던 레시피를 그대로 따라하기!먹는 순간 사먹는 육포랑 똑같아서 깜짝이야!',1,'0011.jpg','5분 이내'),(11,'꿀떡버거','편의점핫바는 꼭 사줘야 안섭섭해~!한입 먹으면 꿀떡꿀떡 넘어가는 편의점 조합레시피 고고 ★',4,'0012.jpg','5분 이내'),(12,'달걀마요비빔면','비빔면은 맵다는 맵찔이들~!달걀과 마요네즈만 있으면 넌 도오전 가능 ???!!!!!편의점재료로 핵고퀄 ★ 맛보장은 덤 ★',1,'0013.jpg','5분 이내'),(13,'도란도란달걀밥','도란도란 나눠 먹을까바~!맛있는 녀석들 편의점에서 나온 초간단 요리~!도란도란 나눠먹을려다가 싸우지말고 각자 해먹어바바~!',1,'0014.jpg','5분 이내'),(14,'베이컨&달걀프라이','하울의 움직이는성???? 와구와구 먹던 베이컨???너무 간단하쟌아???',1,'0015.jpg','5분 이내'),(15,'견과토스트','견과류와 치즈가 함께 고소함 공격!전자레인지로 간단하게 만드는 브런치 완성!',1,'0016.jpg','5분 이내'),(16,'라면알리오올리오','파스타를 먹고싶은데 재료가.......또르르...그럴때는 구하기 쉬운 재료들로 완전 맛있는라면오일 파스타 고고고~!',1,'0017.jpg','5분 이내'),(17,'달걀범벅','참기름 향이 솔~솔~간장으로 짭또롭하게 간을 맞춰서더이상 아무것도 필요없다! 이것만으로도 완성!',1,'0018.jpg','5분 이내'),(18,'참치양배추덮밥','배고픈데... 배달음식을 질리고.. 배는 고프고참치캔으로 만들 수 있는 든든한 한끼 추천요리!매콤한 고추장양념에 채소와 참치로간단하게 볶아 만든 한그릇요리!참치캔으로 간단하고 든든한 한끼 챙기세요!',1,'0019.jpg','30분 이내'),(19,'참치시금치전','고형에 내려가지 못해서 명절음식을 못먹는 분들!참치캔으로 만드는 전레시피 공개!간단해서 혼자 해먹기가 딱! 좋아요!',4,'0020.jpg','30분 이내'),(20,'백파더 참치캔요리','진짜 요린이들은 참치캔을 따는 법까지 알려줘야대요!참치캔을 위험하기 않게 따는 법!참치캔으로 계량하는 법!참치캔으로 함박스테이크 모양 잡는 법!무려 3가지 꿀팁이 대방출 된 \"백파더 요리를 멈추지마\"참치캔으로',2,'0021.jpg','20분 이내'),(21,'고추참치비빔우동','떠오르는 이정현 레시피!CU 편의점이 출시된 이정현의 고추참치비빔면!쉬운 재료로 집에서도 만들어 볼수 있어요!집근처 씨유가 없다면?! 도전?!!!',2,'0022.jpg','30분 이내'),(22,'참치고추장찌개','고기가 없을 때 참치넣고 고추장 찌개 끓여바바!참치가 들어가 찐득한 맛이 중독적이야!막 지은 밥이 슥삭슥삭 비벼 먹는 걸 난 추천!',2,'0023.jpg','30분 이내'),(23,'참치두부전','단백 그 자체로 먹을 수 있는 레시피!통조림 참치로 간단하게! 두부로 단백하게!흔한 재료로 만들수 있지만 결코 흔하지 않어!',2,'0024.jpg','20분 이내'),(24,'묵은지참치김밥','숙대 김밥의 레전드 ~! 숙대맛집 ! 한입소반 김밥 따라하기~!맛집따라하기가 돌아왔다~! 아삭아삭한 묵은지와 참치는 참맛~!',1,'0025.jpg','20분 이내'),(25,'게살로제파스타','호불호가 크게 없는 로제소스!크림이냐?! 토마토냐?! 결정하기 힘들 때섞어서 더 맛있게 만드는 로제파스타!마트에서 구하기 쉬운 게맛살과 묵진한 소스가 잘어울리는 페투치니로맛있는 파스타 한끼하세요!!!!',1,'0026.jpg','30분 이내'),(26,'게맛살초밥','느낌만 낸다면 초밥이 확실해!스팸, 참치통조림, 크래미로 만드는 초밥3가지!자취한다고 매일 김치볶음밥만 먹을 수 없잖아요!내가 만들어 먹어야 더 맛있는 자취버전 초밥3가지!다같이 먹으면 더 맛있어요 ♥',3,'0027.jpg','20분 이내'),(27,'두부스무디','단백질쉐이크에 질렸던 나.......다이어트를 시작하는 분들을 위한두부음료 & 두부딥핑소스 만들기!부드러우면서 고소한 스무디와 딥핑소스로든든',2,'0028.jpg','10분 이내'),(28,'닭곤약국수','곤약국수는 식감 뿐이라 싫어하는 분들도 있잖아요!닭가슴살로 육수를 내어깔끔하고 가볍게 만든 닭곤약국수!다이어트식단에 한 줄 채워도 되겠어요!',2,'0029.jpg','30분 이내'),(29,'천사채냉채','마요네즈에 머무린 천사채샐러드가 아닌근사한 일품요리로 변신한 저칼로리 \"천사채\"오독한 식감의 다양한 채소와 겨자소스로근사한 냉채요리 어때요?!',2,'0030.jpg','20분 이내'),(30,'옥수수치즈빵','에어프라이어만 있다면 난 든든해~!간식부터 저녁밥상까지~!',4,'0032.jpg','15분 이내'),(31,'버섯채소구이','냉장고에 있는 칭구들~! 에어프라이어로 들어왓~!또 내입으로 들어왓~! 샐러드에 얹어 먹으면 너무 좋겠는걸 ?',3,'0033.jpg','20분 이내'),(32,'아코디언꿀고구마','달달한 간식이 필요한 휴일!느슨한 휴일이 필요한 오늘 같은 날에 필요한 레시피는?!에어프라이어 고구마구이!흔하게 구워먹지 말고 칼집을 슥슥슥 넣어아코디언모양으로 빠르고 맛있게!',3,'0034.jpg','30분 이내'),(33,'양송이버섯구이','에어프라이어 쉽게 간단한 일품요리 만들기!버섯구이인지 완자구이인지 모를 만큼 고기 듬뿍 채워양송이버섯을 더 맛있게 먹는 법!',4,'0035.jpg','60분 이내'),(34,'금세디아','수미네반찬에 출연한 홍석천이 소개한 \"금세디아\"냉동만두로 쉽게 후다닥 만든다고해서이름이 붙였다죠?!간단하게 먹는 만큼 간단하게 만들어야 하잖아요!재료는 또띠아, 만두, 치즈피자만 있으면후다닥 간단 점심이나, 브런치에 어울리는퀘사디아를 만들 수 있어요!',2,'0037.jpg','15분 이내'),(35,'시금