/*!40000 ALTER TABLE `RecipePhase` DISABLE KEYS */;
INSERT INTO `RecipePhase` VALUES (1,1,'닭은 꼬리 쪽 노란 기름 덩어리를 제거하고 목, 날개 끝부분도 잘라 정리한다.','0001_1.jpg'),(2,1,'찹쌀은 물에 불린다.','0001_2.jpg'),(3,1,'닭 뱃속에 불린 찹쌀, 대추, 생밤, 마늘을 채워 넣고 다리 쪽에 칼집을 내어 정리한다.','0001_3.jpg'),(4,1,'멀티쿠커 압력 솥에 속을 채운 닭, 한방팩, 양파, 대파, 통후추, 물을 넣고 압력 뚜껑을 닫는다.\n닌자 멀티 쿠커 푸디 OP300KR','0001_4.jpg'),(5,1,'높은 압력 모드에서 30분간 조리하여 완성한다.\n마지막에 부추를 넣고 뜸을 들여 곁들여 주셔도 좋아요.','0001_5.jpg'),(6,2,'전복은 깨끗이 솔로 씻어 숟가락으로 껍질과 분리하고 이빨을 제거한다.\n내장은 죽에 들어가므로 버리지 않아요~!','0002_1.jpg'),(7,2,'손질한 전복을 얇게 썰어 준비하고 내장은 다져서 준비한다.','0002_2.jpg'),(8,2,'냄비에 준비한 전복을 참기름2큰술 넣고 볶다가 색이 살짝 변하면 불린쌀을 넣어 같이 볶는다.','0002_3.jpg'),(9,2,'전복과 쌀을 볶은 냄비에 내장도 함께 넣어 볶다가 물을 넣는다.','0002_4.jpg'),(10,2,'죽이 자작해 지면 소금으로 간을 하고 쌀알이 물러 지면 불을 끄고 그릇에 덜어 통깨를 뿌려 완성 한다.','0002_5.jpg'),(11,3,'백숙용 닭은 흐르는 물에 세척한다.',''),(12,3,'물 1리터에 굵은 소금을 넣고 닭을 넣고 10분간 밑간한다.\n닭에 간이 베고, 닭살이 부드러워져요.','0003_2.jpg'),(13,3,'냄비에 손질한 닭, 물 1리터, 삶는 재료를 넣는다.','0003_3.jpg'),(14,3,'끓으면 중불로 줄인다.\n중간중간 거품을 걷어주세요.','0003_4.jpg'),(15,3,'뚜껑을 닫고 약 40분간 푹 삶는다.','0003_5.jpg'),(16,3,'닭이 익으면 닭을 건지고 찹쌀누룽지를 넣는다.','0003_6.jpg'),(17,3,'중불에서 약 10분간 끓여 그릇에 담는다.','0003_7.jpg'),(18,3,'송송 썬 파를 올려 완성한다.','0003_8.jpg'),(19,4,'전복은 숟가락으로 껍데기와 분리한 후 내장을 떼어낸다.\n내장이 붙은 쪽 반대 부분에 숟가락을 넣고 떼어 내주세요.','0004_1.jpg'),(20,4,'전복은 이빨을 제거한 뒤 전복 살의 칼집을 내고 내장은 다진다.','0004_2.jpg'),(21,4,'냄비에 버터를 녹인 후 전복 내장, 다진마늘을 넣고 볶다가 불린 쌀을 넣어 볶는다.','0004_3.jpg'),(22,4,'물과 다시마를 넣고 뚜껑을 닫고 한소끔 끓인 뒤 섞는다.','0004_4.jpg'),(23,4,'뚜껑을 닫고 중불에 10분간 끓인 뒤 밥 위에 전복 살을 얹어 약불에서 5분간 끓인다.','0004_5.jpg'),(24,4,'불을 끄고 5분간 뜸을 들여 완성한다.','0004_6.jpg'),(25,5,'문어다리는 칼집을 낸다.\n빨판 쪽에 칼집을 내어주세요','0005_1.jpg'),(26,5,'문어는 소금, 참기름으로 밑간을 한다.','0005_2.jpg'),(27,5,'불린 쌀, 물, 다시마, 톳을 넣고 센불로 끓인다.\n네오플램 피카 양수냄비','0005_3.jpg'),(28,5,'끓기 시작하면 밑간한 문어다리를 넣고 뚜껑을 닫아 약불로 15분간 끓인다.\n밥을 짓는 동안 문어솥밥에 어울리는 된장국을 끓여주세요','0005_4.jpg'),(29,5,'불을 끄고 5분간 뜸을 들여 완성한다.','0005_5.jpg'),(30,6,'양파는 채 썰고 미나리는 5cm 길이로 썰고 대파와 고추는 어슷 썬다.','0006_1.jpg'),(31,6,'볼에 양념 재료를 넣고 양념장을 만든다.','0006_2.jpg'),(32,6,'끓는 물에 소금 약간을 넣고 콩나물을 데친 후 찬물에 헹군 뒤 체에 밭쳐 물기를 뺀다.','0006_3.jpg'),(33,6,'팬에 물을 붓고 끓으면 낙지와 바지락을 넣고 익힌다.\n낙지손질법','0006_4.jpg'),(34,6,'바지락이 입을 벌리면 양념장, 양파를 넣고 볶은 뒤 삶은 콩나물, 대파, 청고추, 홍고추, 미나리를 넣고 1~2분간 익힌다.','0006_5.jpg'),(35,6,'불을 끄고 참기름을 두른 뒤 통깨를 뿌려 완성한다.\n부족한 간은 소금, 후추를 뿌려요.','0006_6.jpg'),(36,7,'찹쌀은 헹구어 물에 담가 10분 이상 불려요.','0007_1.jpg'),(37,7,'대파는 채 썰어 준비해요.','0007_2.jpg'),(38,7,'닭은 손질 하여 대추, 인삼, 밤, 마늘, 찹쌀을 넣어 다리를 꼬아 입구를 막아요.','0007_3.jpg'),(39,7,'볼에 물, 찹쌀가루, 날콩가루, 들깨가루, 소금을 넣어 뭉치지 않게 풀어요','0007_4.jpg'),(40,7,'냄비에 물과 닭을 넣어 한소끔 끓어오르면 불을 끄고 닭을 씻어 내요.','0007_5.jpg'),(41,7,'다시 냄비에 닭이 잠길 정도의 물을 붓고 삼계탕용 한약재, 대파, 마늘, 소금을 넣어 닭이 익을 때 까지 끓여요.','0007_6.jpg'),(42,7,'냄비에 닭육수 2종이컵과 만들어놓은 들깨가루 소스를 넣어 한소끔 끓여요.','0007_7.jpg'),(43,7,'끓어오르면 닭과 파채를 넣어 완성해요.','0007_8.jpg'),(44,8,'대파는 송송 썬다.\n카카두 호주 시드니 캄포도마','0009_1.jpg'),(45,8,'봉지에 라면, 라면 스프를 넣고 부순다.','0009_2.jpg'),(46,8,'라면 용기에 부순 라면을 넣고 용기 선의 반까지만 물을 부어 익힌다.','0009_3.jpg'),(47,8,'팬에 기름을 두르고 송송 썬 대파를 볶다가 노릇해지면 달걀, 밥을 넣고 볶는다.\n네오플램 노블레스 프라이팬','0009_4.jpg'),(48,8,'익힌 부순 라면을 넣고 물기가 없어질 때까지 볶는다.','0009_5.jpg'),(49,8,'라면 볶음밥을 다시 라면 용기에 넣고 모양을 잡아 그릇에 담아 완성한다.','0009_6.jpg'),(50,9,'[5분미역국 만들기]\n소고기는(약 80~100g) 가위를 이용해 한입 크기로 잘라 냄비에 넣어요.','0010_1.jpg'),(51,9,'고기가 있는 냄비에 참기름 1숟가락을 넣어 중불에 볶아요.','0010_2.jpg'),(52,9,'고기가 익으면 자른 미역 1숟가락을(약 4~5g) 넣어 볶아요.','0010_3.jpg'),(53,9,'물 500ml를 넣어 센불로 끓여요.','0010_4.jpg'),(54,9,'끓어 오르면 약불로 줄이고 다진 마늘 1/2숟가락 넣어요.','0010_5.jpg'),(55,9,'국간장을 1숟가락을 넣고 소금을 조금씩 넣어 간을 해요.\n간장은 향과 색을 내는 역할을 하고 소금으로 간을 해요.','0010_6.jpg'),(56,9,'[들깨 미역국 만들기]\n냄비에 들기름을 1숟가락 넣어 고기를 잘라 넣어 중불에 볶아요.','0010_7.jpg'),(57,9,'자른 미역을 1숟가락 넣어 볶아요.','0010_8.jpg'),(58,9,'물 500ml를 넣어 센불에 끓여요.','0010_9.jpg'),(59,9,'떡볶이 떡이나 떡국 떡을 넣어요.','0010_10.jpg'),(60,9,'다진 마늘 1/2숟가락, 국간장 1숟가락, 소금을 약간 넣어 간을 해요.','0010_11.jpg'),(61,9,'들깨가루 2숟가락을 넣어 잘 풀어 완성해요.\n떡이 익었는지 확인하고 불을꺼주세요.','0010_12.jpg'),(62,10,'소고기는 키친타월에 올려 핏물을 뺀다.\n소고기를 육전용으로 준비해주세요','0011_1.jpg'),(63,10,'핏물을 뺀 소고기에 간장을 바른 후 설탕을 앞뒤로 골고루 묻힌다.','0011_2.jpg'),(64,10,'예열 된 기름에 2~3분간 바싹 튀긴 후 식혀 완성한다.\n네오플램 노블레스 프라이팬(28cm)','0011_3.jpg'),(65,11,'치즈빵은 전자레인지에 15초간 데우고, 소시지바는 30초간 데운다.\n전자레인지\n치즈빵 대신에 꿀호떡을 사용하셔도 좋아요.','0012_1.jpg'),(66,11,'치즈빵은 반으로 슬라이스 하고, 소세지는 길게 반으로 잘라 2등분한다.','0012_2.jpg'),(67,11,'샐러드는 소스를 넣어 버무린다.','0012_3.jpg'),(68,11,'반 가른 치즈빵에 샐러드, 소시지를 넣고 머스타드소스를 뿌려 완성한다.\n좋아하는 소스를 뿌려 드세요.','0012_4.jpg'),(69,12,'비빔면 컵에 뜨거운 물을 부어 익힌다.\n익힌 면은 찬물에 헹궈주세요.','0013_1.jpg'),(70,12,'익힌 면에 비빔면 소스를 넣어 섞는다.','0013_2.jpg'),(71,12,'접시에 비빔면을 담고 라면스프, 파마산가루, 마요네즈를 뿌리고 달걀노른자를 올려 완성한다.','0013_3.jpg'),(72,13,'아보카도는 슬라이스 하고 달걀은 반으로 썬다.','0014_1.jpg'),(73,13,'팬에 기름을 두르고 명란젓을 굽는다.','0014_2.jpg'),(74,13,'구운 명란을 먹기 좋게 썬다.','0014_3.jpg'),(75,13,'그릇에 밥을 담고 아보카도, 명란구이, 달걀을 올려 완성한다.\n달걀장의 간장으로 간을 맞춰 드세요.','0014_4.jpg'),(76,14,'베이컨은 먹기좋게 자른다.','0015_1.jpg'),(77,14,'팬에 식용유를 두른 후 베이컨을 굽는다.,','0015_2.jpg'),(78,14,'한쪽에 달걀을 굽는다.','0015_3.jpg'),(79,14,'소금, 후추로 간하여 완성한다.','0015_4.jpg'),(80,15,'식빵에 설탕, 계피가루를 뿌린다.',''),(81,15,'견과류, 치즈를 올린다.',''),(82,15,'전자레인지에 1분간 돌려 완성한다,\n전자레인지\n180도 예열된 오븐에 3분간 구워주면 더욱 바삭해요.',''),(83,16,'라면에 끓는물을 붓고 면을 반만 익힌다.','0017_1.jpg'),(84,16,'마늘을 편썰고, 양파, 베이컨은 채썰어 준비한다.','0017_2.jpg'),(85,16,'팬에 오일을 두르고 마늘, 양파를 노릇해질때까지 볶는다.','0017_3.jpg'),(86,16,'베이컨을 넣고 볶는다.','0017_4.jpg'),(87,16,'익힌 면을 팬에 넣고 같이 볶다가 스프를 1/2가량 넣고 볶아 완성한다.','0017_5.jpg'),(88,17,'팬에 참기름을 두르고 달걀을 넣는다.','0018_1.jpg'),(89,17,'흰자만 살살 저어가며 익힌다.','0018_2.jpg'),(90,17,'달걀이 익기전에 불을 끄고 간장을 넣고 노른자를 섞는다.','0018_3.jpg'),(91,17,'밥에 올려 완성한다.','0018_4.jpg'),(92,18,'양배추는 한 입 크기로 썰고 양파는 채 썰고 대파는 송송 썬다.','0019_1.jpg'),(93,18,'참치캔은 체에 밭쳐 기름을 제거한다.','0019_2.jpg'),(94,18,'볼에 양념재료를 넣고 양념장을 만든다.','0019_3.jpg'),(95,18,'달군 팬에 기름을 두르고 대파를 볶는다.\n네오플램 노블레스 프라이팬','0019_4.jpg'),(96,18,'파 향이 올라오면 양파,양배추를 볶는다.','0019_5.jpg'),(97,18,'참치, 양념장을 넣고 볶다가 불을 끄고 참기름을 두른다.','0019_6.jpg'),(98,18,'그릇에 밥을 담고 참치양배추를 올린 뒤 달걀노른자, 통깨를 뿌려 완성한다.','0019_7.jpg'),(99,19,'양파는 다지고 시금치는 손질한 후 송송 썬다.\n도블레 향균도마','0020_1.jpg'),(100,19,'참치캔은 체에 밭쳐 물기를 제거한다.\n키친아트 스테인레스 채반','0020_2.jpg'),(101,19,'볼에 모든 재료를 넣고 섞는다.','0020_3.jpg'),(102,19,'달군 팬에 기름을 두르고 반죽을 한 입 크기로 떠서 앞뒤로 노릇하게 부쳐 완성한다.','0020_4.jpg'),(103,20,'참치캔은 따서 기름을 따라 버려요.','0021_1.jpg'),(104,20,'볼에 참치를 넣어요.\n참치캔은 버리지 않고 계량에 사용해요.','0021_2.jpg'),(105,20,'양파를 작게 다져 참치 빈 캔에 다진 양파를 채워 볼에 넣어요.','0021_3.jpg'),(106,20,'청양고추와 대파를 작게 다져 빈 캔에 반만 채워 볼에 넣어요.\n라오메뜨 이태리 천연세라믹 트레이 도마','0021_4.jpg'),(107,20,'다진 마늘 1/2숟가락을 볼에 넣어요.','0021_5.jpg'),(108,20,'달걀 2개를 볼에 넣어요.\n달걀은 잘 뭉쳐지는 역할을 해서 캔의 크기에 따라서 2~3개 정도 넣어주세요.','0021_6.jpg'),(109,20,'볼에 부침가루 크게 2숟가락 넣어 버무려요.\n부침가루 밀가루가 없다면 밥을 캔에 채워 넣어요.','0021_7.jpg'),(110,20,'예열된 팬에 기름을 두르고(약 5숟가락) 중불로 줄여 기름이 있는 쪽에 숟가락 2개를 이용해 넣어 앞 뒤로 노릇하게 익혀요','0021_8.jpg'),(111,20,'(참치 함박) 빈 캔에 버무린 재료를 채워 예열된 팬에 엎어 넣어 기름을 두르고 약불로 앞 뒤로 노릇하게 익혀요.\n찌듯이 뚜껑을 덮어주어도 좋아요.','0021_9.jpg'),(112,20,'빈 참치 캔에 간장, 케찹, 설탕을 넣어 섞은 후 물을 가득 채워요.','0021_10.jpg'),(113,20,'뒤집어진 참치 함박에 버터를 1숟가락 넣어 녹인 후 소스를 넣어 졸여요.','0021_11.jpg'),(114,20,'달걀 후라이를 해서 올려 완성해요.','0021_12.jpg'),(115,21,'양파는 다진다.\n카카두 캄포나무 도마','0022_1.jpg'),(116,21,'끓는 물에 우동면을 1~2분간 삶은 후 찬물에 헹군다.\n네오플램 레트로T 익스클루시브_프리미엄 IH 통주물','0022_2.jpg'),(117,21,'팬에 통조림 참치와 다진 양파를 넣고 볶는다.\n통조림참치 1캔은 150g이에요.','0022_3.jpg'),(118,21,'고춧가루, 까나리액젓, 간장, 고추기름를 넣고 참치와 잘 섞이도록 젓는다.','0022_4.jpg'),(119,21,'검은깨와 김가루를 뿌린다.','0022_5.jpg'),(120,21,'고추참치양념장에 우동면을 넣고 1분간 섞는다.','0022_6.jpg'),(121,21,'참기름을 뿌려 완성한다.\n송송 썬 쪽파를 올리면 더욱 예뻐요.','0022_7.jpg'),(122,22,'두부와 양파, 감자는 한 입 크기로 썰고 대파와 고추는 송송 썬다.','0023_1.jpg'),(123,22,'참치캔을 체에 밭쳐 기름을 제거한다.','0023_2.jpg'),(124,22,'볼에 양념 재료를 넣고 양념장을 만든다.','0023_3.jpg'),(125,22,'뚝배기에 감자, 양파, 참치, 양념재료, 물을 넣고 끓인다.\n네오플램 피카 익스클루시브','0023_4.jpg'),(126,22,'감자가 거의 익으면 두부를 넣는다.','0023_5.jpg'),(127,22,'대파, 청양고추, 홍고추를 넣어 한소끔 끓여 완성한다.','0023_6.jpg'),(128,23,'양파, 당근은 잘게 썬다.','0024_1.jpg'),(129,23,'두부는 반으로 갈라 적당한 두께로 썬다.','0024_2.jpg'),(130,23,'참치, 다진 양파, 다진 당근, 간장, 소금, 후추를 넣고 섞어 소를 만든다.','0024_3.jpg'),(131,23,'두부에 참치소를 올려 샌드 한다.','0024_4.jpg'),(132,23,'두부를 전분 가루>달걀 순으로 골고루 묻힌다.','0024_5.jpg'),(133,23,'팬에 기름을 두르고 두부를 앞 뒤로 노릇하게 구워 완성한다.\n네오플램 노블레스 프라이팬(28cm)','0024_6.jpg'),(134,24,'당근은 채 썰어 팬에 기름을 두르고 살짝 볶는다.\n트라이앵글 줄리앤커터','0025_1.jpg'),(135,24,'시금치는 끓는물에 데친 후 시금치 양념재료를 넣고 무친다.\n네오플램 피카 편수냄비','0025_2.jpg'),(136,24,'달걀은 소금, 후추를 넣고 