.jpg'),(202,35,'믹서기에 시금치페스토 재료를 넣고 곱게 간다.','0038_5.jpg'),(203,35,'구운 빵 위에 시금치페스토를 바른 후 토마토, 모차렐라치즈를 올려 완성한다.','0038_6.jpg'),(204,36,'식빵은 모서리를 제거하고 밀어 납작하게 만든다.','0040_1.jpg'),(205,36,'팬에 식빵을 앞뒤로 노릇하게 굽는다.\n[브랜드특가] 네오플램 노블레스 프라이팬 2종 1세트 (20cm+28cm)','0040_2.jpg'),(206,36,'그릇에 식빵 > 토마토소스 > 닭강정 > 감자샐러드> 모차렐라 치즈 순으로 반복하여 쌓는다.','0040_3.jpg'),(207,36,'전자레인지에 3분간 돌려 완성한다.\n전자레인지','0040_4.jpg'),(208,37,'무는 한 입 크기로 썰고 대파, 고추는 송송썬다.','0042_1.jpg'),(209,37,'돼지고기에 맛술, 소금, 후추를 뿌려 밑간한다.','0042_2.jpg'),(210,37,'볼에 양념 재료를 넣고 양념장을 만든다.','0042_3.jpg'),(211,37,'냄비에 물, 양념장, 무를 넣고 끓이다 무가 투명해지면 돼지고기 넣고 10분간 끓인다.\n물 대신 멸치다시마육수를 써도 좋아요.','0042_4.jpg'),(212,37,'대파, 고추를 넣고 한소끔 끓여 완성한다.','0042_5.jpg'),(213,38,'양파는 채 썰고 청양고추는 송송 썬다.','0043_1.jpg'),(214,38,'팬에 라면에 동봉되어 있는 향미유를 두르고 양파를 볶다가 고춧가루, 후추를 넣고 살짝 더 볶는다.','0043_2.jpg'),(215,38,'토마토소스, 물을 넣고 끓어 오르면 라면과 액상스프를 반만 넣어 끓인다.','0043_3.jpg'),(216,38,'면이 반쯤 익으면 달걀을 깨뜨려 넣고 모짜렐라 치즈를 뿌린다.','0043_4.jpg'),(217,38,'치즈가 녹으면 송송 썬 청양고추를 올려 완성한다.','0043_5.jpg'),(218,39,'두부, 양파, 애호박은 한 입 크기로 썰고 대파, 청양고추, 홍고추는 어슷 썬다.','0044_1.jpg'),(219,39,'돼지고기에 밑간 재료를 넣고 밑간한다.','0044_2.jpg'),(220,39,'냄비에 기름을 약간 두르고 돼지고기를 볶는다.\n네오플램 피카 편수냄비','0044_3.jpg'),(221,39,'고기 겉면이 익으면 양념 재료와 육수를 넣고 끓인다.\n새우젓이 있으시다면 1/2숟가락을 넣어요.','0044_4.jpg'),(222,39,'육수가 끓어오르면 애호박, 양파를 넣고 10분간 중불에서 끓인다.\n육수 대신 만개한알을 넣어 깊은 찌개에 맛을 내도 좋아요\n만개한알_육수의비밀','0044_5.jpg'),(223,39,'두부, 대파, 청양고추, 홍고추를 넣어 완성한다.\n부족한 간은 소금을 더해요.','0044_6.jpg'),(224,40,'대파는 송송 썰고 통조림 햄과 배추김치는 작게 썬다.','0046_1.jpg'),(225,40,'달군 팬에 식용유를 두르고 달걀 프라이를 한다.','0046_2.jpg'),(226,40,'달군 팬에 식용유를 두르고 대파를 넣어 중불에서 볶는다.','0046_3.jpg'),(227,40,'파 향이 나면 배추김치를 넣고 1~2분간 볶다가 통조림 햄을 넣어 볶는다.','0046_4.jpg'),(228,40,'4에 밥과 양념재료를 넣고 센불에서 2~3분간 볶은 후 불을 끄고 참기름을 넣어 섞는다.','0046_5.jpg'),(229,40,'그릇에 볶음밥을 담고 달걀프라이를 올려 완성한다.','0046_6.jpg'),(230,41,'날치알은 맛술을 부은 후 체에 걸러 물기를 제거한다.\n맛술을 뿌리면 날치알의 비린내가 제거돼요.','0047_1.jpg'),(231,41,'양파, 당근은 다지고 대파는 송송 썬다.\n멀티 차퍼','0047_2.jpg'),(232,41,'달군 팬에 식용유를 두르고 대파를 볶다가 파 향이 올라오면 다진 양파와 당근을 넣는다.\n네오플램 노블레스 프라이팬','0047_3.jpg'),(233,41,'한 입 크기로 썬 김치를 넣고 볶다가 밥과 양념재료를 넣는다.','0047_4.jpg'),(234,41,'마지막에 날치알을 넣고 섞어 완성한다.','0047_5.jpg'),(235,42,'양파, 당근, 대파는 다진다.\n멀티 차퍼','0049_1.jpg'),(236,42,'달군 팬에 식용유를 약간 두르고 다진 야채를 볶는다.\n네오플램 피카 프라이팬','0049_2.jpg'),(237,42,'밥을 넣어 볶은 후 소금, 후추를 뿌린 뒤 식혀둔다.','0049_3.jpg'),(238,42,'볶음밥을 삼각형 모양으로 뭉친 뒤 베이컨에 돌돌 만다.\n글러브센스 주방 위생장갑','0049_4.jpg'),(239,42,'달군 팬에 베이컨삼각주먹밥을 앞뒤로 노릇하게 익혀 완성한다.\n이음새 부분을 먼저 익혀야 잘 풀리지 않아요.','0049_5.jpg'),(240,43,'밥에 참치,통깨, 소금, 후추를 넣고 섞는다.\n참치는 기름기를 빼주세요.','0050_1.jpg'),(241,43,'밥을 삼각형 모양으로 만든다.','0050_2.jpg'),(242,43,'팬에 양념재료를 넣고 살짝 끓인다.','0050_3.jpg'),(243,43,'모양잡은 밥을 넣고 앞뒤로 바삭하게 구워 완성한다.','0050_4.jpg'),(244,44,'명란젓의 배를 갈라 칼등으로 긁어 껍질을 제거한다','0051_1.jpg'),(245,44,'명란젓, 마요네즈, 설탕을 넣고 고루 섞는다.','0051_2.jpg'),(246,44,'따뜻한 밥에 밑간 재료를 넣고 고루 섞는다.','0051_3.jpg'),(247,44,'주먹밥을 먹기 좋은 크기로 만들어 3등분한 감태로 감싼다.\n감싸지지 않는곳은 감태를 찢어 붙여주세요','0051_4.jpg'),(248,44,'명란마요를 위에 얹어 완성한다.','0051_5.jpg'),(249,45,'달걀, 설탕, 후추를 넣고 달걀물을 만든다.\n쿠진아트 인사이더 키친툴 8종 세트 조리도구세트 CTG-8PK 거품기','0052_1.jpg'),(250,45,'팬에 식용유를 두르고 달걀을 부친다.','0052_2.jpg'),(251,45,'반으로 자른 베이컨을 노릇하게 굽는다.\n네오플램 피카 프라이팬\n쿠진아트 인사이더 키친툴 8종 세트 조리도구세트 CTG-8PK 조리용집게','0052_3.jpg'),(252,45,'베이글은 반으로 자른다.','0052_4.jpg'),(253,45,'팬에 버터를 두르고 베이글을 굽는다.','0052_5.jpg'),(254,45,'베이글 안쪽에 각각 케찹, 마요네즈를 바른다.\n쿠진아트 인사이더 키친툴 8종 세트 조리도구세트 CTG-8PK 버터나이프','0052_6.jpg'),(255,45,'베이글 >계란>치즈> 베이컨 순으로 얹어 완성한다.','0052_7.jpg'),(256,46,'껍질을 벗긴 감자를 전자레인지에 7~10분간 삶는다.\n전자레인지','0053_1.jpg'),(257,46,'양파와 피클은 다지고 크래미는 결대로 찢는다.\n피클 대신 오이를 다져 넣어도 좋아요.\n멀티 차퍼','0053_2.jpg'),(258,46,'볼에 삶은 감자를 으깨고 다진 양파와 피클, 소스 재료를 넣고 섞어 속재료를 만든다.','0053_3.jpg'),(259,46,'모닝빵의 칼집을 낸 후 속 재료를 넣고 파슬리가루를 뿌려 완성한다.\n취향에 따라 케첩을 뿌려 먹어도 좋아요.','0053_4.jpg'),(260,47,'양배추는 채 썰고 토마토는 링으로 썬다. 크로와상은 반으로 칼집을 낸다.','0054_1.jpg'),(261,47,'채 썬 양배추에 물, 소금을 넣고 살짝 섞은 후 랩을 씌워 전자레인지에 2분간 조리한다.\n전자레인지\n조리한 양배추는 물기를 꼭 제거해 주세요.','0054_2.jpg'),(262,47,'조리한 양배추에 양념 재료를 넣고 섞는다.','0054_3.jpg'),(263,47,'팬에 베이컨을 노릇하게 굽는다.\n네오플램 노블레스 프라이팬\n쿠진아트 키친툴 조리용집게','0054_4.jpg'),(264,47,'팬에 기름을 두르고 달걀 프라이를 한 후 뜨거울 때 치즈를 올려 녹인다.','0054_5.jpg'),(265,47,'반으로 가른 크로와상에 달걀 프라이, 토마토, 구운 베이컨, 양념한 양배추를 올리고 덮어 완성한다.','0054_6.jpg'),(266,48,'치아바타는 반 갈라 준비하고 토마토, 모짜렐라 치즈는 편으로 썰어 준비한다.','0055_1.jpg'),(267,48,'예열된 팬에 올리브유를 두르고 치아바타를 올려 안쪽면을 노릇하게 구워요.\n네오플램 노블레스 프라이팬','0055_2.jpg'),(268,48,'빵 안쪽에 바질 페이스트를 발라요.','0055_3.jpg'),(269,48,'빵에 루꼴라를 올리고 토마토, 모짜렐라 순서로 올리고 발사믹 크림을 뿌려요.','0055_4.jpg'),(270,48,'빵을 덮어 완성해요.','0055_5.jpg'),(271,49,'[냉 파스타 샐러드]\n방울토마토, 블랙 올리브는 반으로 자르고 베이컨은 잘게 다진다.','0056_1.jpg'),(272,49,'다진 베이컨은 팬에 노릇하게 굽는다.\n구운 베이컨은 기름기를 제거해 주세요.\n네오플램 노블레스 프라이팬(28cm)','0056_2.jpg'),(273,49,'끓는 물에 소금을 넣고 숏 파스타를 삶는다.\n네오플램 레트로T 18편수(다크블루)','0056_3.jpg'),(274,49,'삶은 파스타에 토마토소스 재료를 넣고 섞는다.\n파스타는 차갑게 식혀 주시면 더욱 맛있어요.','0056_4.jpg'),(275,49,'보틀에 준비한 재료를 담아 파스타 샐러드를 완성한다.','0056_5.jpg'),(276,49,'[닭 가슴살 단호박 샐러드]\n단호박, 훈제 닭 가슴살은 깍둑썬다.','0056_6.jpg'),(277,49,'방울토마토는 반으로 썰고 브로콜리는 먹기 좋게 썬다.','0056_7.jpg'),(278,49,'손질한 단호박, 브로콜리는 전자레인지에 3분간 조리한다.\n전자레인지','0056_8.jpg'),(279,49,'닭가슴살 단호박 드레싱을 섞어 레몬소스를 만든다.','0056_9.jpg'),(280,49,'보틀에 준비한 재료를 쌓아 담고 소스를 뿌려 닭 가슴살 단호박 샐러드를 완성한다.\n따로 보관하여 먹기 직전에 뿌려도 좋아요','0056_10.jpg'),(281,49,'[무지개 샐러드]\n당근, 방울토마토는 먹기 좋게 썰고 아보카도는 반으로 갈라 씨, 껍질 제거 후 먹기 좋게 썬다.','0056_11.jpg'),(282,49,'무지개샐러드 드레싱을 섞어 오리엔탈 소스를 만든다.','0056_12.jpg'),(283,49,'보틀에 방울토마토>당근>통조림옥수수>아보카도>적채를 담고 소스를 뿌려 무지개 샐러드를 완성한다.\n따로 보관하여 먹기 직전에 뿌려도 좋아요','0056_13.jpg'),(284,50,'볼에 달걀과 소금을 약간 넣어 잘 풀어요.\n쿠진아트 인사이더 키친툴 8종 세트 조리도구 미니 거품기','0057_1.jpg'),(285,50,'예열된 팬에 기름을 두르고 달걀물을 넣어요','0057_2.jpg'),(286,50,'달걀이 다 익기 전에 식빵을 올려요.','0057_3.jpg'),(287,50,'달걀과 식빵이 붙으면 뒤집어 식빵 사이즈에 맞게 달걀을 올려 접어요.','0057_4.jpg'),(288,50,'달걀 위에 치즈를 올리고 설탕을 뿌려요.','0057_5.jpg'),(289,50,'반을 접어 완성해요.','0057_6.jpg'),(290,51,'[5분미역국 만들기]\n소고기는(약 80~100g) 가위를 이용해 한입 크기로 잘라 냄비에 넣어요.','0058_1.jpg'),(291,51,'고기가 있는 냄비에 참기름 1숟가락을 넣어 중불에 볶아요.','0058_2.jpg'),(292,51,'고기가 익으면 자른 미역 1숟가락을(약 4~5g) 넣어 볶아요.','0058_3.jpg'),(293,51,'물 500ml를 넣어 센불로 끓여요.','0058_4.jpg'),(294,51,'끓어 오르면 약불로 줄이고 다진 마늘 1/2숟가락 넣어요.','0058_5.jpg'),(295,51,'국간장을 1숟가락을 넣고 소금을 조금씩 넣어 간을 해요.\n간장은 향과 색을 내는 역할을 하고 소금으로 간을 해요.','0058_6.jpg'),(296,51,'[들깨 미역국 만들기]\n냄비에 들기름을 1숟가락 넣어 고기를 잘라 넣어 중불에 볶아요.','0058_7.jpg'),(297,51,'자른 미역을 1숟가락 넣어 볶아요.','0058_8.jpg'),(298,51,'물 500ml를 넣어 센불에 끓여요.','0058_9.jpg'),(299,51,'떡볶이 떡이나 떡국 떡을 넣어요.','0058_10.jpg'),(300,51,'다진 마늘 1/2숟가락, 국간장 1숟가락, 소금을 약간 넣어 간을 해요.','0058_11.jpg'),(301,51,'들깨가루 2숟가락을 넣어 잘 풀어 완성해요.\n떡이 익었는지 확인하고 불을꺼주세요.','0058_12.jpg'),(302,52,'두부는 한 입 크기로 썰고 양파는 채 썰고 대파,청양고추는 송송 썬다.','0060_1.jpg'),(303,52,'볼에 양념 재료를 넣고 섞는다.','0060_2.jpg'),(304,52,'팬에 기름을 넉넉히 두르고 두부를 넣고 앞뒤로 튀기듯 익힌다.\n네오플램 피카 프라이팬','0060_3.jpg'),(305,52,'양념장을 넣고 졸여 완성한다.','0060_4.jpg'),(306,53,'감자와 양파는 한 입 크기로 썰고 청양고추는 송송 썬다.','0061_1.jpg'),(307,53,'볼에 양념 재료를 넣고 양념장을 만든다.','0061_2.jpg'),(308,53,'달군 냄비에 식용유를 약간 두르고 감자를 넣은 뒤 중불에서 볶는다.\n네오플램 레트로T 편수 냄비','0061_3.jpg'),(309,53,'감자가 투명해지면 양파, 물, 양념장을 넣고 국물이 자작할때까지 조린다.','0061_4.jpg'),(310,53,'마지막으로 송송 썬 청양고추를 넣고 1~2분 더 조려 완성한다.','0061_5.jpg'),(311,54,'표고버섯은 모양대로 편 썰고 꽈리고추는 꼭지 제거 후 포크로 찔러 구멍을 낸다.','0062_1.jpg'),(312,54,'냄비에 표고버섯, 양념 재료를 넣고 끓인다.\n표고향을 더 내기 위해선 표고톡톡을 추가로 넣어도 좋아요\n네오플램 레트로T 익스클루시브 편수냄비\n톡톡채소 표고톡톡','0062_2.jpg'),(313,54,'국물이 바글바글 끓고 반 정도 줄어들면 꽈리고추, 통깨, 참기름을 넣고 살짝 더 조려 완성한다.','0062_3.jpg'),(314,55,'소고기는 약 30분 정도 찬물에서 핏물을 뺀다.\n메추리알은 삶아 껍질을 벗겨 준비한다.','0063_1.jpg'),(315,55,'냄비에 핏물 뺀 소고기를 넣고 고기가 잠길 만큼 물을 부어 한소끔 끓인다.','0063_2.jpg'),(316,55,'한소끔 끓인 고기는 찬물에 깨끗이 씻는다.','0063_3.jpg'),(317,55,'새로운 냄비에 고기, 통마늘, 양파, 대파, 통후추, 생강, 월계수 잎을 넣고 고기가 잠길 만큼 물을 붓고 고기가 부드러워질 때까지 푹 끓인다.\n약 30분 이상 끓여주세요.','0063_4.jpg'),(318,55,'고기가 익으면 잠시 식혀 고기를 결대로 찢는다.','0063_5.jpg'),(319,55,'고기 삶은 물에 건더기를 건진다.','0063_6.jpg'),(320,55,'고기 삶은 물에 찢어 놓은 고기, 메추리알을 넣고 양념 재료를 넣어 약 10분간 센 불에서 졸여 완성한다.','0063_7.jpg'),(321,56,'꽁치통조림은 체에 받쳐 국물을 거른다.','0064_1.jpg'),(322,56,'무는 도톰하게 썰고, 양파는 채 썬다.','0064_2.jpg'),(323,56,'대파는 어슷하게 썬다.','0064_3.jpg'),(324,56,'양념재료를 모두 섞어 양념장을 만든다.','0064_4.jpg'),(325,56,'냄비에 무를 깔고 꽁치를 올린다.','0064_5.jpg'),(326,56,'양념장, 양파, 욱수 순으로 넣고 끓인다.','0064_6.jpg'),(327,56,'무가 익으면 대파를 넣고 한소끔 끓여 불을 끈다.','0064_7.jpg'),(328,56,'접시에 담아 깨를 뿌려 완성한다.','0064_8.jpg'),(329,57,'등갈비는 손질하여 한대씩 잘라 찬물에 담가 약 30분간 핏물을 빼요.','0065_1.jpg'),(330,57,'믹서기에 양파, 사과, 간장, 맛술, 설탕, 다진 마늘, 후추를 넣어 갈아요.','0065_2.jpg'),(331,57,'냄비에 등갈비가 잠길만큼의 물을 부어 한소끔 끓여요.','0065_3.jpg'),(332,57,'끓어오르면 등갈비를 건져 찬물에 헹궈요.','0065_4.jpg'),(333,57,'냄비에 등갈비, 물, 청주 또는 소주, 대파, 월계수잎을 넣어 약 20분 이상 끓여요.','0065_5.jpg'),(334,57,'냄비에 물을 약 2종이컵만 남기고 갈아놓은 양념을 넣어 국물이 자작해 질 때까지 조려요.','0065_6.jpg'),(335,57,'마지막으로 물엿을 넣어 섞어 완성해요.','0065_7.jpg'),(336,58,'양파는 채 썰고 마늘은 편 썰고 쪽파는 송송 썬다.','0066_1.jpg'),(337,58,'연어는 한 입 크기로 썬 후 소금, 후추를 뿌린다.','0066_2.jpg'),(338,58,'볼에 양념 재료를 넣고 양념장을 만든다.','0066_3.jpg'),(339,58,'달군 팬에 기름을 두르고 연어를 굽는다.\n네오플램 피카 익스클루시브','0066_4.jpg'),(340,58,'연어를 한 쪽 편에 놔두고 양파, 마늘, 양념장을 넣고 끓이듯 조린다.','0066_5.jpg'),(341,58,'접시에 연어조림을 담고 쪽파를 뿌려 완성한다.','0066_6.jpg'),(342,59,'메추리알을 냄비에 넣고 잠길 정도의 물을 붓고 식초, 소금을 넣어 중간불에서 13분간 삶는다.','0067_1.jpg'),(343,59,'밀폐용기에 삶은 메추리알과 찬물을 조금 붓고 뚜껑을 덮어 흔들어 껍질을 벗긴다.','0067_2.jpg'),(344,59,'메추리알을 냄비에 넣고 간장, 맛술, 물을 부어 중간 불로 약 5~7분간 조린다.','0067_3.jpg'),(345,59,'끓기시작하면 설탕, 물엿, 꽈리고추를 넣고 5분 정도 더 조려 완성한다.','0067_4.jpg'),(346,60,'고구마를 2cm 두께로 썬다.','0068_1.jpg'),(347,60,'냄비에 고구마를 넣는다.','0068_2.jpg'),(348,60,'물, 물엿, 계피, 소금을 넣고 고구마를 조린다.','0068_3.jpg'),(349,60,'고구마가 다 조려지면 계피를 건져낸다.','0068_4.jpg'),(350,60,'고구마조림을 체에 거른다.','0068_5.jpg'),(351,60,'접시에 담고 검은깨를 뿌려 완성한다.','0068_6.jpg'),(352,61,'양파는 채 썰고 대파와 청양고추는 어슷 썬다.','0071_1.jpg'),(353,61,'볼에 양념 재료를 넣고 양념장을 만든다.','0071_2.jpg'),(354,61,'볼에 꽃게, 채소, 양념장을 넣고 버무린다.','0071_3.jpg'),(355,61,'통깨를 뿌려 완성한다.','0071_4.jpg'),(356,62,'봄동을 2cm 길이로 채 썬다.','0074_1.jpg'),(357,62,'볼에 양념 재료를 넣고 섞는다.','0074_2.jpg'),(358,62,'채썬 봄동에 양념 재료를 넣고 무친다.','0074_3.jpg'),(359,62,'통깨를 뿌려 완성한다.','0074_4.jpg'),(360,63,'두릅은 밑둥을 제거하고 손질하여 , 끓은 소금물에 두릅을 30초 정도 데쳐 찬물에 헹군다.\n데쳐서 전을 부쳐야 두릅의 색상이 선명하고, 깨끗한 전을 만들수 있다.\n두릅에 소금, 후추 간을 약간씩 해 주면 더 감칠맛 나요~','0076_1.jpg'),(361,63,'새우는 꼬리를 제외한 머리, 껍질, 내장을 제거하고, 등쪽을 갈라 펼친다.','0076_2.jpg'),(362,63,'꼬치에 두릅- 새우-두릅-새우- 두릅 순서로 끼운다.','0076_3.jpg'),(363,63,'밀가루- 달걀물을 입힌다.','0076_4.jpg'),(364,63,'달군팬에 꼬치를 넣고 앞뒤뢰 노릇하게 굽는다.','0076_5.jpg'),(365,64,'표고버섯은 채 썬다.','0077_1.jpg'),(366,64,'볼에 달걀을 풀고 소금 후추를 넣어 섞는다.','0077_2.jpg'),(367,64,'달군 팬에 식용유를 두르고 소불고기를 넣어 50% 정도 익힌다.\n이때 소불고기는 미리 키친타월로 핏물을 빼주세요.\n네오플램 노블레스 프라이팬','0077_3.jpg'),(368,64,'소금, 후추, 맛술을 넣는다.','0077_4.jpg'),(369,64,'(2)에 풀어두었던 달걀을 붓고 표고버섯을 올려 약불로 부친다.','0077_5.jpg'),(370,64,'볼에 소스재료를 넣고 소스를 만든다.\n시판 오리엔탈드레싱이나 발사믹드레싱을 이용해도 괜찮아요.','0077_6.jpg'),(371,64,'그릇에 달걀전과 샐러드채소를 올린 후 소스를 뿌려 완성한다.','0077_7.jpg'),(372,65,'명란젓의 배를 갈라 칼등으로 긁어 껍질을 제거한다','0078_1.jpg'),(373,65,'명란젓, 마요네즈, 설탕을 넣고 고루 섞는다.','0078_2.jpg'),(374,65,'따뜻한 밥에 밑간 재료를 넣고 고루 섞는다.','0078_3.jpg'),(375,65,'주먹밥을 먹기 좋은 크기로 만들어 3등분한 감태로 감싼다.\n감싸지지 않는곳은 감태를 찢어 붙여주세요','0078_4.jpg'),(376,65,'명란마요를 위에 얹어 완성한다.','0078_5.jpg'),(377,66,'날치알은 맛술에 10분간 담근 후 건져 물기를 제거한다.\n맛술에 담가주면 날치알의 비린내가 제거돼요.','0079_1.jpg'),(378,66,'볼에 밥, 참기름, 소금, 통깨를 넣고 섞은 후 잘게 썬 단무지, 날치알, 마요네즈를 넣고 섞는다.','0079_2.jpg'),(379,66,'2를 한 입 크기로 동그랗게 만든 후 김가루를 묻혀 완성한다.','0079_3.jpg'),(380,67,'양파는 얇게 채 썰고 대파는 송송 썰고 통마늘은 큼직하게 다져요.','0081_1.jpg'),(381,67,'예열된 팬에 기름을 두르고 양파를 넣어 갈색이 날 때 까지 볶아 내요.\n네오플램 피카 프라이팬','0081_2.jpg'),(382,67,'예열된 팬에 대파, 다진 마늘을 넣어 노릇하게 볶아요.\n대파 마늘 대신 마늘톡톡, 대파톡톡 1/4봉씩 넣어 마늘&파기름을 내도 좋아요\n톡톡채소 마늘톡톡, 대파톡톡','0081_3.jpg'),(383,67,'마늘이 노릇해 지면 밥을 넣어 볶아요.','0081_4.jpg'),(384,67,'간장, 소금, 후추로 기호에 맞게 간을 해요.','0081_5.jpg'),(385,67,'달걀을 넣어 밥과 함께 볶아요.','0081_6.jpg'),(386,67,'그릇에 볶아놓은 밥과 양파 볶음을 올려 완성해요.\n대파톡톡을 뿌려서 먹어도 좋아요\n톡톡채소 대파톡톡','0081_7.jpg'),(387,68,'깨끗이 씻은 단호박은 반으로 자른 후 씨를 제거하고 한 입 크기로 썬다.','0084_1.jpg'),(388,68,'전자레인지 그릇에 단호박을 넣고 랩을 씌운 후 전자레인지에 5분간 돌린다.\n전자레인지','0084_2.jpg'),(389,68,'전자레인지에 돌린 단호박의 껍질을 제거한다.\n전자레인지','0084_3.jpg'),(390,68,'믹서기에 단호박과 우유를 넣고 간 후 잔에 담고 호박씨를 얹어 완성한다.','0084_4.jpg'),(391,69,'양송이버섯, 마늘은 슬라이스하고, 베이컨은 3등분한다.','0085_1.jpg'),(392,69,'쌀가루, 우유, 달걀, 소금을 고루 섞어 크레페 반죽을 만든다.','0085_2.jpg'),(393,69,'식용유를 두른팬에 마늘, 양송이를 굽고, 베이컨을 후추를 뿌려 따로 굽는다.','0085_3.jpg'),(394,69,'버터를 두른 팬에 크레페 반죽을 부어 피자치즈를 얹고 달걀 -> 양송이버섯.베이컨 순으로 얹어 사각형 모양으로 접어 치즈를 뿌린다.','0085_4.jpg'),(395,69,'뚜껑을 덮어 달걀을 반숙으로 익혀 완성한다.','0085_5.jpg'),(396,70,'닭 다리 살은 한 입 크기로 자른다.','0086_1.jpg'),(397,70,'자른 닭 다리 살에 밑간 재료를 넣고 버무려 10분간 재운다.','0086_2.jpg'),(398,70,'튀김옷 재료를 섞어 반죽을 만든다.','0086_3.jpg'),(399,70,'반죽에 밑간한 닭 다리 살, 통마늘을 넣고 섞는다.','0086_4.jpg'),(400,70,'튀김가루와 카레 가루를 섞은 후 닭 다리 살, 통마늘에 묻힌다.','0086_5.jpg'),(401,70,'예열한 기름에 노릇하게 튀긴 후 2차로 한 번 더 튀겨 완성한다.','0086_6.jpg'),(402,71,'표고버섯과 양파는 채 썰고 대파는 어슷 썰고 스팸는 0.5cm 두께로 길게 썬다.','0087_1.jpg'),(403,71,'스팸에 뜨거운물을 부어 담가 준 후 물기를 제거한다.\n스팸을 뜨거운물에 담가 사용하면 기름기와 불순물이 제거돼요.','0087_2.jpg'),(404,71,'볼에 양념 재료를 넣고 양념장을 만든다.','0087_3.jpg'),(405,71,'달군 팬에 고추기름을 두르고 양파, 대파, 표고버섯,을 넣고 볶다가 소금, 후추를 뿌린다.','0087_4.jpg'),(406,71,'스팸, 양념장을 넣고 1~2분간 더 볶아 완성한다.','0087_5.jpg'),(407,72,'새송이버섯은 반으로 썰어 칼집을 내고 대파, 베이컨은 다진다,','0088_1.jpg'),(408,72,'양념재료와 다진베이컨, 다진대파를 넣고 섞어 소스를 만든다.','0088_2.jpg'),(409,72,'새송이버섯 단면에 소스를 바른 후 빵가루, 파슬리가루를 뿌린다.','0088_3.jpg'),(410,72,'에어프러이어 바스켓에 버섯을 넣고 180도 온도에서 15분간 구워 완성한다.\n에어프라이어','0088_4.jpg'),(411,73,'새송이버섯은 양쪽을 잘라낸 후 3등분 한다.\n남은 버섯은 찌개 끓이거나 볶음밥 재료에 사용해요.','0089_1.jpg'),(412,73,'통썰기 한 버섯 윗면에 칼집을 낸다.','0089_2.jpg'),(413,73,'볼에 양념 재료를 넣고 양념장을 만든다.','0089_3.jpg'),(414,73,'달군 팬에 버터를 녹인 후 새송이버섯을 앞뒤로 굽는다.\n네오플램 피카 프라이팬','0089_4.jpg'),(415,73,'꽈리고추와 양념장을 넣고 조린 뒤 통깨를 뿌려 완성한다.','0089_5.jpg'),(416,74,'삶은 옥수수에 마요네즈를 듬뿍 바른다.','0090_1.jpg'),(417,74,'달군 팬에 버터, 설탕을 약불로 녹이고 옥수수를 골고루 굽는다.\n네오플램 노블레스 프라이팬','0090_2.jpg'),(418,74,'파마산치즈가루, 고춧가루, 파슬리가루를 취향껏 뿌려 완성한다.\n옥수수가 너무 크다면 2~3등분해요.','0090_3.jpg'),(419,75,'감자는 끓는물에 삶은 후 껍질을 제거한다.','0091_1.jpg'),(420,75,'에어프라이어 바스켓에 유산지를 깔고 감자를 담는다.','0091_2.jpg'),(421,75,'양념재료를 넣고 한번 뒤적인다.\n에어프라이어','0091_3.jpg'),(422,75,'180도 온도에서 10분간 돌려 완성한다,\n중간중간 뒤적여 주세요.','0091_4.jpg'),(423,76,'오징어는 양쪽에 칼집을 낸다.\n칼집을 내면 구웠을 때 덜 오그라들어요.','0092_1.jpg'),(424,76,'버터, 설탕, 파슬리를 섞는다.\n버터는 실온에 두어 부드럽게 만들어주세요.','0092_2.jpg'),(425,76,'오징어의 양면에 섞은 버터를 바르고 소금, 후추를 뿌린다.','0092_3.jpg'),(426,76,'에어프라이어에 오징어를 넣는다.\n에어프라이어','0092_4.jpg'),(427,76,'160도의 온도에서 15분간 돌려 완성한다.\n중간에 한번 뒤집어 주세요.','0092_5.jpg'),(428,77,'냉동관자는 반으로 자르고 윗면에 칼집을 낸다.','0093_1.jpg'),(429,77,'예열된 팬에 버터를 넣고 녹인 후 다진 마늘을 넣어 볶는다.','0093_2.jpg'),(430,77,'관자를 칼집이 있는 쪽을 넣고 노릇하게 익힌다.','0093_3.jpg'),(431,77,'한쪽이 익으면 양념 재료를 넣어 졸여 완성한다.','0093_4.jpg'),(432,78,'감자는 껍질을 벗겨 나무젓가락을 11자로 놓고 칼로 얇게 자른다.','0094_1.jpg'),(433,78,'버터를 전자레인지에 넣어 약 30초 녹인 후 소금, 후추, 파슬리가루를 넣어 섞는다.\n전자레인지','0094_2.jpg'),(434,78,'양념 버터를 감자에 사이사이에 들어가게 바른다.','0094_3.jpg'),(435,78,'200도로 예열된 오븐에 약 50분간 넣어 구워 낸다.\n오븐','0094_4.jpg'),(436,78,'볼에 소스재료를 넣어 소스를 만든다.','0094_5.jpg'),(437,78,'소스를 감자 위에 뿌려 완성한다.','0094_6.jpg'),(438,79,'삶아서 손질한 토란은 반으로 자른다.','0095_1.jpg'),(439,79,'팬에 식용유, 버터를 두르고 토란을 넣고 볶는다.\n- 버터만 넣으면 쉽게 탈 수 있어요.\n- 약불에서 약 5분간 섞어가며 볶아요.','0095_2.jpg'),(440,79,'소금을 뿌려 간한다.','0095_3.jpg'),(441,79,'토란이 다 익으면 치즈가루, 마늘파우더, 파슬리가루를 뿌려 완성한다.','0095_4.jpg'),(442,80,'감자튀김에 꿀>식용유 순으로 넣고 섞어 에어프라이어 바스켓에 넣고 190도 온도에서 13분간 조리한다.\n에어프라이어','0097_1.jpg'),(443,80,'베이컨도 에어프라이어 바스켓에 넣고 200도 온도에서 7분간 굽는다.\n구운 베이컨은 기름기를 제거하여 잘게 부숴주세요.','0097_2.jpg'),(444,80,'냄비에 소스 재료를 모두 넣어 농도가 날 때까지 끓여 치즈 소스를 만든다.\n네오플램 레트로T 18편수(다크블루)','0097_3.jpg'),(445,80,'접시에 감자튀김을 담고 치즈 소스, 부순 베이컨, 파마산 치즈가루, 파슬리 가루를 뿌려 완성한다.','0097_4.jpg'),(446,81,'깨끗히 씻은 감자는 채칼을 이용해 얇게 슬라이스한다.','0098_1.jpg'),(447,81,'물에 감자를 넣고 20분간 둔다.\n물에 감자를 담궈두면 전분기가 빠져 더욱 바삭해져요.','0098_2.jpg'),(448,81,'키친타올에 올려 물기를 꼼꼼하게 제거한다.','0098_3.jpg'),(449,81,'비닐에 감자, 식용유, 소금, 후추를 넣고 잘 섞는다.','0098_4.jpg'),(450,81,'에어프라이어에 감자를 넣는다.\n에어프라이어','0098_5.jpg'),(451,81,'170도의 온도에서 35분간 돌려 완성한다.\n중간중간 뒤집어 가며 돌려주세요.','0098_6.jpg'),(452,82,'감자는 꼬치에 끼운 후 칼로 돌려가며 칼집을 낸다.','0099_1.jpg'),(453,82,'칼집을 낸 감자는 물에 담가 전분기를 제거한다.','0099_2.jpg'),(454,82,'전분기를 제거한 감자에 소금을 뿌린 후 녹인 버터를 바른다.','0099_3.jpg'),(455,82,'에어프라이어 바스켓에 감자를 넣고 170도 온도에서 30분간 굽는다.\n에어프라이어','0099_4.jpg'),(456,82,'양념 재료를 섞은 후 구워진 감자에 골고루 묻혀 완성한다.','0099_5.jpg'),(457,83,'마늘 슬라이스 하고 대파는 송송 썬다.','0100_1.jpg'),(458,83,'명란젓의 배를 갈라 칼등으로 긁어 껍질을 제거한다.','0100_2.jpg'),(459,83,'끓는 물에 우동면을 2분 간 끓인다.','0100_3.jpg'),(460,83,'달군 팬에 오일을 살짝 두른 후 대파, 마늘, 페페론치노를 넣고 볶는다.','0100_4.jpg'),(461,83,'생크림을 넣고 끓인 후 삶은 우동을 넣고 소금, 후추를 넣는다.','0100_5.jpg'),(462,83,'불을끄고 명란젓, 김을 올려 완성한다.','0100_6.jpg'),(463,84,'대파는 반으로 갈라 5cm 길이로 썰고, 마늘, 생강 편 썬다.','0101_1.jpg'),(464,84,'양파, 표고버섯, 해삼, 죽순은 채 썬다.','0101_2.jpg'),(465,84,'돼지고기는 밑간 재료를 넣고 고루 섞는다.','0101_3.jpg'),(466,84,'팬에 기름을 넉넉히 두르고 돼지고기를 데치듯이 볶아 건진다.','0101_4.jpg'),(467,84,'달군 팬에 기름을 두르고 대파, 생강, 마늘을 볶는다.','0101_5.jpg'),(468,84,'기름에 데친 돼지고기를 넣고 양파, 죽순, 해삼, 표고버섯, 팽이버섯을 넣고 볶는다.','0101_6.jpg'),(469,84,'간장, 청주, 굴소스, 설탕, 치킨육수를 넣고 끓인다.','0101_7.jpg'),(470,84,'전분 물로 농도를 맞춘 후 소금, 후추를 넣고 간을 맞춰 완성한다.\n네오플램 테이블웨어 단독콜라보 M x guggen 구겐 11P 그릇세트','0101_8.jpg'),(471,85,'볼에 양념 재료를 넣고 양념장을 만든다.','0102_1.jpg'),(472,85,'팬에 기름을 두르고 은행이 초록색으로 변할때 까지 볶는다.\n네오플램 노블레스 프라이팬','0102_2.jpg'),(473,85,'볶은 은행은 껍질을 벗긴다.','0102_3.jpg'),(474,85,'팬에 견과류를 약불로 볶다가 양념장, 은행을 넣고 양념장이 졸아들때까지 볶아 완성한다.','0102_4.jpg'),(475,86,'두부는 한 입 크기로 썰고 소금, 후추를 뿌린 뒤 키친타월로 물기를 제거한다.\n물기를 잘 제거해야 튀길 때 튀지 않아요.\n파뷔에 마호가니 원목 도마','0103_1.jpg'),(476,86,'두부는 밀가루>달걀> 빵가루 순으로 튀김옷을 입힌다.','0103_2.jpg'),(477,86,'달군 팬에 기름을 넉넉히 두르고 두부를 앞뒤로 노릇하게 튀긴다.\n네오플램 노블레스 프라이팬','0103_3.jpg'),(478,86,'볼에 소스를 만든 뒤 두부고로케에 곁들여 완성한다.','0103_4.jpg'),(479,87,'느타리 버섯은 결대로 찢고, 표고버섯은 편으로 썰고 백만송이 버섯은 기둥을 잘라 가닥가닥뜯어 준비해요\n라오메뜨 이태리 천연세라믹 트레이 도마','0104_1.jpg'),(480,87,'양파는 얇게 채 썰고 대파는 송송 썰어 준비해요.\n라오메뜨 이태리 천연세라믹 트레이 도마','0104_2.jpg'),(481,87,'예열된 팬에 기름을 두르고 양파, 대파를 넣어 볶아요.\n네오플램 피카 프라이팬','0104_3.jpg'),(482,87,'양파가 반쯤 투명해 지면 버섯을 넣어 볶아요.','0104_4.jpg'),(483,87,'버섯이 숨이 죽으면 다진 마늘, 국간장, 소금, 후추를 넣어 간을 해요.','0104_5.jpg'),(484,87,'불을 끄고 깨소금, 참기름을 넣어 섞어 완성해요.','0104_6.jpg'),(485,88,'부추는 송송 썬다.\n파뷔에 마호가니 원목 도마','0106_1.jpg'),(486,88,'돼지고기에 밑간 재료를 넣고 밑간한다.\n돼지고기는 지방이 적은 등심, 목살 부위가 좋아요.','0106_2.jpg'),(487,88,'볼에 밑간한 돼지고기와 부추를 넣고 섞어 만두소를 만든다.','0106_3.jpg'),(488,88,'만두피 가장자리에 물을 약간 바른 후 만두소를 넣고 반으로 접어 납작하게 누른다.\n만두피는 말랑하게 해동시킨 후 사용해요.','0106_4.jpg'),(489,88,'달군 팬에 기름을 넉넉히 두르고 중불에서 만두를 앞뒤로 노릇하게 부친다.\n네오플램 노블레스 프라이팬','0106_5.jpg'),(490,88,'볼에 양념 재료를 넣고 양념장을 만들어 만두와 곁들여 완성한다.\n쫄면, 떡볶이와 곁들여 먹으면 더욱 맛있어요.','0106_6.jpg'),(491,89,'양파는 채 썰고 대파는 5cm 길이로 썰고 깻잎은 한 입 크기로 썰고 청양고추는 송송 썬다.','0108_1.jpg'),