,'먹기 좋게 썬 소고기에 양념 재료를 넣고 버무려 10분간 재운다.','0124_2.jpg'),(592,103,'달군 팬에 식용유를 두르고 양파를 넣고 볶다가 당근과 홍피망을 넣은 뒤 소금, 후추를 뿌린다','0124_3.jpg'),(593,103,'재운 소고기를 넣고 센불에서 2분간 볶는다.','0124_4.jpg'),(594,103,'청경채를 넣고 전분물을 부어 더 볶아 완성한다.\n전분물은 전분 1:물 2 비율로 넣어요.','0124_5.jpg'),(595,104,'키친타월로 핏물을 뺀 돼지고기 앞다리살을 한 입 크기로 썬다.\n도블레 도마','0125_1.jpg'),(596,104,'냄비에 멸치다시백과 물을 넣어 멸치다시마육수를 만든다.\n네오플램 레트로T 익스클루시브_프리미엄 IH 통주물','0125_2.jpg'),(597,104,'달군 팬에 김치를 넣고 볶다가 돼지고기 앞다리살을 넣고 함께 볶는다.','0125_3.jpg'),(598,104,'고기 색이 변하면 멸치다시마육수를 붓고 양념 재료를 넣는다.','0125_4.jpg'),(599,104,'밥을 넣고 달걀물을 풀어 밥알이 퍼질때까지 한소끔 끓여 완성한다.','0125_5.jpg'),(600,105,'고등어는 쌀뜨물에 20~30분간 담가 비린내를 제거한다.','0126_1.jpg'),(601,105,'대파와 고추는 어슷 썬다.','0126_2.jpg'),(602,105,'볼에 양념 재료를 넣고 양념장을 만든다.','0126_3.jpg'),(603,105,'냄비에 김치를 깔고 고등어, 양념장을 넣은 후 물을 부어 끓인다.','0126_4.jpg'),(604,105,'물이 끓어오르면 중불로 15분간 더 끓인 뒤 고추와 대파를 넣고 한소끔 끓여 완성한다.','0126_5.jpg'),(605,106,'대파와 청양고추는 송송 썬다.','0127_1.jpg'),(606,106,'냄비에 참기름을 두르고 김치를 1~2분간 볶는다.\n네오플램 피카 익스클루시브','0127_2.jpg'),(607,106,'멸치다시마육수를 붓고 끓어오르면 손질 바지락과 칼국수면을 넣는다.\n칼국수면은 밀가루를 털어 넣어요.\n바지락 세척법','0127_3.jpg'),(608,106,'양념 재료를 넣고 청양고추와 대파를 넣어 완성한다.','0127_4.jpg'),(609,107,'두부는 0.5cm 두께로 썰고 양파는 채 썰고 대파는 어슷 썬다.','0129_1.jpg'),(610,107,'달군 팬에 버터를 녹인 후 양파와 김치를 볶는다.\n네오플램 피카 프라이팬','0129_2.jpg'),(611,107,'기름기를 뺀 참치를 넣고 새우분말, 참기름, 통깨를 넣어 볶는다.','0129_3.jpg'),(612,107,'참치김치를 한 쪽으로 몰아둔 뒤 두부를 얹고 물을 붓는다.','0129_4.jpg'),(613,107,'중약불에서 국물이 자작해질때까지 졸인 후 대파를 올려 완성한다.','0129_5.jpg'),(614,108,'물기를 제거한 두부를 2등분한 후 한 입 크기로 썰고 소금, 후추를 뿌린다.','0130_1.jpg'),(615,108,'묵은지에 두부를 올린 뒤 돌돌 만다.\n러브센스 주방 위생장갑','0130_2.jpg'),(616,108,'볼에 달걀을 푼 후 송송 썬 쪽파를 섞어 달걀물을 만든다.','0130_3.jpg'),(617,108,'김치두부말이에 부침가루> 달걀물 순으로 묻힌다.','0130_4.jpg'),(618,108,'달군 팬에 식용유를 두르고 두부김치말이를 넣어 앞뒤로 노릇하게 부쳐 완성한다.\n이음새 부분을 먼저 익혀야 풀리지 않아요.\n네오플램 피카 프라이팬','0130_5.jpg'),(619,109,'마늘은 납작 썰고 양파는 채 썬다.','0131_1.jpg'),(620,109,'차돌박이는 핏물을 뺀 뒤 납작 썬 마늘과 고기양념재료를 넣어 버무린다.\n마늘대신 마늘톡톡 1/4봉을 넣어도 좋아요\n톡톡채소 마늘톡톡','0131_2.jpg'),(621,109,'두부는 흐르는 물에 씻어 그릇에 담아 랩을 씌운 뒤 전자레인지에 3분간 익힌다.\n전자레인지','0131_3.jpg'),(622,109,'데운 두부는 먹기 좋은 크기로 썬다.','0131_4.jpg'),(623,109,'중간 불로 달군 팬에 양념한 차돌박이를 노릇하게 구워 건진다.','0131_5.jpg'),(624,109,'같은 팬에 식용유를 두르고 김치와 양파를 볶다가 참기름을 제외한 볶음김치양념재료를 넣어 볶다가 참기름을 넣어 김치볶음을 완성한다.\n다진마늘 대신 마늘톡톡 1/3봉을 넣고, 매콤함은 청양톡톡을 약간 넣어도 좋아요\n톡톡채소 마늘톡톡, 청양톡톡','0131_6.jpg'),(625,109,'접시에 두부, 볶음김치, 차돌박이, 파채를 담고 두부 위에 검은깨를 뿌려 완성한다.','0131_7.jpg'),(626,110,'베이컨은 3cm 두께로 썬다.','0132_1.jpg'),(627,110,'볼에 다진김치, 고춧가루, 부침가루를 넣고 물은 농도를 봐가며 넣고 섞는다.','0132_2.jpg'),(628,110,'달군 팬에 기름을 넉넉히 두르고 반죽을 부어 부친 뒤 베이컨과 치즈를 올리고 뚜껑을 덮어 익힌다.\n네오플램 피카 프라이팬','0132_3.jpg'),(629,110,'치즈가 녹으면 파슬리가루를 뿌려 완성한다.','0132_4.jpg'),(630,110,'','0132_5.jpg'),(631,111,'양파는 채 썰고 대파는 송송 썰고 베이컨은 1cm 길이로 썬다.','0133_1.jpg'),(632,111,'달군 팬에 기름을 두르고 편마늘, 대파를 넣어 중약불로 볶는다.','0133_2.jpg'),(633,111,'마늘 향이 올라오면 양파, 베이컨을 넣는다.','0133_3.jpg'),(634,111,'베이컨이 익으면 김치를 넣고 간장, 고춧가루, 김치국물을 넣어 볶는다.','0133_4.jpg'),(635,111,'삶은 라면을 넣어 볶은 후 불을 끄고 참기름과 후추를 뿌려 완성한다.\n중간에 면수를 넣어 농도를 조절해요.','0133_5.jpg'),(636,112,'아스파라거스는 밑둥만 필러로 밀어 질긴 끝부분은 썬다.\n어반트렌드 링고 멀티 필러 그레이\n라오메뜨 이태리 천연세라믹 트레이 도마','0137_1.jpg'),(637,112,'감자는 얇게 슬라이스하고, 레몬은 1/2개만 슬라이스한다.','0137_2.jpg'),(638,112,'대구살에 레몬즙, 소금, 후추, 올리브유로 밑간을 한다.','0137_3.jpg'),(639,112,'종이호일에 감자> 아스파라거스> 대구살> 레몬, 방울토마토, 버터, 로즈마리, 타임, 화이트와인, 버터, 소금, 후추를 넣는다.','0137_4.jpg'),(640,112,'종이호일을 덮은 후 가장자리를 접어 완전히 밀봉한다.','0137_5.jpg'),(641,112,'190도로 예열된 오븐에 20~25분간 구워 완성한다.\n오븐\nCOSTEL 2IN1 그라파이트 미니오븐 토스터 CRT-153 (그린)','0137_6.jpg'),(642,113,'양파를 곱게 다진다.','0138_1.jpg'),(643,113,'돼지고기, 소고기, 양파, 우유, 빵가루, 소금, 후추를 넣고 고루 치댄다.','0138_2.jpg'),(644,113,'고기반숙 속에 달걀을 넣고 모양을 잡는다.','0138_3.jpg'),(645,113,'로즈마리를 얹어 쿠킹호일로 덮는다.','0138_4.jpg'),(646,113,'190도 예열된 오븐에 30분간 굽는다.\n오븐','0138_5.jpg'),(647,113,'케찹, 우스터소스를 섞어 구워진 미트로프에 소스를 바른다.','0138_6.jpg'),(648,113,'190도로 예열된 오븐에 10분간 구워 완성한다.','0138_7.jpg'),(649,114,'새우는 물기 제거 후 소금, 후추 간을 한다.','0139_1.jpg'),(650,114,'마늘은 편 썬다.','0139_2.jpg'),(651,114,'팬에 올리브유와 마늘을 넣는다.','0139_3.jpg'),(652,114,'페페론치노와 바질가루를 넣는다.','0139_4.jpg'),(653,114,'소금 후추 간을 해준다.','0139_5.jpg'),(654,114,'잘게 부순 누룽지를 넣는다.','0139_6.jpg'),(655,114,'새우를 넣고 익힌다.','0139_7.jpg'),(656,114,'파슬리가루로 마무리 한다.','0139_8.jpg'),(657,114,'바게트 위에 누룽지감바스를 올려 먹는다.','0139_9.jpg'),(658,115,'양송이버섯, 양파, 파프리카, 피망, 소고기는 큐브모양으로 썬다.\n소고기는 키친타월로 핏물을 제거한 뒤 사용해요.','0140_1.jpg'),(659,115,'소고기는 밑간 재료를 넣고 10분간 재운다.','0140_2.jpg'),(660,115,'볼에 소스 재료를 넣고 소스를 만든다.','0140_3.jpg'),(661,115,'달군 팬에 버터를 두르고 소고기를 굽는다.\n네오플램 노블레스 프라이팬','0140_4.jpg'),(662,115,'소고기의 겉면이 살짝 익으면 채소와 소스를 넣고 익혀 완성한다.','0140_5.jpg'),(663,116,'굴은 옅은 소금물에 씻어 체에 밭쳐 물기를 제거한다','0142_1.jpg'),(664,116,'마늘, 표고버섯은 편썬다.','0142_2.jpg'),(665,116,'청경채 반으로 가르고, 대파는 반으로 갈라 5cm 길이로 썬다.','0142_3.jpg'),(666,116,'오징어는 먹기 좋은 크기로 자른다.','0142_4.jpg'),(667,116,'달군 팬에 기름을 두르고, 마늘, 대파, 건고추를 넣고 볶는다.','0142_5.jpg'),(668,116,'향신채의 향이 충분히 배어나오면 표고버섯, 오징어를 넣고 볶는다.','0142_6.jpg'),(669,116,'간장, 청주, 굴소스를 넣고 볶다가 물, 치킨스톡을 넣고 끓인다.','0142_7.jpg'),(670,116,'육수가 끓으면 청경채, 굴을 넣는다.','0142_8.jpg'),(671,116,'익힌 면을 넣고 한소끔 끓여 소금, 후추, 참기름을 넣고 완성한다.','0142_9.jpg'),(672,117,'생강은 편 썰고 대파, 건고추는 송송 썬다.','0143_1.jpg'),(673,117,'새우는 내장을 제거하고 머리, 껍질을 제거한다.','0143_2.jpg'),(674,117,'달군 팬에 기름을 두르고 건 고추, 생강, 대파를 넣고 향을 낸다.','0143_3.jpg'),(675,117,'향이 충분히 베어나오면 돼지고기를 넣고 볶는다.','0143_4.jpg'),(676,117,'두반장, 설탕, 후추를 넣고 볶다가 새우, 청주를 넣고 익힌다.','0143_5.jpg'),(677,117,'식초를 뿌려 불끄고 완성한다.','0143_6.jpg'),(678,118,'마늘, 생강, 대파는 채 썰고 청경채는 반으로 자른다.\n크기가 큰 청경채는 한 번 더 잘라주세요.','0144_1.jpg'),(679,118,'죽순, 표고버섯은 편 썰고 목이버섯, 팽이버섯은 먹기 좋게 뜯는다.','0144_2.jpg'),(680,118,'오징어는 칼집을 내어 먹기 좋게 자르고, 돼지고기는 채 썬다.','0144_3.jpg'),(681,118,'채 썬 돼지고기에 밑간 재료를 넣고 섞는다.','0144_4.jpg'),(682,118,'냄비에 물을 끓인 후 중화 면을 넣어 삶는다.\n면이 풀어질 정도만 삶아 주세요.\n네오플램 노블레스 20양수냄비','0144_5.jpg'),(683,118,'기름을 넉넉히 두른 팬에 삶아 둔 중화 면을 넣고 앞뒤로 노릇하게 튀긴다.\n물기를 완전히 제거한 뒤 기름에 튀겨주세요.\n네오플램_ 노블레스 프라이팬','0144_6.jpg'),(684,118,'팬에 기름을 두르고 채 썬 마늘, 생강, 대파를 볶다가 밑간 한 돼지고기를 볶는다.','0144_7.jpg'),(685,118,'돼지고기가 노릇해지면 오징어, 새우를 넣고 볶다가 죽순, 버섯들을 넣고 볶는다.','0144_8.jpg'),(686,118,'청경채를 넣고 볶다가 치킨 파우더를 뺀 나머지 양념 재료를 넣어 볶는다.','0144_9.jpg'),(687,118,'물, 치킨 파우더를 넣고 끓이다가 끓어오르면 전분가루와 물을 섞어 전분 물을 만들어 넣어가며 끓인다.\n전분 물로 농도를 조절해주세요.','0144_10.jpg'),(688,118,'농도가 나면 불을 끈 후 참기름을 넣고 섞어 소스를 만든다.','0144_11.jpg'),(689,118,'접시에 튀긴 면을 담고 소스를 올려 완성한다.','0144_12.jpg'),(690,119,'닭을 깨끗이 씻어 준비하고 부추는 2등분하여 준비한다.\n닭 1마리, 부추 1줌','0148_1.jpg'),(691,119,'냄비에 닭을 넣고 옻진액, 물, 소금, 마늘, 대추, 은행을 넣고 약 30분간 끓인다.\n발효 참옻진액 500ml, 물 1500ml, 소금 1/2T, 마늘 8개, 대추 3개, 은행 6개\n냄비','0148_2.jpg'),(692,119,'부추를 넣고 약불에서 끓이면서 완성한다.\n약불\n냄비에 끓이면서 드시면 더욱 좋아요.','0148_3.jpg'),(693,119,'고기를 다 먹은 후 국물에 불린 찹쌀을 넣고 닭죽을 끓인다.\n찹쌀 1cup\n남은 닭고기를 같이 넣어 끓이면 더 맛있어요.','0148_4.jpg'),(694,120,'전복은 손질 하여 준비하고 윗면에 칼집을 낸다.','0149_1.jpg'),(695,120,'예열된 팬에 버터를 넣고 녹인 후 다진 마늘을 넣어 볶는다.','0149_2.jpg'),(696,120,'전복을 넣어 앞뒤로 노릇하게 익힌다.','0149_3.jpg'),(697,120,'전복이 반정도 익으면 양념 재료를 넣어 졸여 완성한다.','0149_4.jpg'),(698,121,'전복은 깨끗하게 씻어 준비한다.','0151_1.jpg'),(699,121,'전복 1개는 이빨과 내장을 제거 한 후 얇게 썬다.','0151_2.jpg'),(700,121,'양파는 채 썰고, 대파, 청양고추는 송송 썰어 준비한다.','0151_3.jpg'),(701,121,'냄비에 물을 부어 끓이고 물이 끓으면 콩나물을 넣어 익힌다.','0151_4.jpg'),(702,121,'콩나물이 익으면 라면, 전복, 새우, 스프를 넣어 한소끔 끓인다.','0151_5.jpg'),(703,121,'고춧가루, 양파, 청양고추, 대파를 넣어 완성한다.','0151_6.jpg'),(704,122,'냄비에 닭가슴살, 마늘, 대파 5cm, 물 4종이컵을 넣는다.','0152_1.jpg'),(705,122,'중불에서 20분간 삶는다. (육수는 버리지 마세요!)','0152_2.jpg'),(706,122,'닭가슴살은 건져 손으로 잘게 찢는다.','0152_3.jpg'),(707,122,'닭가슴살은 마늘, 소금, 후추로 간 한다.','0152_4.jpg'),(708,122,'닭 삶은 육수에 불린찹쌀, 녹두, 대추, 깐 밤을 넣는다.','0152_5.jpg'),(709,122,'뚜껑을 닫고 쌀알이 퍼질 때까지 끓인다.','0152_6.jpg'),(710,122,'쌀알이 다 퍼지면 닭고기를 넣고 3분간 더 끓인다.','0152_7.jpg'),(711,122,'그릇에 죽을 담고 파, 참기름, 깨를 올려 완성한다.','0152_8.jpg'),(712,123,'소갈비는 기름기를 제거하고 칼집을 낸다.','0153_1.jpg'),(713,123,'찬물에 담가 약 2시간정도 핏물을 뺀다.\n2~3번 물을 교체해주세요.','0153_2.jpg'),(714,123,'냄비에 핏물제거한 갈비, 초벌삶기 재료를 넣고 10분간 끓인다.','0153_3.jpg'),(715,123,'찬물에 갈비를 건져 헹군다.','0153_4.jpg'),(716,123,'냄비에 초벌한 갈비, 갈비탕 삶는 재료를 넣고 약 1시간 정도 중불에서 끓인다.','0153_5.jpg'),(717,123,'그릇에 불린당면을 넣고 갈비탕을 담는다.','0153_6.jpg'),(718,123,'국간장, 소금, 후추로 간한다.','0153_7.jpg'),(719,123,'달걀지단, 대파를 올려 완성한다.','0153_8.jpg'),(720,124,'양파와 대파는 채 썰고 청양고추는 송송 썰고 손질 낙지는 한 입 크기로 썬다.','0154_1.jpg'),(721,124,'양념장을 만든다.','0154_2.jpg'),(722,124,'달군 팬에 식용유를 두른 후 양파, 대파를 넣어 볶는다.\n팬을 충분히 달궈야 낙지의 물기가 생기지 않아요.','0154_3.jpg'),(723,124,'낙지, 고기, 청주 1숟가락을 넣고 볶다가 양념장을 넣는다.','0154_4.jpg'),(724,124,'80% 정도 볶아지면 고춧가루 1숟가락을 넣어 살짝 더 볶은 후 통깨를 뿌려 완성한다.\n수분이 생길 때 고춧가루를 넣으면 수분이 줄어들어요.','0154_5.jpg'),(725,125,'토마토는 한 입 크기로 자르고 프랑크 소시지는 어슷 썰어, 양파는 채 썰어 준비한다.\n토마토 1/2개, 프랑크소시지 2개, 양파 1/2개','0155_1.jpg'),(726,125,'팬에 분량의 재료를 모두 넣고 물을 붓는다.\n스파게티면 1인분 [양념재료] 토마토소스 1cup, 물 500ml, .다진마늘 1T\n팬','0155_2.jpg'),(727,125,'13분 정도 끓여 완성한다.\n[선택재료] 파슬리가루 약간','0155_3.jpg'),(728,126,'토마토는 한 입 크기로 자른다.',''),(729,126,'양파는 다져서 준비한다.\n양파 1/4개',''),(730,126,'팬에 올리브오일을 두르고 다진 마늘을 볶는다.\n다진 마늘 1T, 올리브유 1T','0156_3.jpg'),(731,126,'3에 다진 돼지고기를 넣고 후추, 양파를 넣어 볶는다.\n다진 돼지고기 80g, 후추 약간','0156_4.jpg'),(732,126,'4에 토마토소스, 케찹 물을 넣은 후 스파게티 면을 넣고 뚜껑을 덮어 끓여 완성한다.\n스파게티 면 1인분, 토마토소스 1cup, 케찹 1T, 물 300ml [선택 재료] 파슬리가루 약간','0156_5.jpg'),(733,127,'양파는 채 썰고 양송이버섯은 편썬다.','0157_1.jpg'),(734,127,'새우는 칼집을 내고 오징어는 먹기 좋게 자른다.','0157_2.jpg'),(735,127,'뚝배기에 물, 소금을 넣고 끓인 후 스파게티면을 넣어 7분간 익힌다.\n면수는 1/2종이컵 정도 남겨 주세요.','0157_3.jpg'),(736,127,'뚝배기에 올리브오일을 두르고 다진마늘, 양파를 볶는다.','0157_4.jpg'),(737,127,'새우, 오징어, 양송이버섯을 넣어 볶다가 소금, 후추 간을 한다.','0157_5.jpg'),(738,127,'소스재료를 넣고 끓인 후 삶아 둔 면, 면수를 넣고 2분간 더 끓여 완성한다.','0157_6.jpg'),(739,128,'닭안심은 소금, 후추로 밑간한다.','0158_1.jpg'),(740,128,'달군 팬에 베이컨을 넣고 노릇하게 구워 빼둔다.','0158_2.jpg'),(741,128,'베이컨을 익힌 팬에 올리브유, 닭고기, 마늘, 양파를 넣고 익힌다.\n마늘, 양파는 노릇해지면 빼내요.','0158_3.jpg'),(742,128,'닭고기를 빼고 펜네, 물 1종이컵, 우유를 넣고 끓인다.\n중약불로 약 6~7분간 익혀요.','0158_4.jpg'),(743,128,'펜네가 다 익으면 볶은재료, 닭고기, 파마산치즈가루 3숟가락을 넣는다.','0158_5.jpg'),(744,128,'파슬리가루, 소금, 후추로 간 한다.','0158_6.jpg'),(745,128,'접시에 담아 베이컨, 파마산치즈가루를 뿌려 완성한다.','0158_7.jpg'),(746,129,'스팸을 넓게 잘라 대각선으로 자르고 대파는 송송 썰어 준비한다.','0159_1.jpg'),(747,129,'예열된 팬에 기름을 조금 두르고 스팸 5조각을 돌려가며 올리고 한쪽면을 익힌다.','0159_2.jpg'),(748,129,'한쪽면이 익으면 뒤집어서 빈공간에 달걀을 1개씩 올린다.','0159_3.jpg'),(749,129,'달걀 위에 소금, 후추로 간을 하고 대파, 파마산 치즈가루를 뿌린 후 뚜껑을 닫아 약불에서 익힌다.','0159_4.jpg'),(750,129,'기호에 따라 볶은 소고기나 다른 재료를 올려 완성한다.','0159_5.jpg'),(751,130,'생연어는 소금, 후추로 밑간하고 레몬을 올려 잠시 재운다.\n– 집에서 미리 준비해 가면 좋아요.','0160_1.jpg'),(752,130,'예열된 팬에 올리브유를 살짝 두르고 껍질 쪽 먼저 익힌다.','0160_2.jpg'),(753,130,'한쪽이 익으면 버터를 넣고 마늘, 아스파라거스를 넣어 뒷면도 익혀 낸다.','0160_3.jpg'),(754,130,'연어가 80%정도 익으면 소스 재료를 넣어 조려 완성한다.','0160_4.jpg'),(755,131,'표고버섯과 양파는 채썰고 대파는 떡볶이떡 길이와 비슷하게 썬다.','0161_1.jpg'),(756,131,'볼에 양념 재료를 넣고 양념장을 만든다.','0161_2.jpg'),(757,131,'달군 팬에 기름을 두르고 양파를 볶는다.\n네오플램 피카 익스클루시브','0161_3.jpg'),(758,131,'양파가 투명해지면 떡볶이떡, 해물을 볶다가 버섯, 양념 재료를 넣고 볶는다.\n떡이 딱딱하다면 끓는 물에 1분간 데쳐요.','0161_4.jpg'),(759,131,'불을 끄고 참기름을 두른 뒤 통깨를 뿌려 완성한다.','0161_5.jpg'),(760,132,'끓는 물에 떡볶이 떡을 2~3분간 데친다.\n네오플램 레트로T 편수냄비 다크블루','0162_1.jpg'),(761,132,'양파는 다지고, 피망, 슬라이스햄, 양송이버섯은 먹기 좋은 크기로 자른다.','0162_2.jpg'),(762,132,'달군 팬에 기름을 두르고 양파를 볶아 양파가 투명해지면 햄, 콘옥수수를 볶는다\n콘옥수수는 물기를 제거해주세요\n네오플램 피카 편수냄비','0162_3.jpg'),(763,132,'토마토소스, 설탕, 떡볶이 떡을 넣고 함께 볶는다.','0162_4.jpg'),(764,132,'모짜렐라치즈>피망, 버섯>올리브>파슬리가루 순서대로 올린 후 뚜껑을 덮어 치즈를 녹인다.\n약불','0162_5.jpg'),(765,133,'쪽파는 송송 썰고 양파, 마늘, 생강은 다져서 준비한다.','0163_1.jpg'),(766,133,'돼지고기 다짐육은 키친타월에 핏물을 제거한다.','0163_2.jpg'),(767,133,'팬에 기름을 두르고 다진 생강, 다진 마늘, 다진 양파를 넣고 양파가 투명해질 때까지 볶는다.\n[브랜드특가] 네오플램 피카 쁘띠웍/프라이팬/양수냄비/곰솥/궁중팬 6종(무료배송)','0163_3.jpg'),(768,133,'3에 다진 돼지고기를 넣고 볶다가 맛술, 소금, 후추를 넣고 고기가 익을 때까지 볶는다.','0163_4.jpg'),(769,133,'물과 고형 카레를 넣고 볶는다.','0163_5.jpg'),(770,133,'밥위에 커리를 올리고 달걀 노른자와 쪽파를 곁들여 완성한다.','0163_6.jpg'),(771,134,'닭은 꽁지, 날개끝, 기름을 제거하고, 닭표면을 소금으로 문질러 닦고, 물에 헹군다.','0164_1.jpg'),(772,134,'녹인 버터, 오일, 소금, 후추, 파슬리가루를 모두 섞는다.','0164_2.jpg'),(773,134,'닭 표면과 안쪽까지 잘 발라 10분이상 재운다.\n닭 표면에 나무 꼬지 같은 걸로 찔러서 양념이 베이도록 하면 좋아요','0164_3.jpg'),(774,134,'에어프라이어에 닭을 넣고, 온도 180도, 시간 20분을 맞춰 익힌다.\n에어프라이어','0164_4.jpg'),(775,134,'닭을 뒤집고, 온도 180도, 시간 20분을 맞춰 익힌다.','0164_5.jpg'),(776,134,'닭을 꺼내 보아 나무 꼬지로 찔러 보아 다 익었으면 꺼낸다.\n마지막 5분전 쯤 통마늘이나 레몬을 같이 넣고 구워 곁들여도 좋아요.','0164_6.jpg'),(777,135,'닭날개를 포크로 찔러 칼집을 낸다.','0165_1.jpg'),(778,135,'버터, 올리브오일, 다진마늘, 소금, 후추, 건바질을 넣고 고루 버무린다.','0165_2.jpg'),(779,135,'냉장고에서 30분간 마리네이드를한다.','0165_3.jpg'),(780,135,'에어프라기에 넣고 190도 20분간 구워 완성한다.\n에어프라이어\n중간에 뒤집어 주면서 구워주세요','0165_4.jpg'),(781,136,'식빵의 가장자리를 잘라낸 후 4등분한다.','0166_1.jpg'),(782,136,'차퍼에 손질 생새우와 반죽 재료를 넣고 다져 잘 치댄다.\n멀티 차퍼','0166_2.jpg'),(783,136,'식빵 위에 새우반죽을 올린 후 다른 식빵으로 덮는다.','0166_3.jpg'),(784,136,'에어프라이어에 멘보샤를 넣고 기름을 약간 뿌린 후 180도에서 7분간 익힌 후 뒤집어 3~4분간 튀겨 완성한다.\n에어프라이어\n칠리소스에 찍어 먹으면 더욱 맛있어요.','0166_4.jpg'),(785,137,'등갈비는 찬물에 1시간 이상 담궈 핏물을 뺀다.','0167_1.jpg'),(786,137,'냄비에 물, 월계수잎, 통후추, 마늘, 대파, 양파를 넣고 끓인 후 등갈비를 넣어 데친다.\n네오플램 피카 18편수냄비','0167_2.jpg'),(787,137,'데친 등갈비에 소금, 후추, 식용유로 밑간 후 밀가루를 살짝 묻힌다.','0167_3.jpg'),(788,137,'에어프라이어 바스켓에 등갈비를 넣고 180도 온도에서 15분간 굽는다.\n에어프라이어','0167_4.jpg'),(789,137,'양념재료를 섞어 양념장을 만든 후 구운 등갈비를 넣고 섞어 골고루 묻힌다.','0167_5.jpg'),(790,137,'에어프라이어에 등갈비를 넣고 190도 온도에서 5분간 더 구워 완성한다.','0167_6.jpg'),(791,138,'당근, 양파, 깻잎은 채 썰고 치커리는 먹기 좋게 뜯는다.','0169_1.jpg'),(792,138,'닭다리살은 양념 재료를 넣고 섞어 밑간한다.','0169_2.jpg'),(793,138,'에어프라이어 바스켓에 양념한 닭다리살을 넣고 180도 온도에서 15분간 굽는다.\n에어프라이어','0169_3.jpg'),(794,138,'구운 닭다리살은 먹기 좋게 자른다.','0169_4.jpg'),(795,138,'접시에 손질한 채소를 둘러 담고 닭다리살을 올린 후 떡쌈을 곁들여 완성한다.','0169_5.jpg'),(796,139,'양파, 파프리카는 손질하여 굵게 채 썰고 양상추는 손으로 먹기 좋게 찢는다.','0170_1.jpg'),(797,139,'소고기는 굵게 채 썰어 고기 양념 재료를 넣고 버무려 섞는다.\n취향에 따라 고수를 가감해요.','0170_2.jpg'),(798,139,'토마토 살사 재료를 고루 섞어 곁들일 살사를 만든다.','0170_3.jpg'),(799,139,'에어프라이어 바스켓에 양념 한 고기를 넣고 190도 온도에서 5분간 굽는다.\n에어프라이어','0170_4.jpg'),(800,139,'고기가 구워지면 채 썬 양파, 파프리카를 한쪽에 넣고 10분간 더 익힌다.','0170_5.jpg'),(801,139,'접시에 구운 소고기, 구운 채소, 양상추를 담고 토마토 살사와 사워크림, 모차렐라 치즈, 토르티야를 곁들여 완성한다.\n토르티야는 전자레인지에 조리하거나 에어프라이어 170도에서 5분간 구워 주세요.','0170_6.jpg'),(802,139,'토르티야에 소고기, 채소, 살사, 치즈 등을 넣어 돌돌 말아 먹는다.','0170_7.jpg'),(803,140,'양파는 가늘게 채썰고 방울토마토는 4등분해 준비한다.','0172_1.jpg'),(804,140,'프랑크소시지는 벌집모양으로 칼집을 낸다.','0172_2.jpg'),(805,140,'팬에 식용유를 두르고 소시지를 넣어 노릇하게 굽는다.','0172_3.jpg'),(806,140,'팬에 버터를 넣고 녹으면 설탕, 양파, 방울토마토, 식초, 소금, 후추를 넣고 볶은 뒤 구운 소시지에 올려 완성한다.','0172_4.jpg'),(807,141,'모닝빵 윗부분을 약간 자르고 프랑크 소시지는 칼집을 낸다.','0173_1.jpg'),(808,141,'모닝빵에 달걀물을 입힌다.','0173_2.jpg'),(809,141,'베이컨 끝 지점에 모닝빵, 프랑크소시지를 올리고 돌돌 만다.\n- 베이컨 끝부분이 빵 아래로 가게 해주세요.','0173_3.jpg'),(810,141,'달군 팬에 기름을 두르고 중불로 익힌 후 케첩, 파마산치즈가루, 파슬리가루를 뿌려 완성한다.\n- 베이컨 끝부분부터 구워야 풀리지 않아요.','0173_4.jpg'),(811,142,'소시지바는 꼬치를 빼 준비한다.','0174_1.jpg'),(812,142,'볼에 달걀을 풀고 다진당근, 다진대파, 소금, 후추를 넣고 섞어 달걀물을 만든다.','0174_2.jpg'),(813,142,'팬에 달걀물을 살짝 붓고 치즈, 소세지바를 올려 만다.','0174_3.jpg'),(814,142,'달걀물을 추가해가며 달걀말이를 만들어 완성한다.','0174_4.jpg'),(815,143,'양파와 피클은 다진다.','0175_1.jpg'),(816,143,'소시지는 칼집을 낸 후 달군 팬에 기름을 두르고 소시지를 넣어 굽는다.\n소시지는 끓는 물에 살짝 데쳐 사용하면 불순물이 제거돼요.','0175_2.jpg'),(817,143,'핫도그빵에 마요네즈를 바르고 슬라이스치즈> 소시지> 다진 피클> 다진 양파를 넣는다.','0175_3.jpg'),(818,143,'케첩, 머스터드 소스를 뿌려 완성한다.','0175_4.jpg'),(819,144,'김을 정사각형으로 잘라 위, 아래를 11자로 자른다.','0176_1.jpg'),(820,144,'밥을 가운데에 넣고 주변을 접어 랩으로 감싸 고정한다.','0176_2.jpg'),(821,144,'소시지에 칼집을 내고, 닭 안심은 맛술, 소금, 후추, 올리브오일로 밑간을 한다.','0176_3.jpg'),(822,144,'김을 감싼 밥에 칼집에 내어 로메인 -> 소시지 또는 닭안심 사이에 넣고 완성한다\n돈가스소스나 케찹을 뿌려 드세요~','0176_4.jpg'),(823,145,'프랑크소시지의 칼집을 낸다.','0177_1.jpg'),(824,145,'달군 냄비에 식용유를 두르고 다진 양파, 다진 마늘을 볶다가 다진 쇠고기를 넣어 볶는다.\n네오플램 노블레스 프라이팬','0177_2.jpg'),(825,145,'소고기의 핏기가 없어지면 소스 재료를 넣고 농도가 걸죽해질때까지 끓인다.','0177_3.jpg'),(826,145,'달군 팬에 식용유를 두르고 프랑크소시지를 굽는다.\n끓는물에 소시지를 데치면 불순물이 빠져요.','0177_4.jpg'),(827,145,'핫도그빵에 프랑크소시지를 넣고 칠리소스를 얹는다.\n핫도그빵은 마른 팬에 살짝 굽거나 전자레인지에 30초 돌려요.','0177_5.jpg'),(828,145,'슈레드치즈와 파슬리가루를 뿌려 완성한다.','0177_6.jpg'),(829,146,'양파는 채 썰고 대파와 청양고추는 어슷 썰고 돼지고기와 두부는 한입 크기로 잘라 준비한다.','0179_1.jpg'),(830,146,'중간 불로 달군 팬에 들기름을 두르고 돼지고기와 묵은지, 설탕을 넣고 볶는다.\n돼지고기의 잡내는 마늘톡톡 1/2숟가락을 넣어 잡아도 좋아요','0179_2.jpg'),(831,146,'쌀뜨물과 김칫국물을 붓고 끓어오르면 중약 불로 줄여 15분 정도 끓인다.\n쌀뜨물 대신 물2종이컵, 더맛국물요리 1/2봉을 넣어 국물의 맛을 내도 좋아요\n톡톡채소 더맛국물요리','0179_3.jpg'),(832,146,'채 썬 양파와 된장, 국간장, 고춧가루를 넣고 10분 정도 끓인다.','0179_4.jpg'),(833,146,'다진 마늘을 넣고 대파와 고추, 두부를 얹어 5분간 더 끓여 완성한다.\n칼칼한 맛은 청양톡톡을 약간 넣어주세요\n톡톡채소 청양톡톡','0179_5.jpg'),(834,147,'대파, 홍고추, 청양고추는 어슷썰고 두부는 깍뚝썬다.','0181_1.jpg'),(835,147,'통조림햄은 0.5cm 두께로 썰고 비엔나소시지는 2~3군데 어슷하게 칼집을 낸다.','0181_2.jpg'),(836,147,'배추김치는 2cm 두께로 썬다.','0181_3.jpg'),(837,147,'볼에 양념재료를 넣고 고루 섞는다.','0181_4.jpg'),(838,147,'냄비에 손질된 재료를 넣고 양념장을 넣은 뒤 사골육수를 붓고 센불에서 10분간 끓인다.','0181_5.jpg'),(839,147,'홍고추, 청양고추, 대파를 넣고 중불에서 2~3분간 더 끓여완성한다.','0181_6.jpg'),(840,148,'옥수수는 꼬치에 끼우거나 2~3등분으로 토막낸다.\n시판 노랑 옥수수 2개\n나무꼬치 2개','0183_1.jpg'),(841,148,'중약 불로 달군 팬에 버터(2큰술), 마요네즈(2큰술), 설탕(1큰술), 소금(1/5큰술), 고운 고춧가루(소금(1/5큰술)를 넣고 끓인다.\n팬','0183_2.jpg'),(842,148,'옥수수를 넣고 노릇한 색이 나도록 굴려가며 굽는다.','0183_3.jpg'),(843,148,'그릇(유산지를 깐 나무바구니)에 담고 취향에 맞게 토핑 가루를 뿌려 마무리.\n토핑가루: 파슬리가루, 파마산치즈가루','0183_4.jpg'),(844,149,'옥수수는 4등분한다.','0184_1.jpg'),(845,149,'팬에 버터를 녹인다.','0184_2.jpg'),(846,149,'옥수수를 넣어 돌려가며 굽는다.','0184_3.jpg'),(847,149,'다진마늘과 꿀을 넣고 굽는다.\n재료가 타지 않도록 약불로 뒤집어가며 구워주세요.','0184_4.jpg'),(848,149,'접시에 담고 갈릭후레이크, 파마산치즈, 파슬리가루를 뿌려 완성한다.','0184_5.jpg'),(849,150,'옥수수의 알을 분리한다.','0185_1.jpg'),(850,150,'끓는 물에 옥수수알, 설탕 3숟가락을 넣고 10분간 삶는다.','0185_2.jpg'),(851,150,'팬에 물 1L, 설탕 1/3종이컵, 소금 1숟가락을 넣고 끓인다.','0185_3.jpg'),(852,150,'설탕, 소금이 다 녹으면 삶은 옥수수를 넣고 한소끔 끓인다.','0185_4.jpg'),(853,150,'용기에 담아 완전히 식힌 후 냉장고에 넣어 2주내로 섭취한다.','0185_5.jpg'),(854,151,'오레오 6개는 반 갈라 크림을 제거한 후 지퍼백에 넣어 밀대로 부순다.','0187_1.jpg'),(855,151,'볼에 달걀을 풀고 녹인 버터, 우유, 핫케이크가루, 분태 오레오를 넣고 섞는다.','0187_2.jpg'),(856,151,'와플 메이커에 반죽을 넣고 앞 4분 뒤집어 4분 약불로 굽는다.\n- 와플 메이커에 반죽을 넣고 앞 4분 뒤집어 4분 약불로 굽는다.','0187_3.jpg'),(857,151,'와플에 생크림을 바르고 오레오쿠키로 장식해 완성한다.','0187_4.jpg'),(858,152,'오레오는 크림을 제거한 후 잘게 부순다.\n오레오 2봉지','0188_1.jpg'),(859,152,'1에 버터를 섞는다.\n버터 40g','0188_2.jpg'),(860,152,'케이크 틀에 2를 깐다.','0188_3.jpg'),(861,152,'볼에 크림치즈, 달걀, 설탕을 넣고 섞는다.\n크림치즈 250g, 달걀 1개, 설탕 35g\n볼','0188_4.jpg'),(862,152,'4를 3에 붓는다.','0188_5.jpg'),(863,152,'165도로 예열된 오븐에 30분 구워 완성한다.\n오븐','0188_6.jpg'),(864,153,'오레오는 반으로 갈라 크림을 제거한다.','0189_1.jpg'),(865,153,'볼에 크림치즈를 푼 후 설탕을 섞는다.','0189_2.jpg'),(866,153,'볼에 생크림을 붓고 70~80%만 휘핑한다.','0189_3.jpg'),(867,153,'크림치즈에 생크림을 넣고 섞어 크림을 만든다.','0189_4.jpg'),(868,153,'밀폐용기에 오레오>크림>오레오>크림 순으로 반복해 쌓는다.','0189_5.jpg'),(869,153,'밀폐용기에 쌓였으면 마지막에 오레오를 부셔 뿌려 완성한다.\n냉장고에 2~3시간 보관해 차게 드시면 더욱 맛있어요.','0189_6.jpg'),(870,154,'오레오 과자 안에 크림을 제거한다.\n오레오 과자(50g) 1봉','0190_1.jpg'),(871,154,'믹서기에 오레오 과자와 우유, 얼음, 아이스크림을 넣고 간다.\n바닐라 아이스크림 1cup, 얼음 1cup, 우유 1cup\n믹서기','0190_2.jpg'),(872,154,'갈아낸 재료를 컵에 따른다.','0190_3.jpg'),(873,154,'생크림을 올려 완성한다.\n생크림 적당량','0190_4.jpg'),(874,155,'실온의 녹인 버터를 푼 후 슈가파우더를 넣어 섞은 후 바닐라 익스트렉을 넣는다.','0191_1.jpg'),(875,155,'박력분을 체쳐 넣은 후 날가루가 안보일 때까지 섞는다.','0191_2.jpg'),(876,155,'오레오를 부셔 넣어 섞는다.','0191_3.jpg'),(877,155,'스쿱으로 떠서 180도 예열된 오븐에 12~14분간 구워 완성한다.\n오븐','0191_4.jpg'),(878,156,'2개는 크림을 제거하고 곱게 부셔 토핑으로 준비해요.','0192_1.jpg'),(879,156,'과자 5개는 지퍼팩에 넣어 잘게 부셔요.','0192_2.jpg'),(880,156,'지퍼팩에 우유, 오레오, 연유를 넣어 냉동실에 3시간 이상 보관해요.','0192_3.jpg'),(881,156,'냉동한 유유를 꺼내어 방망이로 두드려요.','0192_4.jpg'),(882,156,'그릇에 우유얼음을 담아요.','0192_5.jpg'),(883,156,'취향에 따라 생크림, 과자, 초콜릿 시럽, 연유 등을 토핑으로 올려 완성해요.','0192_6.jpg'),(884,157,'오레오쿠키 3개는 반으로 자르고, 3개는 크림을 제거하고 봉투에 담아 밀대로 밀어준다.','0193_1.jpg'),(885,157,'버터는 부드럽게 풀어주고, 설탕을 조금씩 넣고 섞는다.','0193_2.jpg'),(886,157,'계란도 하나씩 넣고 섞는다.','0193_3.jpg'),(887,157,'박력분, 베이킹파우더는 체에 쳐서 섞는다.','0193_4.jpg'),(888,157,'우유, 소금, 오레오가루를 넣고 섞는다.','0193_5.jpg'),(889,157,'틀에 유산지를 깔고 머핀반죽을 80%만 채운다.','0193_6.jpg'),(890,157,'반으로 자른 오레오를 올린다.','0193_7.jpg'),(891,157,'예열된 오븐에 180도 20분간 굽는다.\n오븐\n이쑤시개로 머핀을 찔렀을 때 반죽이 묻어나오지 않으면 익은거예요','0193_8.jpg'),(892,157,'머핀을 한 김 식히고 슈가파우더를 올려 완성한다.','0193_9.jpg'),(893,159,'냄비에 불린 쌀 1종이컵, 물 1종이컵 동량으로 넣고 강불에서 3분간 끓인다.','0198_1.jpg'),(894,159,'중불에서 5분, 약불에서 7분간 끓인다.','0198_2.jpg'),(895,159,'불끄고 5분간 뜸을 들인다.\n뚜껑을 열지 않는다.','0198_3.jpg'),(896,159,'완성된 밥을 고루 저어 완성한다.','0198_4.jpg'),(897,160,'사과, 토마토, 당근은 큼직하게 잘라 준비한다.','0200_1.jpg'),(898,160,'믹서기에 사과, 토마토, 당근, 올리브유, 얼음, 꿀을 넣는다.\n너무 차가운 얼음이 아침에 부담스러우면 물로 대체해 주세요.','0200_2.jpg'),(899,160,'곱게 갈아 완성한다.\n잘 갈리지 않을 때는 물을 반컵 추가해 주세요.','0200_3.jpg'),(900,161,'양배추, 바나나는 한 입 크기로 썬다.','0201_1.jpg'),(901,161,'믹서기에 모든 재료를 넣고 간다.','0201_2.jpg'),(902,161,'컵에 따라 완성한다.','0201_3.jpg'),(903,162,'바나나는 껍질을 벗겨 한 입 크기로 썬다.',''),(904,162,'믹서기에 모든 재료를 넣고 간다.',''),(905,162,'컵에 따라 2를 붓고 완성한다.',''),(906,163,'배는 껍질을 벗겨 한 입 크기로 썬다.','0203_1.jpg'),(907,163,'믹서기에 배 음료, 한 입 크기로 썬 배를 넣고 간다.','0203_2.jpg'),(90