g'),(944,172,'우유를 조금씩 넣어가며 저어 초코우유를 만든다.','0214_4.jpg'),(945,173,'귤은 껍질을 벗겨 반은 잘게 다지고 반은 믹서기에 돌린다.','0216_1.jpg'),(946,173,'냄비에 믹서기에 돌린 귤과 설탕을 넣어 약불로 끓인다.','0216_2.jpg'),(947,173,'잔에 2를 넣고 다진 귤, 우유를 부어 완성한다.','0216_3.jpg'),(948,174,'바나나는 1개는 깍둑썬다.','0217_1.jpg'),(949,174,'바나나 1개와 설탕을 넣고 으깬 후 약불로 5~10분간 끓인 후 식힌다.','0217_2.jpg'),(950,174,'컵에 2와 깍둑 썬 바나나를 넣고 우유를 부어 완성한다.','0217_3.jpg'),(951,175,'자색고구마는 껍질을 벗긴 후 한 입 크기로 썰어 전자레인지에 7분 돌려 찐다.\n전자레인지','0218_1.jpg'),(952,175,'믹서기에 삶은 자색고구마, 우유, 꿀을 넣고 간다.\n시원한 느낌을 원하시면 얼음 1종이컵을 넣어주세요.','0218_2.jpg'),(953,175,'컵에 얼음을 담고 2를 부어 완성한다.','0218_3.jpg'),(954,176,'냄비에 물을 끓인다.','0219_1.jpg'),(955,176,'물이 끓으면 검정콩을 넣고 30분간 삶는다.','0219_2.jpg'),(956,176,'바나나는 자른다.','0219_3.jpg'),(957,176,'믹서에 검정콩, 바나나, 우유, 꿀을 넣어 간다.','0219_4.jpg'),(958,176,'컵에 담아 완성한다.\n검정콩은 피부미용, 혈액순환에 좋아요.','0219_5.jpg'),(959,177,'믹서기에 복숭아쨈과 얼음, 복숭아 1개를 넣고 되직하게 간다.','0220_1.jpg'),(960,177,'컵에 1를 담아준 후 우유를 붓는다.','0220_2.jpg'),(961,177,'복숭아 1/2개를 얇게 슬라이스해 올리고 애플민트를 꽂아 완성한다.\n복숭아의 맛을 더 느끼고 싶다면 복숭아를 다져 넣어주세요.','0220_3.jpg'),(962,178,'볼에 밀가루, 물을 넣고 섞어 밀가루물을 만든다.','0221_1.jpg'),(963,178,'팬에 기름을 두르고 만두를 굽는다.','0221_2.jpg'),(964,178,'노릇해지기 전에 밀가루물을 붓고 뚜껑을 덮는다.','0221_3.jpg'),(965,178,'약불에서 오랫동안 구워 밑부분이 바삭바삭해지면 꺼내어 완성한다.','0221_4.jpg'),(966,179,'팬에 기름을 두르고 만두를 뚜껑을 덮고 노릇하게 굽는다.','0222_1.jpg'),(967,179,'간장, 물을 넣고 뚜껑을 열고 끓인다.','0222_2.jpg'),(968,179,'바글바글 끓으면 고르게 푼 계란을 넣고 한쪽 면만 익혀 완성한다.\n중약불\n계란 주변을 젓가락으로 저어 주세요','0222_3.jpg'),(969,180,'홍고추와 청양고추는 송송 썰고 당근은 다진다.','0223_1.jpg'),(970,180,'분짜소스재료를 분량대로 섞은 뒤 손질한 채소를 넣는다.','0223_2.jpg'),(971,180,'팬에 식용유를 두른 뒤 냉동만두를 넣어 중간 불로 3~4분간 굽는다.','0223_3.jpg'),(972,180,'물 2숟가락을 넣은 뒤 뚜껑을 덮어 2~3분간 더 굽는다.\n물이 증발하면서 만두가 고루 익고 촉촉해져요.','0223_4.jpg'),(973,180,'접시에 만두와 어린잎채소를 담고 분짜소스를 끼얹어 완성한다.','0223_5.jpg'),(974,181,'대파, 홍고추, 청양고추를 굵게 다진다.','0224_1.jpg'),(975,181,'양상추를 먹기 좋은 크기로 자르고, 레몬은 슬라이스한다.','0224_2.jpg'),(976,181,'팬에 기름을 충분히 두르고 노릇노릇하게 굽는다.\n만두를 에어프라이어 180도에서 10분간 구워도 좋아요','0224_3.jpg'),(977,181,'소스재료를 고루 섞는다.','0224_4.jpg'),(978,181,'완성그릇에 양상추를 깔고 만두, 레몬을 얹어 소스를 뿌려 완성한다.','0224_5.jpg'),(979,182,'양파는 채 썰고 베이컨은 1cm두께로 썬다.','0225_1.jpg'),(980,182,'달군 팬에 기름을 두르고 만두를 굽는다.','0225_2.jpg'),(981,182,'달군 팬에 기름을 두르고 양파, 편마늘, 베이컨을 넣어 볶는다.','0225_3.jpg'),(982,182,'마늘향이 올라오면 토마토소스, 생크림을 넣고 중약불로 끓인다.','0225_4.jpg'),(983,182,'소금, 후추를 뿌린 뒤 만두를 넣어 한소끔 끓이고 파슬리가루를 뿌려 완성한다.','0225_5.jpg'),(984,183,'볼에 튀김가루, 달걀을 넣고 섞어 튀김반죽을 만든다.','0226_1.jpg'),(985,183,'만두에 튀김반죽> 빵가루 순으로 튀김옷을 입힌다.\n취향에 따라 빵가루에 파슬리가루를 넣어도 좋아요.','0226_2.jpg'),(986,183,'예열된 기름에 만두를 노릇하게 튀긴다.\n네오플램 노블레스 프라이팬','0226_3.jpg'),(987,183,'볼에 소스 재료를 넣고 소스를 만든 뒤 튀긴만두와 곁들여 완성한다.','0226_4.jpg'),(988,184,'물만두는 에어프라이어에 180도에서 7분간 굽고 뒤집어 3분 더 굽는다.\n에어프라이어','0227_1.jpg'),(989,184,'볼에 소스 재료를 넣고 소스를 만든다.','0227_2.jpg'),(990,184,'팬에 소스를 넣고 한소끔 끓인다.','0227_3.jpg'),(991,184,'소스에 구운 만두를 넣고 섞은 뒤 다진 땅콩을 뿌려 완성한다.','0227_4.jpg'),(992,185,'팬에 고추기름재료를 넣고 약한 불로 2분간 볶아 불을 끈다.\n고추가루가 타지 않도록 최대한 약한 불에서 천천히 볶아요.','0228_1.jpg'),(993,185,'한 김 식힌 뒤 설탕, 식초, 간장을 넣고 섞는다.','0228_2.jpg'),(994,185,'끓는 물에 물만두를 넣어 3분간 삶아 건진다.','0228_3.jpg'),(995,185,'간을 봐가며 고추기름 양념장을 조절해 넣고 가볍게 버무린다.\n양념장을 한번에 다 넣지 말고 취향에 맞게 양을 조절해요.','0228_4.jpg'),(996,185,'접시에 담은 뒤 송송 썬 쪽파를 뿌려 완성한다.','0228_5.jpg'),(997,186,'손질된 닭을 우유에 30분간 재운 뒤 흐르는 물에 한 번 헹궈 물기를 제거해요.\n닭을 우유에 30분간 재우면 누린내가 제거돼요.','0230_1.jpg'),(998,186,'볼에 튀김가루, 물을 섞은 후 닭을 넣어 튀김옷을 입힌다.\n튀김가루:물은 1:1비율','0230_2.jpg'),(999,186,'팬에 식용유를 넉넉히 붓고 7분간 튀겨 건진 후 2분간 한 번 더 튀긴다.\n튀기는 온도는 170~180도','0230_3.jpg'),(1000,186,'볼에 양념 재료를 넣고 양념장을 만든 후 달군 팬에 약불로 3분간 조린다.','0230_4.jpg'),(1001,186,'볼에 치킨, 양념장을 넣고 버무려 완성한다.\n짤 수 있으니 양념장을 조금씩 넣어가며 버무려요.','0230_5.jpg'),(1002,187,'명란젓은 흐르는 물에 헹궈 물기를 제거한다.','0231_1.jpg'),(1003,187,'오이는 필러로 듬성듬성하게 껍질을 벗긴 뒤 어슷하게 납작 썬다.','0231_2.jpg'),(1004,187,'중불로 달군 팬에 식용유를 두르고 명란젓을 앞뒤로 노릇하게 굽는다.','0231_3.jpg'),(1005,187,'먹기 좋은 크기로 썰어 오이와 함께 접시에 담고 마요네즈와 와사비를 곁들여 완성한다.','0231_4.jpg'),(1006,188,'양파, 양송이는 잘게 다진다.','0233_1.jpg'),(1007,188,'감자는 깍뚝썰어 랩을 씌운 후 6분간 전자레인지에 조리한다.\n전자레인지','0233_2.jpg'),(1008,188,'팬에 올리브유를 두르고 양파, 양송이를 볶는다.\n네오플램 피카 프라이팬','0233_3.jpg'),(1009,188,'익은 감자는 으깨 볶은 양파, 양송이, 버터, 밀가루, 소금 1/2숟가락, 후추를 넣고 섞어 3덩어리를 만든다.','0233_4.jpg'),(1010,188,'베이컨 4장을 +자로 펼쳐 한 덩어리를 얹어 감싼다.','0233_5.jpg'),(1011,188,'이쑤시개로 고정한 후 후추를 뿌린다.','0233_6.jpg'),(1012,188,'팬에 노릇하게 구운 후 스테이크 소스를 뿌려 완성한다.\n트라몬티나 폴리우드 커트러리','0233_7.jpg'),(1013,189,'물에 소금을 넣고 감자를 삶는다.','0234_1.jpg'),(1014,189,'삶은 감자는 껍질을 벗긴 후 으깬다.\n감자는 뜨거울때 으깨야 잘 으깨져요.','0234_2.jpg'),(1015,189,'소금, 설탕, 찹쌀가루를 넣고 섞어 반죽을 만든다.\n반죽이 너무 퍽퍽하다면 물을 조금 넣어주세요.\n글러브센스 주방 위생장갑','0234_3.jpg'),(1016,189,'반죽을 동그랗게 빚은 후 달군 팬에 식용유를 두르고 반죽을 앞뒤로 노릇하게 굽는다.','0234_4.jpg'),(1017,189,'꿀과 다진 견과류를 뿌려 완성한다.\n네오플램 노블레스 프라이팬','0234_5.jpg'),(1018,190,'감자는 굵게 깍뚝썬다.','0235_1.jpg'),(1019,190,'볼에 물 1숟가락을 넣고 랩을 씌워 전자레인지에 5분간 조리한다.\n전자레인지','0235_2.jpg'),(1020,190,'감자를 으깨 전분, 소금을 넣고 섞는다.','0235_3.jpg'),(1021,190,'스프링치즈를 2cm 길이로 자른다.','0235_4.jpg'),(1022,190,'감자반죽에 치즈를 넣고 동그랗게 만든다.','0235_5.jpg'),(1023,190,'175~180도 예열된 기름에 튀겨 완성한다.\n기름을 충분히 바른후 에어프라이어에 180도 / 20분간 구워도 좋아요\n네오플램 피카 프라이팬','0235_6.jpg'),(1024,191,'대파와 양배추는 같은 크기로 작게 썰고 어묵도 한입 크기로 썰어 준비한다.','0239_1.jpg'),(1025,191,'팬에 물2컵을 넣고 고추장1큰술, 고춧가루1큰술, 설탕2큰술, 간장3큰술을 넣어 끓인다.','0239_2.jpg'),(1026,191,'양념이 끓어오르면 준비한 채소와 어묵을 넣는다.','0239_3.jpg'),(1027,191,'한소끔 끓기 시작하면 면을 넣고 자작하게 졸인 후 완성한다.','0239_4.jpg'),(1028,192,'방울토마토, 메추리알은 4등분한다.','0240_1.jpg'),(1029,192,'적양파, 노랑파프리카, 빨간파프리카는 사방 1.5cm 크기로 자른다.','0240_2.jpg'),(1030,192,'아보카도는 반을 갈라 씨를 제거하고 사방 1.5cm로 자른다.\n갈변이 될수 있으니 레몬즙을 살짝 섞어두면 좋아요','0240_3.jpg'),(1031,192,'한잎크기로 썬 로메인을 그릇에 담고 그 위에 아보카도, 적양파, 파프리카,방울토마토, 메추리알을 위에 얹는다.','0240_4.jpg'),(1032,192,'드레싱 재료를 모두 섞어 완성한다.','0240_5.jpg'),(1033,193,'불린 찰보리는 20~30분간 삶아 찬물에 씻어 물기를 제거한다.\n찰보리는 깨끗이 씻은 후 1~2 시간 불려서 삶아주세요\n네오플램 레트로T 양수냄비','0241_1.jpg'),(1034,193,'파프리카는 1cm크기로 자르고, 방울토마토는 반으로 가른다.','0241_2.jpg'),(1035,193,'닭가슴살은 1cm 크기로 썬다.','0241_3.jpg'),(1036,193,'달군 팬에 올리브유를 두르고 닭가슴살을 노릇하게 굽는다.\n네오플램 노블레스 프라이팬','0241_4.jpg'),(1037,193,'올리브유, 레몬즙, 소금, 설탕을 섞어 드레싱을 만든다.\n올리브유는 저어가며 넣어주세요','0241_5.jpg'),(1038,193,'볼에 삶은 찰보리, 방울토마토, 파프리카, 닭가슴살, 블랙올리브, 드레싱을 넣고 고루 섞는다.','0241_6.jpg'),(1039,193,'후추를 뿌리고 베이비채소를 얹어 완성한다.','0241_7.jpg'),(1040,194,'시저드레싱 재료를 고루 섞은 뒤 설탕과 레몬즙으로 취향에 맞게 간을 맞춘다.\n간단하게 만들기 위해 멸치액젓을 사용했어요. 앤초비를 다져 넣으면 더 맛있어요.','0242_1.jpg'),(1041,194,'냄비에 달걀과 잠길 정도의 물을 부어 끓어오르면 8분 더 삶아 찬물에 담근다.','0242_2.jpg'),(1042,194,'로메인과 식빵은 길게 4등분한다.','0242_3.jpg'),(1043,194,'중약 불로 달군 팬에 식빵을 노릇하게 굽고 베이컨도 앞뒤로 굽는다.','0242_4.jpg'),(1044,194,'베이컨은 키친타월에 밭쳐 기름기를 뺀 뒤 굵게 다진다.','0242_5.jpg'),(1045,194,'접시에 로메인, 달걀, 식빵, 베이컨을 담고 시저드레을 뿌린 뒤 덩어리 파마산치즈를 갈아서 뿌려 완성한다.\n삶은 달걀은 껍질 벗겨 먹기 좋게 등분해요.','0242_6.jpg'),(1046,195,'감자는 얇게 채 썰어 찬물에 담가요.','0243_1.jpg'),(1047,195,'볼에 소스 재료를 넣어 흑임자 소스를 만들어요.','0243_2.jpg'),(1048,195,'전분기를 뺀 감자는 건져서 물기를 제거해요.','0243_3.jpg'),(1049,195,'예열된 기름에 감자채를 노릇하게하게 튀겨요.','0243_4.jpg'),(1050,195,'접시에 연두부, 흑임자 소스, 튀겨낸 감자채를 올려 완성해요.','0243_5.jpg'),(1051,196,'방울토마토는 2등분하고 두부는 한 입 크기로 썬 후 키친타월로 물기를 제거한다.','0244_1.jpg'),(1052,196,'달군 팬에 기름을 약간 두른 후 물기를 뺀 두부를 튀기듯이 굽는다.','0244_2.jpg'),(1053,196,'볼에 소스 재료를 넣고 소스를 만든다.','0244_3.jpg'),(1054,196,'접시에 새싹채소, 방울토마토, 두부를 올린 후 소스와 곁들여 완성한다.','0244_4.jpg'),(1055,197,'당면은 찬물에 담가 30분간 불린다.','0245_1.jpg'),(1056,197,'볼에 소스재료를 넣어 잘 섞어둔다.','0245_2.jpg'),(1057,197,'불린 당면은 끓는 물에 5분간 삶아 찬물에 헹구고 칵테일새우도 30초간 데친다.','0245_3.jpg'),(1058,197,'오이와 파프리카는 채 썰어 소금을 뿌려 잠시 둔다.\n소금에 절여 배어나온 물기는 키친타올로 닦으세요.','0245_4.jpg'),(1059,197,'달걀은 소금을 넣고 풀어 지단을 부친 뒤 채 썬다.','0245_5.jpg'),(1060,197,'손질한 모든 재료를 버무린 뒤 접시에 담고 무순으로 장식한다.','0245_6.jpg'),(1061,198,'밥에 소금, 후추, 참기름, 통깨를 넣어 섞는다.','0248_1.jpg'),(1062,198,'한입크기의 원기둥 모양으로 뭉친다.','0248_2.jpg'),(1063,198,'슬라이스치즈는 6등분한다.','0248_3.jpg'),(1064,198,'베이컨에 치즈, 밥을 올려 만다.','0248_4.jpg'),(1065,198,'팬에 말아진 끝부분부터 놓고 돌려가며 구워 완성한다.\n끝부분부터 구워야 풀리지 않아요.','0248_5.jpg'),(1066,199,'맛살은 결대로 찢고 단무지는 잘게 다진다.','0249_1.jpg'),(1067,199,'볼에 밥, 참기름, 소금, 통깨를 넣고 섞는다.','0249_2.jpg'),(1068,199,'2에 맛살, 단무지, 마요네즈를 넣고 섞는다.','0249_3.jpg'),(1069,199,'양념한 밥을 한입 크기로 동그랗게 만든 후 김가루에 굴려 완성한다.','0249_4.jpg'),(1070,199,'','0249_5.jpg'),(1071,200,'쌀은 깨끗이 씻어 약 20분 이상 불린다.\n불리지 않은 쌀은 물을 조금 더 준비해 주세요.','0254_1.jpg'),(1072,200,'밥통에 쌀, 물, 깨끗이 씻어 준비한 콩나물, 다시마를 올려 일반밥 취사를 한다.\n기호에 따라 콩나물을 더 넣어도 좋아요.','0254_2.jpg'),(1073,200,'볼에 양념 재료를 넣어 양념장을 만든다.','0254_3.jpg'),(1074,200,'취사가 완료되면 밥을 잘 섞는다.','0254_4.jpg'),(1075,200,'그릇에 콩나물 밥을 담아 양념장을 곁들여 완성한다.','0254_5.jpg'),(1076,201,'대패삼겹살은 소금, 후추, 다진마늘, 참기름으로 밑간을 한다.','0255_1.jpg'),(1077,201,'냄비에 쌀, 물을 넣고 밑간 한 대패삼겹살을 위에 얹는다.','0255_2.jpg'),(1078,201,'강불에서 3분, 약불에서 12분간 밥을 짓는다.','0255_3.jpg'),(1079,201,'끓는 물에 콩나물을 3분간 데친 후 펼쳐 식힌다.\n네오플램 피카 양수냄비','0255_4.jpg'),(1080,201,'4)에 데친 콩나물을 넣고 5분간 약불에서 조리한 후 5분간 불을 끄고 뜸을 들인다.','0255_5.jpg'),(1081,201,'양념장 재료를 고루 섞는다.\n완성된 밥을 고루 저어 양념장과 곁들여 먹는다.','0255_6.jpg'),(1082,202,'양배추, 양파, 대파, 마늘, 깻잎은 채 썬다.','0256_1.jpg'),(1083,202,'우동면은 뜨거운 물을 부어 풀어준다.','0256_2.jpg'),(1084,202,'팬에 고추기름을 두르고 마늘, 양파, 대파, 양배추를 볶다가 순대, 우동면을 넣고 볶는다.','0256_3.jpg'),(1085,202,'양념재료를 넣고 볶은 후 접시에 담아 채 썬 깻잎을 올려 완성한다.','0256_4.jpg'),(1086,203,'꼬치에 순대를 하나씩 꽃는다.','0257_1.jpg'),(1087,203,'에어프라이어 바스켓에 순대를 넣고 180도 온도에서 10분간 구운 후 뒤집어서 5분간 굽는다.\n에어프라이어','0257_2.jpg'),(1088,203,'양념재료를 섞어 구워진 순대에 발라 완성한다.','0257_3.jpg'),(1089,204,'양파는 채썰고, 청양고추는 송송썬다.','0258_1.jpg'),(1090,204,'에어프라이어 바스켓에 유산지로 그릇을 만든다.\n에어프라이어','0258_2.jpg'),(1091,204,'순대-양파,청양고추-토마토케찹-모짜렐라치즈 순으로 뿌린다.','0258_3.jpg'),(1092,204,'180도 온도에서 10분간 돌린다.','0258_4.jpg'),(1093,204,'그릇에 옮겨 담은 후 파슬리가루를 뿌려 완성한다.','0258_5.jpg'),(1094,205,'양배추는 한 입 크기로 썰고 깻잎, 양파는 채썰고 대파와 고추는 송송, 순대와 오징어는 한 입 크기로 썰어 준비한다.','0259_1.jpg'),(1095,205,'볼에 양념 재료를 넣고 양념장을 만든다.','0259_2.jpg'),(1096,205,'양념장에 순대, 오징어, 양배추, 양파, 청양고추를 넣고 버무린다.','0259_3.jpg'),(1097,205,'팬에 식용유를 두르고 3을 넣고 볶은 후 대파, 깻잎을 넣어 볶은 후 불을 끄고 참기름, 통깨를 뿌려 완성한다.','0259_4.jpg'),(1098,206,'대파는 어슷썬다.','0260_1.jpg'),(1099,206,'사각어묵, 떡볶이떡, 순대를 꼬치에 꽂는다.','0260_2.jpg'),(1100,206,'양념장을 고루 섞는다.','0260_3.jpg'),(1101,206,'냄비에 물을 넣고 양념장을 풀어준다.','0260_4.jpg'),(1102,206,'순대꼬치, 어묵꼬치, 떡꼬치를 넣고 끓이다가 대파, 삶은달걀을 얹어 완성한다.','0260_5.jpg'),(1103,207,'오이는 2등분한 후 속을 파내고 3등분한다.','0262_1.jpg'),(1104,207,'기름을 뺀 닭가슴살에 파프리카와 양념 재료를 넣고 섞는다.','0262_2.jpg'),(1105,207,'오이에 닭가슴살샐러드를 올린 후 파슬리가루를 뿌려 완성한다.','0262_3.jpg'),(1106,208,'오이와 통조림햄은 채 썬다.','0263_1.jpg'),(1107,208,'프랑크소시지는 어슷 썰고, 버섯은 밑동을 잘라 2등분하고, 청양고추는 송송 썬다.','0263_2.jpg'),(1108,208,'중불로 달군 팬에 식용유를 두르고 오이를 제외한 손질 재료, 소금, 후추를 넣어 볶는다.','0263_3.jpg'),(1109,208,'버섯의 숨이 죽으면 달걀을 깨 넣는다.','0263_4.jpg'),(1110,208,'노른자만 터트린 뒤 밑면이 노릇해지면 뒤집어 1분 더 익혀 접시에 담는다.','0263_5.jpg'),(1111,208,'케첩을 별모양으로 뿌리고 오이를 올려 완성한다.','0263_6.jpg'),(1112,209,'오이는 양 끝을 자르고 필러로 얇게 슬라이스한다.','0264_1.jpg'),(1113,209,'슬라이스치즈와 닭가슴살슬라이스햄은 3등분한다.','0264_2.jpg'),(1114,209,'오이에 햄, 치즈를 올린 후 돌돌 말아 꼬치에 꽂는다. (2개씩)','0264_3.jpg'),(1115,209,'소스를 만들어 곁들여 완성한다.\n소스 재료가 없다면 허니머스터드소스나 칠리소스에 찍어먹어도 좋아요.','0264_4.jpg'),(1116,210,'줄리앤커터로 오이를 슬라이스한다.\n키친툴셋트','0265_1.jpg'),(1117,210,'콩국물 재료를 넣고 믹서기에 간다.','0265_2.jpg'),(1118,210,'볼에 오이, 콩국물을 붓고 방울토마토와 통깨를 올려 완성한다.','0265_3.jpg'),(1119,211,'소스를 만든다.','0266_1.jpg'),(1120,211,'오이는 감자칼로 슬라이스한다.','0266_2.jpg'),(1121,211,'파프리카, 닭가슴살은 채 썬다.','0266_3.jpg'),(1122,211,'슬라이스 오이에 닭가슴살, 파프리카, 무순을 넣고 돌돌 말아 소스와 곁들여 완성한다.','0266_4.jpg'),(1123,212,'오이를 채썬다.','0267_1.jpg'),(1124,212,'채썬 오이는 소금에 10분간 절인 뒤 물기를 짠다.','0267_2.jpg'),(1125,212,'크래미는 잘게 찢는다.\n글러브센스 주방 위생장갑','0267_3.jpg'),(1126,212,'볼에 오이, 크래미를 넣고 마요네즈, 머스터드, 설탕, 후추를 넣어 섞은 후 통깨를 뿌려 완성한다.\n김밥이나 유부초밥, 카나페로 응용해도 좋아요.','0267_4.jpg'),(1127,213,'오이는 링으로 썬다.','0268_1.jpg'),(1128,213,'소금을 넣고 잘 버무려 약 20분간 절인다.','0268_2.jpg'),(1129,213,'물 1/2종이컵을 넣고 헹궈 물기를 제거한다.','0268_3.jpg'),(1130,213,'손으로 오이물기를 꼭 짜준다.','0268_4.jpg'),(1131,213,'절인오이, 검은 깨, 방울토마토, 유자청, 식초를 넣는다.','0268_5.jpg'),(1132,213,'버무려 그릇에 담아 완성한다.','0268_6.jpg'),(1133,214,'키친타월로 핏물을 뺀 소고기는 소금, 후추, 올리브유를 뿌려 10분간 재운다.','0270_1.jpg'),(1134,214,'팬에 기름을 두르고 채소를 넣고 소금,후추를 뿌려 굽는다.\n네오플램 노블레스 프라이팬','0270_2.jpg'),(1135,214,'달군팬에 올리브유를 두르고 소고기를 올려 굽는다.\n달군 팬에 구워줘야 육즙이 덜 빠져나가요.','0270_3.jpg'),(1136,214,'버터를 넣어 겉면이 노릇하게 굽는다.','0270_4.jpg'),(1137,214,'팬에 소스 재료를 넣고 한소끔 끓인다.\n소스에 표고톡톡을 1/4봉을 넣으면 맛과 향이 더 좋아져요\n톡톡채소 표고톡톡','0270_5.jpg'),(1138,214,'접시에 고기와 채소를 올린 뒤 소스를 뿌려 완성한다.','0270_6.jpg'),(1139,215,'[단호박 라떼만들기 ]\n볼에 자른 단호박을 전자레인지에서 5분간 조리한다.\n전자레인지\n랩을 씌운 후 구멍을 뚫어 조리해주세요','0272_1.jpg'),(1140,215,'믹서기에 찐 단호박, 우유, 꿀을 넣고 간다.','0272_2.jpg'),(1141,215,'[ 커피액 만들기 ]뜨거운물, 커피가루를 넣고 고루 섞는다.','0272_3.jpg'),(1142,215,'[단호박 크림만들기]\n휘핑크림, 설탕을 넣고 핸드믹서로 단단하게 크림을 올린다.','0272_4.jpg'),(1143,215,'으깬 단호박, 휘핑크림과 섞어 단호박크림을 완성한다.','0272_5.jpg'),(1144,215,'[아이스단호박라떼] 잔에 얼음 ->단호박라떼 -> 커피1/2종이컵->단호박크림을 얹어 완성한다.\n[따뜻한단호박라떼] 잔에 커피1/2종이컵-> 단호박라떼-> 단호박크림을 얹어 완성한다.\n따뜻하게 드시려면 갈아둔 단호박라떼는 전자레인지에 1분간 데워 주세요.','0272_6.jpg'),(1145,216,'딸기 6개는 작게 썬다.','0273_1.jpg'),(1146,216,'딸기 9개는 으깬 후 냄비에 넣고 설탕과 섞은 후 약불로 한소끔 끓인다.\n믹서기 갈아도 좋아요','0273_2.jpg'),(1147,216,'컵에 으깬 딸기를 붓고 작게 썬 딸기를 넣은 후 우유를 부어 완성한다.','0273_3.jpg'),(1148,217,'그린티라떼에 따뜻한 물 4숟가락을 넣고 섞는다.','0274_1.jpg'),(1149,217,'인스턴트커피에 따뜻한 물 3숟가락을 넣고 섞는다.','0274_2.jpg'),(1150,217,'컵에 그린티라떼>얼음>우유>커피를 부어 완성한다.\n우유와 커피를 부을 때 천천히 부어야 층이 섞이지 않아요. .','0274_3.jpg'),(1151,218,'다진 돼지고기는 소금(약간), 후춧가루(약간), 청주(1큰술)에 버무려 밑간한다.\n돼지고기밑간: 소금 약간, 후춧가루 약간, 청주 1큰술','0276_1.jpg'),(1152,218,'팬에 식용유(5큰술)을 두른 뒤 대파와 춘장을 넣고 볶는다.\n송송 썬 대파 15cm, 춘장 3+1/2큰술\n팬','0276_2.jpg'),(1153,218,'돼지고기, 양파 순으로 넣고 볶는다.\n다진 돼지고기 80g, 굵게 다진 양파 1개','0276_3.jpg'),(1154,218,'양배추와 호박, 나머지 양념을 넣고 조금 더 볶는다.\n납작 썬 양배추 2줌, 납작 썬 주키니 호박 1줌 [양념]: 간장 1 1/2큰술, 굴소스 1 1/2큰술, 설탕 2큰술, 다진 마늘 1큰술, 다진 생강 1/4큰술','0276_4.jpg'),(1155,218,'물(2컵)을 붓고 끓인다.','0276_5.jpg'),(1156,218,'재료가 익으면 녹말물을 붓고 걸쭉하게 끓인다.\n녹말물: 감자전분 2큰술, 물 2큰술\n맛을 보고 부족한 간은 소금으로 맞춰요.','0276_6.jpg'),(1157,218,'취향에 맞게 밥 또는 삶은 면에 짜장소스를 뿌리고 고명을 올려 마무리.\n[고명] 통조림 옥수수 2큰술, 채 썬 오이 1줌, 달걀 프라이 2개, 고춧가루 약간','0276_7.jpg'),(1158,219,'감자는 반달 썰고 쥬키니호박과 당근은 채 썬다.','0277_1.jpg'),(1159,219,'멸치육수에 바지락, 쥬키니호박, 감자, 당근, 수제비를 넣고 바지락이 입을 벌릴 때까지 끓인다.','0277_2.jpg'),(1160,219,'칼국수 면은 따로 5분간 삶은 후 찬물에 살짝 헹군 뒤 멸치육수에 넣는다.','0277_3.jpg'),(1161,219,'고춧가루를 넣고 한 소끔 끓여 완성한다.','0277_4.jpg'),(1162,220,'소고기는 키친타월로 핏물을 빼준 후 먹기 좋은 크기로 썬다.','0278_1.jpg'),(1163,220,'소불고기에 양념 재료를 넣고 20분간 재운다.\n잼을 넣으면 깊은 맛이 나면서 잡냄새를 없애줘요.','0278_2.jpg'),(1164,220,'달군 팬에 고기를 올려 핏기가 제거될때 까지 볶은 후 채소를 넣어 볶는다.','0278_3.jpg'),(1165,220,'볼에 밥을 담고 고기와채소를 올려 완성한다.','0278_4.jpg'),(1166,221,'양파, 빨강 파프리카는 한 입 크기로 썰고 쪽파는 2cm 길이로 썬다.','0279_1.jpg'),(1167,221,'한 입 크기로 썬 돼지고기는 인삼주와 후추를 넣고 10분간 재운다.\n인삼주가 없다면 청주 또는 맛술을 넣어주세요.','0279_2.jpg'),(1168,221,'볼에 양념 재료를 넣고 양념장을 만든다.','0279_3.jpg'),(1169,221,'달군 팬에 식용유를 두르고 밑간한 돼지고기를 넣고 볶는다.\n네오플램 피카 프라이팬','0279_4.jpg'),(1170,221,'얼추 돼지고기가 익었으면 한 입 크기로 썬 양파, 빨강파프리카와 양념장을 넣고 볶는다.','0279_5.jpg'),(1171,221,'거의 익었으면 쪽파를 넣고 가볍게 볶은 뒤 통깨를 뿌려 완성한다.','0279_6.jpg'),(1172,222,'꽈리고추는 꼭지를 띠어 반 자른다.','0280_1.jpg'),(1173,222,'마늘은 편으로 썰어 준비한다.',''),(1174,222,'멸치는 마른팬에 볶아낸다.','0280_3.jpg'),(1175,222,'예열된 팬에 기름을 두르고 마늘을 볶는다.\n– 기호에 따라 멸치 용량을 늘려도 좋아요.','0280_4.jpg'),(1176,222,'꽈리고추를 넣어 볶는다.','0280_5.jpg'),(1177,222,'간장을 넣고 양념이 베이게 볶는다.마늘을 볶는다.','0280_6.jpg'),(1178,222,'볶아놓은 멸치를 넣고 볶다가 불을 끈다.','0280_7.jpg'),(1179,222,'올리고당, 통깨, 참기름을 넣어 섞어 완성한다.','0280_8.jpg'),(1180,223,'양파, 토마토는 큼직하게 다지고 셀러리는 송송 썰어 준비해요.\n양파는 찬물에 담가 아린맛을 빼도 좋아요.','0282_1.jpg'),(1181,223,'끓는 물에 소금 약간과 파스타를 넣어 삶아내요.\n네오플램 노블레스 편수냄비','0282_2.jpg'),(1182,223,'볼에 삶은 파스타와 양파, 토마토, 셀러리, 토마토 소스, 올리브 오일 1숟가락, 소금 약간, 후추 약간을 넣어 버무려요.\n감칠맛을 위해 약간의 올리고당을 추가해 보세요~^^\n파켈만 나일론 집게','0282_3.jpg'),(1183,223,'그릇에 담아 파슬리 가루를 뿌려 완성해요.','0282_4.jpg'),(1184,224,'양파, 파프리카를 채썬다.','0283_1.jpg'),(1185,224,'방울토마토는 반으로 가른다','0283_2.jpg'),(1186,224,'끓는 물에 소금 1숟가락을 넣고 스파게티면을 10분간 삶는다. .\n네오플램 레트로T 편수냄비','0283_3.jpg'),(1187,224,'파스타소스를 고루 섞는다.','0283_4.jpg'),(1188,224,'스파게티면에 올리브유를 1숟가락, 소금, 후추를 넣고 고루 섞는다.','0283_5.jpg'),(1189,224,'방울토마토, 파프리카, 블랙올리브, 양파, 파스타소스를 넣고 고루 섞어 어린 잎 채소를 얹어 완성한다. .','0283_6.jpg'),(1190,225,'숏파스타는 끓는 물에 소금 약간을 넣고 삶아 건진다.','0284_1.jpg'),(1191,225,'양파, 파프리카는 채 썰고, 양상추는 손으로 뜯는다.','0284_2.jpg'),(1192,225,'방울토마토는 반으로 자르고, 오이는 링썬다.','0284_3.jpg'),(1193,225,'드레싱 재료를 섞어 드레싱을 만든다.','0284_4.jpg'),(1194,225,'삶은 파스타, 썬 채소, 옥수수, 올리브를 넣고 버무린다.','0284_5.jpg'),(1195,225,'파마산 치즈를 뿌려 완성한다.','0284_6.jpg'),(1196,226,'양상추는 깨끗이 씻어 준비하고 방울 토마토는 반 잘라 준비한다.','0285_1.jpg'),(1197,226,'푸실리 면은 소금을 조금 넣어 끓는 물에 면을 약 10분 정도 삶아낸다.','0285_2.jpg'),(1198,226,'볼에 소스 재료를 넣어 섞어 소스를 만든다.','0285_3.jpg'),(1199,226,'