g'),(1232,233,'썰어둔 연근 구멍에 고기소를 채워 넣는다.\n남은 고기소는 양파를 링으로 썬 후 속을 채워 사용하셔도 좋아요.','0293_3.jpg'),(1233,233,'속을 채운 연근에 밀가루>달걀물 순으로 입힌다.','0293_4.jpg'),(1234,233,'팬에 기름을 두르고 연근을 앞뒤로 노릇하게 익혀 완성한다.\n젓가락으로 콕 찔러 잘 들어가면 다 익은거에요','0293_5.jpg'),(1235,234,'돼지고기에 밑간 재료를 넣고 버무려 놓아둔다.','0294_1.jpg'),(1236,234,'양파, 베이컨, 김치는 크게 다진다.\n김치는 줄기 부분만 사용해주세요.','0294_2.jpg'),(1237,234,'팬에 돼지고기를 볶다가 굴소스를 넣고 볶는다.','0294_3.jpg'),(1238,234,'베이컨도 팬에 바삭하게 볶는다.','0294_4.jpg'),(1239,234,'냉동감자는 기름에 튀긴다.','0294_5.jpg'),(1240,234,'그릇에 튀긴감자를 담고 김치, 양파, 볶은 돼지고기를 올린다.','0294_6.jpg'),(1241,234,'핫소스, 마요네즈을 뿌린다.\n사워크림을 뿌려줘도 좋아요.','0294_7.jpg'),(1242,234,'모짜렐라 치즈를 뿌리고 할라피뇨, 구운 베이컨을 뿌려 완성한다.','0294_8.jpg'),(1243,235,'청양고추는 송송 썰고 깐땅콩을 빻는다.','0295_1.jpg'),(1244,235,'볼에 마요네즈, 참깨드레싱을 섞은 후 레몬즙, 빻은 땅콩을 넣어 섞는다.\n레몬즙은 생략해도 되지만 넣으면 맛있어요.','0295_2.jpg'),(1245,235,'청양고추를 올리고 통깨를 뿌려 완성한다.','0295_3.jpg'),(1246,236,'껍질을 벗긴 무는 두꺼운 스틱 모양으로 굵게 썬다.','0296_1.jpg'),(1247,236,'비닐 봉지에 여분의 전분과 무를 넣고 가볍게 흔들어 전분옷을 입힌다.','0296_2.jpg'),(1248,236,'볼에 전분, 튀김가루를 넣고, 물 1/2종이컵을 넣어 연유 정도의 농도로 걸쭉 하고 식용유를 섞는다.\n반죽에 식용유를 넣으면 튀길때 덩어리로 뭉치는 것을 막을 수 있어요,','0296_3.jpg'),(1249,236,'전분을 묻힌 무를 반죽에 넣고 튀김옷을 입힌다.\n.','0296_4.jpg'),(1250,236,'170도로 예열 된 튀김 기름에 무를 튀긴다.\n수분이 많은 채소 튀김은 10분이상 튀겨요.','0296_5.jpg'),(1251,236,'작은 냄비에 다시마육수를 넣고 끓기 시작하면 나머지 재료를 모두 넣고 농도가 나도록 조려 소스를 만들고 무튀김과 곁들여 완성한다.','0296_6.jpg'),(1252,237,'진미채를 물에 씻은 후 잠길 만큼 물을 받아 5분간 불린다.','0298_1.jpg'),(1253,237,'진미채를 체에 걸러 키친타월에 펼쳐 물기를 꽉 제거한다.','0298_2.jpg'),(1254,237,'참기름을 제외한 양념 재료를 넣고 양념장을 만든다.','0298_3.jpg'),(1255,237,'달군팬에 기름을 두르고 진미채를 넣고 중불에서 수분이 날아갈정도로 볶는다.','0298_4.jpg'),(1256,237,'양념장을 넣고 약불에서 볶은 후 참기름을 두르고 통깨를 뿌려 완성한다.','0298_5.jpg'),(1257,238,'진미채를 먹기 좋은 크기로 자르고, 물에 5분 정도 불린다.','0300_1.jpg'),(1258,238,'양념 재료를 넣고 양념장을 만든다.','0300_2.jpg'),(1259,238,'팬에 기름을 두르고 양념장을 넣고 끓인다.\n네오플램 피카 편수냄비','0300_3.jpg'),(1260,238,'양념이 끓으면 진미채를 넣고 불을 끄고 살짝 볶는다','0300_4.jpg'),(1261,238,'올리고당과 통깨를 넣어 완성한다.','0300_5.jpg'),(1262,239,'진미채를 물에 살짝 헹궈낸 후 물기를 완전히 빼준다.\n진미채 1줌','0301_1.jpg'),(1263,239,'팬에 버터, 땅콩버터를 넣는다.\n버터 1T, 땅콩버터 1+1/2T\n팬','0301_2.jpg'),(1264,239,'버터가 녹으면 진미채를 넣고 설탕, 소금을 넣어 볶아 완성한다.\n땅콩 약간, 설탕 1/2T, 소금 약간','0301_3.jpg'),(1265,240,'진미채를 물에 살짝 헹궈낸 후 물기를 완전히 빼준다.\n진미채 200g','0302_1.jpg'),(1266,240,'물기 뺀 진미채를 마요네즈에 버무려 놓는다.\n마요네즈 3T','0302_2.jpg'),(1267,240,'예열된 팬에 식용유를 두르고 마늘을 넣고 볶는다.\n마늘 1/2T','0302_3.jpg'),(1268,240,'마늘이 노릇해지면 올리고당, 설탕, 간장을 넣고 마요네즈에 버무린 진미채를 넣어 볶는다.\n올리고당 2T, 설탕 1T, 간장 2T','0302_4.jpg'),(1269,240,'볶아진 진미채 위에 참깨를 뿌려 완성한다.\n참깨 1T','0302_5.jpg'),(1270,241,'양파, 돼지고기는 굵게 썬다.','0303_1.jpg'),(1271,241,'끓는 물에 면을 삶는다.\n면 삶은 물은 3숟가락 정도 남겨주세요\n네오플램 레트로T 편수냄비 (다크그린)','0303_2.jpg'),(1272,241,'달군 팬에 올리브유를 두르고 삼겹살을 볶는다.','0303_3.jpg'),(1273,241,'고기가 익으면 양파를 볶다가 건더기 스프를 넣고 볶는다.','0303_4.jpg'),(1274,241,'분말 스프를 넣고 볶다가 면 끓은 물을 조금 넣고 볶는다.','0303_5.jpg'),(1275,241,'면을 접시에 담고 간짜장을 올려 완성한다.','0303_6.jpg'),(1276,242,'대파, 청양고추는 송송썬다.','0304_1.jpg'),(1277,242,'양파, 당근, 쥬키니호박, 감자는 굵게 깍뚝썬다.','0304_2.jpg'),(1278,242,'팬에 기름을 둘러 대파, 다진 마늘을 볶다가 돼지고기, 사천고추를 넣고 볶는다.','0304_3.jpg'),(1279,242,'감자, 당근, 호박, 양파 순으로 볶는다.\n굴소스를 줄이고 간장1 숟가락을 넣어도 좋아요','0304_4.jpg'),(1280,242,'춘장, 설탕, 굴소스 볶은 후 물, 치킨스톡을 넣고 끓인다.','0304_5.jpg'),(1281,242,'불린 중국당면을 넣고 섞고 전분물을 고루 풀어 농도를 맞춰 소금, 후추 간을 한다.\n중국당면은 6~8시간 찬물에 불려 사용해주세요','0304_6.jpg'),(1282,242,'청양고추를 올려 완성한다.','0304_7.jpg'),(1283,243,'봄동을 2cm 길이로 채 썬다.','0306_1.jpg'),(1284,243,'볼에 양념 재료를 넣고 섞는다.','0306_2.jpg'),(1285,243,'채썬 봄동에 양념 재료를 넣고 무친다.','0306_3.jpg'),(1286,243,'통깨를 뿌려 완성한다.','0306_4.jpg'),(1287,244,'끓는 소금물에 손질한 봄동을 넣고 앞뒤로 30초씩 데친다.','0307_1.jpg'),(1288,244,'찬물에 헹궈 물기를 제거한다.','0307_2.jpg'),(1289,244,'볼에 봄동, 양념재료를 넣고 가벽게 버무린다.\n수분감이 많은 채소는 간을 하고, 시간이 지나면 수분이 빠지고, 간이 약해진다. 바로 먹을게 아니면 간을 약간 세게 해도 좋다.','0307_3.jpg'),(1290,245,'홍고추는 송송 썬다.','0308_1.jpg'),(1291,245,'소금을 넣은 끓는 물에 봄동을 2분간 데친 후 찬물에 헹구고 물기를 짠다.\n크기가 크면 한 번 썰어주세요.','0308_2.jpg'),(1292,245,'볼에 봄동, 홍고추, 양념 재료를 넣고 무친 후 통깨를 뿌려 완성한다.','0308_3.jpg'),(1293,246,'냉이의 시든잎은 떼어내고 뿌리는 긁어낸 뒤 먹기 좋은 크기로 썬다.','0309_1.jpg'),(1294,246,'볼에 양념 재료를 넣고 양념장을 만든다.','0309_2.jpg'),(1295,246,'끓는 물에 소금을 약간 넣고 냉이를 20~30초간 데친 후 찬물에 헹군다.','0309_3.jpg'),(1296,246,'볼에 데친 냉이, 양념장을 넣고 무친 뒤 통깨를 뿌려 완성한다.','0309_4.jpg'),(1297,246,'','0309_5.jpg'),(1298,247,'[쑥차]쑥가루, 연유, 뜨거운물을 넣고 뭉치지 않도록 고루 풀어준다.\n루미 충전식 전동 우유 거품기','0310_1.jpg'),(1299,247,'휘핑크림, 연유 2숟가락을 넣고 80% 크림을 올린다.','0310_2.jpg'),(1300,247,'[따뜻한 쑥라떼]\n쑥차-> 따뜻한 우유-> 휘핑크림을 얹어 완성한다.\n따뜻하게 데운 우유를 넣어주세요','0310_3.jpg'),(1301,247,'[아이스 쑥라떼]\n쑥차-> 얼음-> 우유-> 휘핑크림을 얹어 완성한다.','0310_4.jpg'),(1302,248,'양파, 감자, 애호박, 두부는 깍뚝썬다.','0312_1.jpg'),(1303,248,'대파, 청양고추는 어슷썬다.','0312_2.jpg'),(1304,248,'냄비에 차돌박이, 다진마늘을 넣고 볶다가 쌀뜨물 3종이컵을 넣는다.','0312_3.jpg'),(1305,248,'양파, 감자, 애호박, 된장, 고추장을 넣고 끓인다.\n감자가 익을 때까지 끓여주세요','0312_4.jpg'),(1306,248,'국간장, 고추, 대파, 두부를 넣고 3분간 더 끓여 완성한다.','0312_5.jpg'),(1307,249,'양파는 깍둑썰고 대파는 송송 썰어요.\nTip) 매운맛을 좋아하시면 청양고추를 송송 썰어 넣어요.','0314_1.jpg'),(1308,249,'볼에 양념 재료를 넣고 양념장을 만들어요.','0314_2.jpg'),(1309,249,'냄비에 식용유를 넉넉히 두르고 양파와 대파를 넣어 약불에서 볶아요.','0314_3.jpg'),(1310,249,'양념 재료, 물, 순두부를 넣은 후 한소끔 끓여 완성해요.\nTip) 순두부는 따로 자를 필요 없이 숟가락으로 떠서 넣어요.\nTip) 취향에 따라 완성 전 달걀을 넣어 줘도 좋아요.','0314_4.jpg'),(1311,250,'청국장은 육수 1종이컵에 넣고 잘 풀어준다.','0316_1.jpg'),(1312,250,'두부는 두툼하게 편 썰고, 대파와 청양고추는 송송 썬다.','0316_2.jpg'),(1313,250,'냄비에 들기름을 두르고 돼지고기, 김치를 넣고 볶는다.\n타지 않게 중불로 볶아요.','0316_3.jpg'),(1314,250,'육수 1종이컵을 붓고 끓인다.','0316_4.jpg'),(1315,250,'끓으면 풀어놓은 청국장, 된장, 두부, 다진마늘, 고춧가루를 넣는다.\n간은 된장으로 맞춰요.','0316_5.jpg'),(1316,250,'대파, 청양고추를 넣고 한소끔 끓여 완성한다.','0316_6.jpg'),(1317,251,'껍질을 벗긴 감자는 한입 크기로 납작 썰고, 양파는 굵게 채 썰고, 대파와 고추는 어슷하게 썰고, 버섯은 먹기 좋게 자른다.','0317_1.jpg'),(1318,251,'고기도 먹기 좋은 크기로 자른다.\n마늘톡톡을 약간 넣어 고기의 잡내를 제거해도 좋아요\n채소톡톡 마늘톡톡','0317_2.jpg'),(1319,251,'냄비에 식용유(2 숟가락), 참기름(3 숟가락)을 두르고 고추장(2 숟가락), 고춧가루(1 숟가락) 순으로 넣고 중약 불에서 타지않게 볶는다.','0317_3.jpg'),(1320,251,'물 2컵을 붓고 감자와 고기를 넣고 끓인다.\n물2컵과 더맛진한요리 1/2봉을 넣어 찌개의 진한 맛을 내도 좋아요\n톡톡채소 더맛진한요리','0317_4.jpg'),(1321,251,'한소끔 끓으면 다진 마늘(1 숟가락), 국간장(2 숟가락), 멸치액젓(1 숟가락)을 넣는다.','0317_5.jpg'),(1322,251,'다시 끓어오르면 양파, 버섯을 넣고 한소끔 더 끓인 뒤 대파와 고추를 넣는다.','0317_6.jpg'),(1323,251,'칼국수를 흐르는 물에 가볍게 헹궈 마른 가루를 씻어낸 뒤 찌개에 넣고 면이 투명하기 익을 정도로 끓여 완성한다.\n매콤한 맛을 원하면 청양톡톡을 약간 넣어도 좋아요\n톡톡채소 청양톡톡','0317_7.jpg'),(1324,252,'갓김치, 돼지고기는 한입 크기로 썰어 준비해요.\n돼지고기는 뒷다리살, 앞다리살, 목살 등 기호에 따라 사용해 주세요.','0318_1.jpg'),(1325,252,'두부는 한입 크기로 썰고 대파, 청양고추는 송송 썰어 준비해요.','0318_2.jpg'),(1326,252,'냄비에 물을 약 800ml (4종이컵)넣어 끓여요.','0318_3.jpg'),(1327,252,'한소끔 끓으면 돼지고기를 넣어 끓여요.','0318_4.jpg'),(1328,252,'끓어오르면 새우젓을 넣고 푹 끓여요.','0318_5.jpg'),(1329,252,'고기가 익으면 갓김치, 다진 마늘, 설탕, 국간장, 굵은 고춧가루를 넣어 끓여요.\n김치의 염도에 따라 국간장은 가감해 주세요.','0318_6.jpg'),(1330,252,'두부를 넣은 뒤 식초를 넣어 끓여요.','0318_7.jpg'),(1331,252,'한소끔 끓으면 대파, 청양고추, 굵은 고춧가루를 올려 완성해요.\n냉장고에 있는 자투리 채소를 이용해 보세요.','0318_8.jpg'),(1332,253,'양파, 양배추, 깻잎은 굵게 채 썰고 대파, 청양고추는 어슷썬다.','0319_1.jpg'),(1333,253,'막창, 대창은 먹기 좋은 크기로 자르고 청주, 소금, 후추를 넣어 재운다.','0319_2.jpg'),(1334,253,'양념재료를 섞어 양념장을 만든다.','0319_3.jpg'),(1335,253,'팬에 기름을 두르고 막창, 대창을 노릇해질때까지 굽다가 양파, 양배추를 넣고 볶는다.','0319_4.jpg'),(1336,253,'양파, 양배추가 투명해지면 양념장을 넣어 볶다가 불린 당면을 넣고 볶는다.\n양념이 탈것 같으면 물을 약간 넣고 볶아주세요.','0319_5.jpg'),(1337,253,'대파, 깻잎, 청양고추를 넣고 가볍게 볶아 완성한다.','0319_6.jpg'),(1338,253,'먹고 남은 볶음에 밥, 김가루, 참기름을 넣고 볶아 볶음밥을 만들어 먹는다.','0319_7.jpg'),(1339,254,'바게트를 1cm 두께로 썬 후 달군 팬에 앞뒤로 굽는다.\n[브랜드특가] 네오플램 노블레스 프라이팬 2종 1세트 (20cm+28cm)','0320_1.jpg'),(1340,254,'냄비에 소스 재료를 넣고 한소끔 끓인 뒤 식힌다.','0320_2.jpg'),(1341,254,'딸기는 꼭지를 떼고 슬라이스한다.','0320_3.jpg'),(1342,254,'구운 빵 위에 크림치즈를 바른 후 딸기와 블루베리, 애플민트를 올리고 딸기소스를 뿌려 완성한다.','0320_4.jpg'),(1343,255,'삶은 고구마를 으깬다.\n고구마는 따뜻할 때 으껴야 잘 으깨져요.','0321_1.jpg'),(1344,255,'찹쌀가루를 조금씩 넣어가면 반죽한다.','0321_2.jpg'),(1345,255,'우유를 붓고 반죽을 만든 뒤 한 입 크기로 동그랗게 빚는다.\n글러브센스 주방 위생장갑','0321_3.jpg'),(1346,255,'예열된 기름(150~160도)에서 노릇하게 튀긴다.','0321_4.jpg'),(1347,255,'볼에 설탕과 시나몬가루를 섞은 후 튀긴 도넛에 묻혀 완성한다.','0321_5.jpg'),(1348,256,'볼에 달걀, 설탕을 넣고 잘 풀어준다.','0322_1.jpg'),(1349,256,'포도씨유 우유를 넣고 잘 섞는다.','0322_2.jpg'),(1350,256,'찹쌀가루, 박력쌀가루, 아몬드가루, 베이킹파우더를 체에내려 고루 섞는다.','0322_3.jpg'),(1351,256,'반죽을 짤주머니에 담아 도넛틀에 채운다.','0322_4.jpg'),(1352,256,'170도 예열된 오븐에 15~20분간 구워 충분히 식힌다.\n오븐','0322_5.jpg'),(1353,256,'슈가글레이즈를 고루섞어 도넛에 묻혀 완성한다.','0322_6.jpg'),(1354,257,'볼에 마카롱 믹스와 따뜻한 물(55도)을 넣고 핸드믹서로 고속으로 4분간 휘핑한다.\n반죽을 떨어뜨렸을 때 끊어지지않고 계단모양을 그리며 떨어지면 완성이예요.','0324_1.jpg'),(1355,257,'완성된 반죽을 짤주머니에 담고 도안 모양을 따라 테프론 시트에 짠다.\n원형 깍지가 없는 경우 짤주머니 끝을 1cm 정도로 잘라 사용하세요.','0324_2.jpg'),(1356,257,'반죽의 표면이 마를 때 까지 10~15분 정도 건조시킨다.','0324_3.jpg'),(1357,257,'반죽이 묻어나오지 않을 정도로 마르면 130도로 예열한 오븐에 20분간 굽는다.\n오븐','0324_4.jpg'),(1358,257,'구워진 마카롱은 식힘망에서 식힌다.','0324_5.jpg'),(1359,257,'화이트크림 재료를 볼에 넣고 중탕으로 녹인다.\n네오플램 피카 편수냄비\n스위스 투가르투 ALL 실리콘 주걱','0324_6.jpg'),(1360,257,'화이트크림을 짤주머니에 담고 식힌 마카롱 한면에 짜고 다른 마카롱을 덮어 완성한다.\n마카롱필링은 취향에 맞게 버터크림, 잼 등을 넣고 샌드해주세요.','0324_7.jpg'),(1361,258,'오이, 양상추, 브로콜리, 파프리카, 방울토마토는 한입 크기로 썰어 준비한다.','0334_1.jpg'),(1362,258,'끓는 물에 브로콜리를 넣어 살짝 대처 낸다.','0334_2.jpg'),(1363,258,'볼에 올리브 오일과 발사믹 식초를 넣어 섞는다.','0334_3.jpg'),(1364,258,'샐러드 볼에 준비한 채소를 넣고 소스를 뿌려 완성한다.','0334_4.jpg'),(1365,258,'찐 고구마 210g 을 함께 섭취한다.','0334_5.jpg'),(1366,259,'느타리 버섯, 연근은 먹기좋게 썰고 당근, 파프리카는 채 썰어 준비한다.','0335_1.jpg'),(1367,259,'느타리버섯, 당근, 연근, 파프리카는 예열된 팬에 올리브유를 조금 두르고 볶는다.','0335_2.jpg'),(1368,259,'된장, 다진 양파, 두부, 다진 호두, 들기름을 넣어 양념장을 만든다.','0335_3.jpg'),(1369,259,'그릇에 현미밥을 넣어 준비한 재료들을 양념장가 함께 올려 완성한다.','0335_4.jpg'),(1370,259,'오이, 당근, 양상추는 한입 크기로 썰어 준비한다.','0335_5.jpg'),(1371,259,'볼에 올리브 오일과 발사믹 식초를 섞어 소스를 만든다.','0335_6.jpg'),(1372,259,'샐러드볼에 준비한 채소, 호두를 넣고 소스를 뿌려 완성한다.','0335_7.jpg'),(1373,260,'우엉, 당근은 채 썰어 준비한다.','0336_1.jpg'),(1374,260,'우엉은 팬에 볶아 물, 설탕, 간장을 넣어 볶는다.','0336_2.jpg'),(1375,260,'시금치는 끓는 물에 대처 낸다.\n건져낸 후 키친타월을 이용해 물기를 제거해 주세요.','0336_3.jpg'),(1376,260,'김은 2등분 하여 김, 현미밥, 깻잎, 단무지, 당근, 시금치, 우엉 순서로 놓는다.','0336_4.jpg'),(1377,260,'깻잎을 먼저 감싸 말고 김을 말아 김밥을 만들어 완성한다.','0336_5.jpg'),(1378,260,'기호에 따라 연겨자와 식초를 섞어 소스를 만들어 곁들인다.','0336_6.jpg'),(1379,261,'양송이, 고추, 청경채, 양배추, 브로콜리, 당근, 고추 먹기 좋게 썰어 준비한다.','0337_1.jpg'),(1380,261,'예열된 팬에 올리브오일을 두르고 준비한 채소를 볶는다.','0337_2.jpg'),(1381,261,'채소가 볶아지면 현미밥과 카레가루를 넣어 볶아 낸다.','0337_3.jpg'),(1382,261,'볶음밥을 한 팬에 숙주나물과 토마토를 넣어 살짝 볶아 볶음밥에 올려 완성한다.','0337_4.jpg'),(1383,261,'오이, 양상추, 당근은 한입 크기로 썰어 준비한다.','0337_5.jpg'),(1384,261,'볼에 올리브 오일과 발사믹 식초를 섞어 소스를 만든다.','0337_6.jpg'),(1385,261,'샐러드볼에 준비한 채소, 호두, 아몬드를 넣고 소스를 뿌려 완성한다.','0337_7.jpg'),(1386,262,'무말랭이는 30분 이상 물에 담근다.','0338_1.jpg'),(1387,262,'예열된 팬에 올리브 오일을 넣어 무말랭이, 우엉, 연근, 당근, 느타리버섯을 볶아 소금을 넣어 간을 한다.','0338_2.jpg'),(1388,262,'볼에 다진 마늘, 대파, 고추, 참깨, 간장, 참기름을 넣어 양념장을 만든다.','0338_3.jpg'),(1389,262,'무말랭이 현미밥은 그릇에 담고 볶은 채소를 올리고 양념장을 곁들여 완성한다.','0338_4.jpg'),(1390,262,'오이, 양상추, 당근은 한입 크기로 썰어 준비한다.','0338_5.jpg'),(1391,262,'볼에 올리브 오일과 발사믹 식초를 섞어 소스를 만든다.','0338_6.jpg'),(1392,262,'샐러드볼에 준비한 채소, 호두, 아몬드를 넣고 소스를 뿌려 완성한다.','0338_7.jpg'),(1393,263,'당근, 어묵은 채 썰어 준비한다.',''),(1394,263,'달걀은 지단을 부쳐 채 썰어 준비한다.','0339_2.jpg'),(1395,263,'예열된 팬에 기름을 두르고 당근을 볶아 낸다.','0339_3.jpg'),(1396,263,'예열된 팬에 기름을 두르고 어묵을 넣어 볶다가 간장, 올리고당으로 간을 하고 볶아낸다.','0339_4.jpg'),(1397,263,'스팸은 팬에 구운 후 김밥에 넣기 좋게 자른다.','0339_5.jpg'),(1398,263,'맛살은 반 잘라 준비한다.','0339_6.jpg'),(1399,263,'참치는 기름을 뺀 후 마요네즈를 섞어 참치 마요를 만든다.','0339_7.jpg'),(1400,263,'볼에 밥을 넣어 소금, 깨소금, 참기름을 넣어 양념한다.','0339_8.jpg'),(1401,263,'김발에 김을 올리고 밥을 고루 편다.','0339_9.jpg'),(1402,263,'깻잎을 깔고 위에 참치 마요를 올리고 깻잎으로 덮는다.','0339_10.jpg'),(1403,263,'그 위에 준비한 재료를 올려 말아 완성한다.','0339_11.jpg'),(1404,264,'양송이 버섯은 키친타월이나 면보로 버섯 표면을 털어 손질하고, 굵게 채썰고, 양파도 채 썬다.\n버섯류는 스폰지 조직으로 되어 있어 물에 오래 씻으면 수분을 많이 흡수에 좋지 않다.','0343_1.jpg'),(1405,264,'달군 팬에 버터를 두르고 양송이 버섯과 양파를 중불에서 볶는다.\n버터가 타지 않도록 잘 저으면서 볶는다.','0343_2.jpg'),(1406,264,'양파가 투명해지면, 물, 치킨 스톡, 현미밥을 넣고 1~2분 끓인다.','0343_3.jpg'),(1407,264,'바글바글 끓으면 불을 끄고, 잠깐 식혔다가 핸드블렌더나 믹서기에 곱게 간다,\n곱게 갈면 부드러운 맛이 더 좋아진다.','0343_4.jpg'),(1408,264,'수프가 다시 끓으면 우유와 생크림을 넣고 끓인다. 우유와 생크림이 끓으면 소금, 후추 간한다.\n식빵을 구워서 곁들이면 좋아요.','0343_5.jpg'),(1409,264,'유제품이 오래 끓으면 비린내가 나고, 막도 생긴다.\n담백한 맛을 좋아하면 우유양을 많이, 고소한 맛을 좋아하면 생크림을 올리면 된다','0343_6.jpg'),(1410,265,'손질한 시금치는 예열된 팬에 올리브유를 두르고 재빨리 볶아낸다.','0344_1.jpg'),(1411,265,'시금치를 볶은 팬에 달걀을 넣어 프라이를 한다.','0344_2.jpg'),(1412,265,'프라이한 팬에 통밀 식빵을 앞 뒤로 노릇하게 굽는다.','0344_3.jpg'),(1413,265,'팬위에 식빵이 구워지면 바로 저지방 슬라이스 치즈를 올린다.','0344_4.jpg'),(1414,265,'치즈 위에 볶은 시금치, 달걀 순서로 올린다.','0344_5.jpg'),(1415,265,'후추를 약간 뿌려 완성한다.','0344_6.jpg'),(1416,266,'레몬즙을 짠다.\n시판 레몬즙으로 대체해주셔도 돼요.','0345_1.jpg'),(1417,266,'냄비에 우유를 넣고 중약불로 끓인다.','0345_2.jpg'),(1418,266,'끓기 시작하면 소금과 레몬즙을 넣는다.','0345_3.jpg'),(1419,266,'몽글몽글 덩어리가 생기면 불을 끈다.','0345_4.jpg'),(1420,266,'체를 밭친 면보에 부어 감싼 뒤 한 번 짜고 물기가 빠질때까지 놔둬 완성한다.\n샐러드나, 빵, 크래커와 함께 먹으면 맛있어요.','0345_5.jpg'),(1421,267,'사과를 깍뚝썬다.','0346_1.jpg'),(1422,267,'팬에 사과, 흑설탕을 넣고 중약줄로 졸인다.\n네오플램 피카 프라이팬','0346_2.jpg'),(1423,267,'졸여진 사과필링에 버터, 계피가루를 넣고 섞은 후 식힌다','0346_3.jpg'),(1424,267,'우유를 거품을 낸다.','0346_4.jpg'),(1425,267,'잔에 사과잼-> 거품우유를 넣고 완성한다.\n애플민트를 얹으면 좋아요','0346_5.jpg'),(1426,268,'당근은 치즈그레이터에 갈아 준비한다.','0347_1.jpg'),(1427,268,'달걀 , 흑설탕을 넣고 고루 섞는다.\n실온에 꺼내두었던 달걀을 사용하세요','0347_2.jpg'),(1428,268,'달걀에 포도씨유를 넣어가면서 휘핑한다.','0347_3.jpg'),(1429,268,'박력쌀가루, 아몬드가루, 베이킹파우더, 계피가루를 체쳐 섞는다.\n날가루가 보이지 않게 골고루 섞는다.','0347_4.jpg'),(1430,268,'당근을 넣고 머핀틀에 담아 180도로 예열된 25분간 오븐에 구워 식힌다.\n오븐','0347_5.jpg'),(1431,268,'크림치즈아이싱 재료를 넣고 휘핑기로 고루 섞는다.\n실온에 꺼내두었던 크림치즈를 사용하세요','0347_6.jpg'),(1432,268,'충분히 식혀진 당근컵케이크에 크림치즈아이싱을 올려 완성한다.','0347_7.jpg'),(1433,269,'당근은 채칼로 얇고 길게 채 썬다.','0348_1.jpg'),(1434,269,'볶은 땅콩과 마늘, 페페론치노는 각각 굵게 빻거나 다진다.','0348_2.jpg'),(1435,269,'청양고추는 송송 썰어 마늘과 페페론치노, 소스재료를 섞어 드레싱을 만든다.','0348_3.jpg'),(1436,269,'당근과 드레싱을 버무려 5~10분간 숙성한다.','0348_4.jpg'),(1437,269,'접시에 담은 뒤 땅콩을 뿌려 완성한다.\n취향에 따라 고수를 넣어도 좋아요.','0348_5.jpg'),(1438,270,'목살에 골고루 소금, 후추 순으로 뿌려 간이 잘 배도록 두드린다.','0350_1.jpg'),(1439,270,'밀가루를 충분히 입힌다.','0350_2.jpg'),(1440,270,'팬에 기름을 넉넉히 두르고 고기와 통마늘을 올린다.\n약불에 구워 핏물이 올라오기 시작하면 뒤 집는다..','0350_3.jpg'),(1441,270,'통마늘이 익으면 꺼내고 팬에 기름을 제거하고 버터 1숟가락을 넣고 센불에 노릇하게 구워낸다.','0350_4.jpg'),(1442,270,'고기구운 팬에 케찹 2숟가락, 설탕 1숟가락, 간장 1숟가락, 식초 1숟가락을 넣고 볶아 시큼한 향을 날린다.','0350_5.jpg'),(1443,270,'물을 조금씩 나누어 넣으면서 농도를 조절한다.','0350_6.jpg'),(1444,270,'구운 목살 스테이크와 통마늘을 소스에 넣어 살짝 졸여 완성한다.','0350_7.jpg'),(1445,271,'북어포는 쌀뜨물에 담가 부드럽게 한다.','0351_1.jpg'),(1446,271,'북어포는 잘게 찢어 손으로 물기를 꼭 짠다.','0351_2.jpg'),(1447,271,'마른팬에 살짝 볶아 수분을 날린다.','0351_3.jpg'),(1448,271,'양념장재료를 만든다.','0351_4.jpg'),(1449,271,'북어포, 대파를 넣고 버무려 완성한다.','0351_5.jpg'),(1450,272,'쪽파는 송송 썬다.','0352_1.jpg'),(1451,272,'꼬막통조림의 물기를 제거한다.','0352_2.jpg'),(1452,272,'볼에 양념 재료를 넣고 양념장을 만든다.','0352_3.jpg'),(1453,272,'양념장에 꼬막을 넣고 무친 후 송송 썬 쪽파를 넣어 완성한다.','0352_4.jpg'),(1454,273,'양파는 채 썰고 오이는 2등분한 후 어슷 썰고 깻잎과 쑥갓은 한 입 크기로 썬다.','0353_1.jpg'),(1455,273,'도토리묵은 2등분 한 후 1cm 두께로 썬다.\n끓는물에 도토리묵을 1분간 데쳐 주면 더욱 탱탱하고 쫀득해져요.','0353_2.jpg'),(1456,273,'볼에 양념 재료를 넣고 양념장을 만든다.\n다진마늘 대신 마늘톡톡 1/3봉을 넣어도 좋아요\n톡톡채소 마늘톡톡','0353_3.jpg'),(1457,273,'볼에 도토리묵, 양념장을, 채소를 넣고 가볍게 버무린 뒤 통깨를 뿌려 완성한다.','0353_4.jpg'),(1458,274,'사과는 2등분 하여 껍질, 씨를 제거한 후 편 썬다.','0354_1.jpg'),(1459,274,'양념재료를 섞어 양념장을 만든 후 편 썬 사과를 넣고 섞는다.','0354_2.jpg'),(1460,274,'돌나물을 넣고 무르지 않게 무쳐 완성한다.','0354_3.jpg'),(1461,275,'김은 4등분하여 준비한다.','0356_1.jpg'),(1462,275,'밥에 소금, 참기름을 넣고 섞어 밑간한다.','0356_2.jpg'),(1463,275,'김의 3/2까지 밥을 펼치고 말아 꼬마김밥을 만든다.','0356_3.jpg'),(1464,275,'어묵은 먹기 좋은 크기로 자른다.\n어묵은 끓는물에 살짝 데쳐주세요.','0356_4.jpg'),(1465,275,'손질한 오징어는 끓는물에 데친다.','0356_5.jpg'),(1466,275,'오징어는 데친 후 찬물에 식혀주세요.','0356_6.jpg'),(1467,275,'오징어를 먹기 좋게 썰어 준비한다.','0356_7.jpg'),(1468,275,'볼에 어묵, 오징어를 담고 고춧가루를 제외한 무침양념재료를 넣어 섞는다.','0356_8.jpg'),(1469,275,'모두 섞이면 고춧가루를 넣고 버무린다.','0356_9.jpg'),(1470,275,'접시에 꼬마김밥, 오징어무침을 담아 완성한다.','0356_10.jpg'),(1471,276,'볼에 양념 재료를 넣고 양념장을 만든다.','0357_1.jpg'),(1472,276,'끓는 물에 떡볶이 떡을 넣고 20초 정도 데쳐 낸다.','0357_2.jpg'),(1473,276,'양념장과 떡을 넣고 버무린다.','0357_3.jpg'),(1474,276,'예열된 팬에 식용유를 두른 뒤 양념에 버무린 떡을 넣고 볶는다.','0357_4.jpg'),(1475,276,'떡이 말랑해 지면 어묵을 넣고 재빨리 저어가며 볶는다.','0357_5.jpg'),(1476,276,'그릇에 담고 참깨를 솔솔 뿌려 완성한다.','0357_6.jpg'),(1477,277,'떡볶이 떡을 말랑해질때 까지 뜨거운 물에 담군다.\n떡이 말랑해지면 물기를 제거해주세요.','0358_1.jpg'),(1478,277,'꼬치에 떡을 꽃아준다.','0358_2.jpg'),(1479,277,'에어프라이어 바스켓에 꼬치를 넣고 180도 온도에서 10분간 굽는다.\n에어프라이어\n굽는 중간에 한번 뒤집어 주면 앞뒤가 골고루 익어요.','0358_3.jpg'),(1480,277,'양념을 섞은 후 구워진 떡꼬치에 발라 완성한다.\n땅콩분태 등 견과류를 뿌려 드셔도 좋아요.','0358_4.jpg'),(1481,278,'파프리카는 채 썰고 대파는 송송 썰고 사각어묵은 한 입 크기로 썬다.','0359_1.jpg'),(1482,278,'팬에 물을 붓고 양념 재료를 넣어 중불에서 끓인다.','0359_2.jpg'),(1483,278,'물이 끓어오르면 떡국떡, 파프리카, 사각어묵을 넣고 국물이 걸쭉해질때까지 끓인 뒤 대파를 넣어 완성한다.','0359_3.jpg'),(1484,279,'대파는 송송 썰어 준비한다.','0360_1.jpg'),(1485,279,'어묵은 꼬치에 끼워 준비한다.','0360_2.jpg'),(1486,279,'냄비에 멸치다시마 육수와 양념장을 넣어 한소끔 끓인다.\n멸치다시마육수 대신 만개한알로 깊은 국물의 맛을 내도 좋아요','0360_3.jpg'),(1487,279,'끓어 오르면 꼬치에 끼운 어묵을 넣어 끓인다.','0360_4.jpg'),(1488,279,'한소끔 더 끓으면 대파를 넣어 완성한다.\n간은 기호에 따라 소금이나 간장으로 더 해주세요.','0360_5.jpg'),(1489,279,'','0360_6.jpg'),(1490,280,'대파는 5cm로 썰어 2~4등분하고, 부추도 같은 길이로 썰고, 당근은 채썬다.\n대파는 푸른 잎부분까지 다 사용해요.','0361_1.jpg'),(1491,280,'양념간장재료를 섞어 양념장을 만든다.','0361_2.jpg'),(1492,280,'볼에 부침가루, 물을 넣고 반죽한 뒤 손질한 채소, 새우가루, 소금, 후추를 넣고 섞는다.','0361_3.jpg'),(1493,280,'중간 불로 달군 팬에 식용유를 두른 후 반죽을 넓게 펼친다.','0361_4.jpg'),(1494,280,'밑면이 노릇해지면 뒤집어 반대편도 익힌 후 양념장을 곁들여 완성한다.\n중간중간 식용유를 보충해가며 구우세요.','0361_5.jpg'),(1495,281,'냄비에 육수재료를 넣고 중불에서 10~15분 끓인다.\n네오플램 피카 프라이팬','0362_1.jpg'),(1496,281,'냄비에 맛간장 재료를 넣고 한소끔 끓인 뒤 체에 거른다.','0362_2.jpg'),(1497,281,'유부는 채 썰고 대파는 송송 썬다.','0362_3.jpg'),(1498,281,'끓는 물에 칼국수면을 넣고 5분간 삶는다.','0362_4.jpg'),(1499,281,'그릇에 맛간장 3~4숟가락 > 육수> 칼국수면> 송송 썬 대파> 쑥갓> 채 썬 유부> 김가루> 깨소금을 올려 완성한다.\n마지막에 고춧가루와 후추를 약간 뿌려주세요.','0362_5.jpg'),(1500,282,'삶은 고구마를 으깬다.\n고구마는 따뜻할 때 으껴야 잘 으깨져요.','0363_1.jpg'),(1501,282,'찹쌀가루를 조금씩 넣어가면 반죽한다.','0363_2.jpg'),(1502,282,'우유를 붓고 반죽을 만든 뒤 한 입 크기로 동그랗게 빚는다.\n글러브센스 주방 위생장갑','0363_3.jpg'),(1503,282,'예열된 기름(150~160도)에서 노릇하게 튀긴다.','0363_4.jpg'),(1504,282,'볼에 설탕과 시나몬가루를 섞은 후 튀긴 도넛에 묻혀 완성한다.','0363_5.jpg'),(1505,283,'양파는 채 썰고 청양고추와 홍고추는 어슷 썬다.','0364_1.jpg'),(1506,283,'냄비에 멸치다시마육수를 붓고 해산물을 넣어 끓인다.\n네오플램 레트로T 익스클루시브_프리미엄 IH 통주물','0364_2.jpg'),(1507,283,'바지락이 입이 벌리면 칼국수면을 넣고 끓인다.','0364_3.jpg'),(1508,283,'면이 80% 정도 익으면 양파와 고추, 양념 재료를 넣고 면이 익을때까지 끓여 완성한다.','0364_4.jpg'),(1509,284,'채소는 모두 채썬다.','0366_1.jpg'),(1510,284,'면을 삶아 찬물에 헹군다.','0366_2.jpg'),(1511,284,'볼에 면, 골뱅이, 채소, 스프, 참기름을 넣고 버무린다.\n일반 골뱅이 통조림을 사용하시는 경우 물기를 빼주세요.','0366_3.jpg'),(1512,284,'그릇에 담아 완성한다.','0366_4.jpg'),(1513,285,'끓는물에 소주, 통후추를 넣고 닭발을 삶는다.\n깨끗한 물에 여러번 씻어주세요\n네오플램 레트로T 양수냄비\n톡톡채소 생강톡톡','0367_1.jpg'),(1514,285,'대파, 청양고추는 어슷썬다.','0367_2.jpg'),(1515,285,'양념재료를 고루 섞는다.','0367_3.jpg'),(1516,285,'삶은 닭발, 양념장을 넣고 고루 섞는다.\n매운맛을 좋아한다면 청양톡톡을 1/2봉을 추가로 넣어도 좋아요\n톡톡채소 청양톡톡','0367_4.jpg'),(1517,285,'팬에 기름을 두르고 양념된 닭발을 넣고 볶다가 대파, 청양고추를 넣고 가볍게 볶아 완성한다.\n네오플램 노블레스 프라이팬','0367_5.jpg'),(1518,286,'달걀은 알끈을 제거하고 풀어 소금 1/4t 간을 한다.','0368_1.jpg'),(1519,286,'마른 오징어 몸통과 다리를 나눠서 껍질을 벗긴다.','0368_2.jpg'),(1520,286,'볼에 마른 오징어를 넣고, 잠길만큼의 물, 소금 약간을 넣는다.\n.','0368_3.jpg'),(1521,286,'오징어가 부드러워 질때가지 담궈둔다. (여름에는 냉장실에서 2~3시간, 겨울에는 상온에서 반나절)\n오징어가 부드러워 질때 까지 불려 준다.','0368_4.jpg'),(1522,286,'오징어를 꺼내서 몸통과 다리에 칼집을 넣는다.\n몸통은 가운데는 칼로 가로 칼집을 내고, 양쪽 끝부분을 가위로 칼집내고, 다리는 칼로 두들긴다.\n칼집을 잘 내주어야 오그라들지 않는다.','0368_5.jpg'),(1523,286,'오징어에 소금 후춧가루로 밑간하고, 부침가루, 달걀물 순으로 바른다.\n오징어가 간이 약할 경우 달걀물에 소금간을 한다.','0368_6.jpg'),(1524,286,'달군 팬에 식용유를 두르고, 오징어를 앞뒤로 노릇하게 부친다','0368_7.jpg'),(1525,287,'당근은 잘게 썰고 대파는 송송 썬다.\n대파 1/6대,당근 1/6개','0369_1.jpg'),(1526,287,'전자레인지 용기에 달걀을 푼다.\n달걀 3개\n전자레인지','0369_2.jpg'),(1527,287,'맛술, 물, 당근, 대파, 소금을 넣고 잘 섞는다.\n물 2/3종이컵 , 맛술 1숟가락 , 소금 약간','0369_3.jpg'),(1528,287,'랩을 씌어 구멍을 낸 후 전자레인지에 5~7분 돌려 완성한다.\n랩\n전자레인지','0369_4.jpg'),(1529,288,'냄비에 물을 1L넣고 멸치, 다시마, 건표고버섯, 건새우를 넣고 중불에 약 15분간 끓여 육수를 만든다.','0372_1.jpg'),(1530,288,'냄비에 물이 끓으면 콩나물을 넣고 약 5분정도 삶아 건져서 준비한다.','0372_2.jpg'),(1531,288,'오징어는 육수에 데친 후 작게 썬다.','0372_3.jpg'),(1532,288,'뚝배기에 밥, 고춧가루, 다진 마늘, 묵은지, 대파, 오징어를 올리고 육수를 붓고 한소끔 끓인다.','0372_4.jpg'),(1533,288,'청양고추와 달걀을 넣어 완성한다.\n양고추는 기호에 따라 가감 하고 부족한 간은 소금으로 더해 주세요.','0372_5.jpg'),(1534,289,'모듬 해물은 물기를 제거하고 다진다.','0373_1.jpg'),(1535,289,'해물 양념재료를 넣고 밑간한다.','0373_2.jpg'),(1536,289,'밑간한 해물에 고추소 재료를 넣고 소를 만든다.','0373_3.jpg'),(1537,289,'고추는 길이로 칼집을 내고 씨를 제거한다.','0373_4.jpg'),(1538,289,'씨를 제거한 안쪽에 밀가루를 묻힌다.','0373_5.jpg'),(1539,289,'고추소를 채우고 덮는다.','0373_6.jpg'),(1540,289,'밀가루, 달걀물, 빵가루 순으로 옷을 입힌다.','0373_7.jpg'),(1541,289,'예열된 기름에 넣고 노릇하게 튀겨 완성한다.','0373_8.jpg'),(1542,290,'볼에 만두, 밥, 간장을 넣고 으깨가며 섞는다.','0376_1.jpg'),(1543,290,'용기에 담아 전자레인지에 2분간 돌린다.\n전자레인지','0376_2.jpg'),(1544,290,'치즈를 뿌린다.','0376_3.jpg'),(1545,290,'전자레인지에 2분간 돌려 완성한다.\n전자레인지','0376_4.jpg'),(1546,291,'명란젓의 배를 갈라 칼등으로 껍질을 제거한다.','0377_1.jpg'),(1547,291,'대파를 송송 썬다.','0377_2.jpg'),(1548,291,'달걀, 소금을 넣고 고루 푼다.','0377_3.jpg'),(1549,291,'팬에 기름을 둘러 다진마늘, 대파를 넣고 볶는다.\n네오플램 피카 프라이팬','0377_4.jpg'),(1550,291,'달걀을 넣고 스크램블을 한 후 밥, 명란젓, 후추, 참기름을 넣고 보슬보슬하게 볶는다.','0377_5.jpg'),(1551,291,'그릇에 김가루, 송송 썬 쪽파를 올려 완성한다.\n봉스푸드 진짜착한 진명란 800g 1600g','0377_6.jpg'),(1552,292,'명란젓의 배를 갈라 칼등으로 껍질을 제거한다.','0378_1.jpg'),(1553,292,'대파를 송송 썬다.','0378_2.jpg'),(1554,292,'달걀, 소금을 넣고 고루 푼다.','0378_3.jpg'),(1555,292,'팬에 기름을 둘러 다진마늘, 대파를 넣고 볶는다.\n네오플램 피카 프라이팬','0378_4.jpg'),(1556,292,'달걀을 넣고 스크램블을 한 후 밥, 명란젓, 후추, 참기름을 넣고 보슬보슬하게 볶는다.','0378_5.jpg'),(1557,292,'그릇에 김가루, 송송 썬 쪽파를 올려 완성한다.\n봉스푸드 진짜착한 진명란 800g 1600g','0378_6.jpg'),(1558,293,'볼에 달걀 3개와 소금 약간을 넣고 달걀 물을 만들어 두번에 나누어 지단을 붙인다.','0381_1.jpg'),(1559,293,'소시지는 팬에 기름을 살짝 두르고 굴려가며 노릇하게 익힌다.\n소시지 4개','0381_2.jpg'),(1560,293,'팬에 다진 양파와 다진 김치를 넣고 볶다가 밥과 고추장 1/2T , 간장1T , 부순 참깨 1T , 참기름1T를 넣고 볶아 낸다.(간이 약하면 소금으로 간을 추가 한다.)\n다진 양파 1/2cup, 다진 김치 1cup, 밥 2인분\n팬','0381_3.jpg'),(1561,293,'달걀 지단과 김밥용 김은 소시지 길이에 맞게 잘라 준비한다.\n김밥용 김 4장','0381_4.jpg'),(1562,293,'김발에 김밥용 김을 놓고 김치볶음밥 , 달걀 지단 , 소시지 순서로 올린 후 김밥을 말아준다.','0381_5.jpg'),(1563,293,'풀리지 않게 잘 썰어주면 완성!','0381_6.jpg'),(1564,294,'팬에 기름을 두르고 마늘을 넣고 볶는다.','0382_1.jpg'),(1565,294,'스팸을 넣고 노릇해질때까지 볶는다.','0382_2.jpg'),(1566,294,'재료가 노릇해지면 김치, 양파를 넣고 볶는다.','0382_3.jpg'),(1567,294,'밥을 넣고 풀어가며 골고루 볶는다.','0382_4.jpg'),(1568,294,'물, 버터를 넣고 밥과 섞어가며 끓인다.','0382_5.jpg'),(1569,294,'치즈, 소금을 넣고 한번 끓인 후 완성한다.','0382_6.jpg'),(1570,295,'치킨을 잘게 찢어 준비한다.','0383_1.jpg'),(1571,295,'달걀은 후라이한다.','0383_2.jpg'),(1572,295,'팬에 기름을 두르고 대파, 김치를 볶다가 치킨살을 넣고 볶는다.','0383_3.jpg'),(1573,295,'양념재료를 넣고 볶다가 밥을 넣고 볶는다.','0383_4.jpg'),(1574,295,'그릇에 볶음밥을 담고 달걀후라이, 김가루를 뿌려 완성한다.',''),(1575,296,'대파는 송송 썬 후 달군 팬에 식용유를 넉넉히 두르고 대파를 넣어 볶는다.','0384_1.jpg'),(1576,296,'파향이 나오면 다진 김치를 넣어 볶는다.','0384_2.jpg'),(1577,296,'팬 가장자리에 간장과 설탕을 넣어 볶는다.\n가장자리 쪽으로 넣어야 불맛이 살아요.','0384_3.jpg'),(1578,296,'마지막으로 고춧가루를 넣고 볶아 김치밥 베이스를 만든다.\n고춧가루는 수분을 흡수하는 역할을 해 마지막순서에 넣어요.','0384_4.jpg'),(1579,296,'볼에 밥과 김치밥 베이스를 넣고 잘 비벼준다.','0384_5.jpg'),(1580,296,'기름을 두른 팬에 비벼진 밥을 눌어 붙도록 넓게 펴준다.','0384_6.jpg'),(1581,296,'피자치즈를 한쪽면에 올리고 뚜껑을 닫아 30초 정도 익힌다.','0384_7.jpg'),(1582,296,'김치밥을 반으로 접어 그릇에 담은 뒤 김가루와 옥수수통조림을 곁들여 완성한다.','0384_8.jpg'),(1583,297,'대파는 송송 썰고 묵은지는 먹기 좋은 크기로 썬다.','0385_1.jpg'),(1584,297,'멸치다시마육수가 끓으면 묵은지, 굵은 고춧가루, 고운 고춧가루, 소금, 바지락을 넣는다.','0385_2.jpg'),(1585,297,'한소끔 끓인 뒤 대파를 넣어 완성한다.','0385_3.jpg'),(1586,298,'두부는 한 입 크기로 썰고 양파는 채 썰고 대파와 청양고추는 어슷 썬다.','0386_1.jpg'),(1587,298,'볼에 양념 재료를 넣고 양념장을 만든다.','0386_2.jpg'),(1588,298,'냄비에 두부, 삼겹살, 묵은지, 채소, 양념장을 넣는다.\n네오플램 레트로T 익스클루시브_프리미엄 IH 통주물','0386_3.jpg'),(1589,298,'멸치다시마육수를 붓고 센불로 5분간 끓이다가 중불로 고기가 익을때 까지 끓여 완성한다.\n부족한 간은 소금, 후추를 뿌려요.','0386_4.jpg'),(1590,299,'삶은 달걀은 껍질을 벗겨 2등분한다.\n달걀은 잠길 만큼 물을 붓고 끓어오르면 10분간 삶으면 돼요.','0387_1.jpg'),(1591,299,'오이는 채 썰고, 열무김치는 한 입 크기로 자른다.','0387_2.jpg'),(1592,299,'볼에 양념재료를 섞어 양념장을 만든다.','0387_3.jpg'),(1593,299,'끓는 물에 소면을 넣고 삶은 후 찬물에 헹궈 체에 밭친다.\n끓어오를 때마다 찬물 1/3종이컵을 붓는 과정을 2~3번 반복하면 알맞게 익어요.','0387_4.jpg'),(1594,299,'볼에 삶은 소면과 양념장, 참기름을 버무려 접시에 담는다.\n양념장은 한번에 다 넣지 말고 맛을 보며 양을 조절해요','0387_5.jpg'),(1595,299,'열무김치와 오이, 삶은 달걀을 올리고 통깨를 뿌려 완성한다.','0387_6.jpg'),(1596,300,'김치는 잘게 썰어 국물을 제거한다.','0388_1.jpg'),(1597,300,'쪽파, 양파, 팽이는 잘게 썰어 준비한다.','0388_2.jpg'),(1598,300,'잘게 썰은 채소, 돼지고기, 빵가루, 밀가루, 전분, 양념 재료를 넣고 골고루 섞는다.','0388_3.jpg'),(1599,300,'반죽을 충분히 치대준 후 적당한 크기로 떼어 동글납작하게 만든다.','0388_4.jpg'),(1600,300,'반죽을 밀가루, 달걀물 순으로 입힌다.','0388_5.jpg'),(1601,300,'예열된 팬에 앞뒤로 노릇하게 구워 완성한다.\n약불에 굽고 뚜껑을 닫아 속까지 익히면 좋아요.','0388_6.jpg'),(1602,301,'시판 냉면육수 또는 동치미국물을 준비해 냉동실에서 3~4시간 동안 두어 살얼음으로 준비한다.',''),(1603,301,'깻잎, 오이, 양배추, 파프리카는 얇게 채 썰어 준비한다.','0389_2.jpg'),(1604,301,'초고추장(5큰술)과 연겨자(1숟가락), 들깨가루(3숟가락)를 넣고 섞어 비빔장을 만든다.\n연겨자와 들깨가루는 생략해도 좋아요.','0389_3.jpg'),(1605,301,'끓는 물에 메밀국수를 넣고 4~5분 삶아 찬물에 헹궈 물기는 뺀다.','0389_4.jpg'),(1606,301,'그릇에 채소, 메밀면을 놓고 살얼음으로 얼린 육수를 붓고 양념장을 올리고 삶은 달걀을 올려 완성한다.','0389_5.jpg'),(1607,302,'열무김치는 국물과 건더기를 나눈다.','0390_1.jpg'),(1608,302,'김치국물은 국물재료를 넣고 섞어 냉동실에 약 2시간 둔다.','0390_2.jpg'),(1609,302,'비빔장을 만든다.','0390_3.jpg'),(1610,302,'냉면은 끓는 물에 약 30초간 삶아 찬물에 헹군다.','0390_4.jpg'),(1611,302,'냉면은 비빔장재료에 버무린다.','0390_5.jpg'),(1612,302,'그릇에 비빈 면을 담는다.','0390_6.jpg'),(1613,302,'오이, 쌈무, 열무김치, 달걀, 국물을 담아 완성한다.','0390_7.jpg'),(1614,303,'깻잎을 채 썬다.','0391_1.jpg'),(1615,303,'끓는 물에 소금 1/2숟가락을 넣고 소면을 삶은 후 찬물에 헹군다.','0391_2.jpg'),(1616,303,'소면에 들기름, 깻잎, 김을 넣고 비빈다.\n초고추장소스를 만들어 찍어먹으면 더욱 맛있어요.','0391_3.jpg'),(1617,304,'양파는 다진다.\n멀티 차퍼','0393_1.jpg'),(1618,304,'해동한 해산물믹스에 밑간재료를 넣고 밑간 한다.\n글러브센스 주방 위생장갑','0393_2.jpg'),(1619,304,'팬에 올리브유를 약간 두르고 편마늘과 다진 양파를 볶는다.\n네오플램 노블레스 프라이팬','0393_3.jpg'),(1620,304,'마늘 향이 올라오면 밑간한 해물믹스를 넣고 볶는다.','0393_4.jpg'),(1621,304,'물, 토마토소스를 붓고 한소끔 끓인다.\n물 대신 육수를 이용하면 더욱 좋아요.','0393_5.jpg'),(1622,304,'끓어오르면 밥을 넣고 소금, 후추를 뿌려 완성한다.\n취향에 따라 마지막에 파마산치즈와 파슬리가루를 뿌려요.','0393_6.jpg'),(1623,305,'오이, 당근은 얇게 채썰어 준비해요.\n라오메뜨 이태리 천연세라믹 트레이 도마','0394_1.jpg'),(1624,305,'예열된 팬에 식용유를 1/2숟가락을 넣어 당근을 중불로 약 3분간 볶아요.\n당근은 기름에 한번 볶으면 영양소 체내흡수율이 80%로 높아진다고해요~!!\n네오플램 피카 프라이팬','0394_2.jpg'),(1625,305,'달걀은 풀어서 지단을 부쳐요.\n이노쿡 모던 IH 계란말이 사각팬','0394_3.jpg'),(1626,305,'달걀 지단은 얇게 채 썰어요.','0394_4.jpg'),(1627,305,'생다시마는 소금기를 제거하고 채 썰어요.\n다시마에는 체내 항산화 기능을 높이는 생리활성물질이 풍부하게 들어있어서 암예방에 좋다고해요~!!','0394_5.jpg'),(1628,305,'냄비에 물 종이컵 2컵과 채썰어놓은 다시마 저염 간장 1/2큰술 설탕 1/4큰술을 넣고 강불로 물이 졸아들때까지 약 5분정도 볶아요.','0394_6.jpg'),(1629,305,'흑미밥에 참기름과 통깨를 넣고 섞어요.\n항암에 효과가 좋다고 알려진 안토시아닌이라는 수용성 색소가 흑미에 검은콩 보다 4배이상 들어있어서 체내 활성산소를 효과적으로 중화시켜 암예방으로 좋기때문입니다~!!','0394_7.jpg'),(1630,305,'김에 흑미밥을 얇게 펼쳐 올려요.','0394_8.jpg'),(1631,305,'흑미밥 위에 다시마, 당근, 오이, 달걀 순서로 올려요.','0394_9.jpg'),(1632,305,'김밥을 말아서 먹기좋게 잘라 완성해요.','0394_10.jpg'),(1633,306,'빵강, 주황 파프리카를 불 위에 통으로 태워 찬물로 씻으며 껍질을 벗기고 씨를 제거하여 준비해요.','0395_1.jpg'),(1634,306,'150도로 예열한 오븐에 빨강, 주황 파프리카에 기름을 둘러(약 20ml) 부드럽게 조리해 식혀 준비해요\n오븐','0395_2.jpg'),(1635,306,'식힌 파프리카는 곱게 다진 후 돼지고기, 소금, 후추를 섞어 냉장고에 30분 숙성 시켜요.','0395_3.jpg'),(1636,306,'숙성을 한 재료는 패티를 동그랗게 만들어 밀가루, 달걀, 빵가루 순서로 튀김옷을 입혀요.','0395_4.jpg'),(1637,306,'180도의 예열된 기름에서 약 4분간 튀겨요.','0395_5.jpg'),(1638,306,'노랑 파프리카는 다져서 준비해요.','0395_6.jpg'),(1639,306,'마요네즈와 꿀을 섞어 소스를 만들어요.','0395_7.jpg'),(1640,306,'파프리카는 한입 크기로 썰어서 준비해요.','0395_8.jpg'),(1641,306,'설탕, 식초, 소금, 물을 섞어 끓여서 식혀요.','0395_9.jpg'),(1642,306,'썰어둔 파프리카에 끓여 식힌 물을 넣고 2일간 냉장 숙정 해요.','0395_10.jpg'),(1643,306,'빵강, 주황, 노랑 파프리카는 얇게 채 썰어 준비해요.','0395_11.jpg'),(1644,306,'분량의 마요네즈, 식초, 케찹, 설탕을 넣고 채 썰은 파프리카를 넣어 섞어 완성해요.','0395_12.jpg'),(1645,306,'노랑 파프리카는 통으로 태워 찬물로 씻어 껍질을 벗겨 준비해요.','0395_13.jpg'),(1646,306,'파프리카를 반으로 갈라 씨를 제거하고 오일, 소금, 후추를 첨가하여 150도로 예열된 오븐에서 30분간 구워요.','0395_14.jpg'),(1647,306,'적양파와 토마토는 링 모양으로 썰고 양상추는 씻어서 준비해요.','0395_15.jpg'),(1648,306,'버거 번을 구운 후 파프리카 허니마요 소스를 발라요.','0395_16.jpg'),(1649,306,'버거 번에 튀겨둔 파프리카 패티, 삼색 파프리카 콜슬로우, 파프리카 피클, 파프리카 구이를 넣은 후 양파, 토마토, 양상추, 치즈를 순서대로 올려 버거를 완성해요.','0395_17.jpg'),(1650,307,'양파는 채썬 후 찬물에 10분간 담가 건진다.\n양파를 찬물에 담가주면 매운맛이 빠져요.','0397_1.jpg'),(1651,307,'볼에 양념 재료를 넣고 양념장을 만든다.','0397_2.jpg'),(1652,307,'달군 팬에 식용유를 두르고 양파, 느타리버섯을 중약불에서 2~3분간 볶는다.\n느타리버섯 크기에 따라 크다면 가닥가닥 뜯어주세요.','0397_3.jpg'),(1653,307,'양파가 투명해지면 양념장을 넣고 한소끔 볶은 뒤 통깨를 뿌려 완성한다.','0397_4.jpg'),(1654,308,'명란은 칼집을 내 속을 긁어낸다.','0399_1.jpg'),(1655,308,'볼에 긁어낸 명란과 소스 재료를을 넣고 섞어 명란 마요네즈 소스를 만든다.','0399_2.jpg'),(1656,308,'기름에 명란껍질을 노릇해질 때까지 튀긴다.','0399_3.jpg'),(1657,308,'명란마요네즈소스와 곁들여 완성한다.','0399_4.jpg'),(1658,309,'양파는 밑부분이 잘리지 않도록 12등분 한다.','0400_1.jpg'),(1659,309,'물이 담겨진 볼에 양파를 넣고 30분간 둔다..','0400_2.jpg'),(1660,309,'튀김가루에 카레가루, 파슬리를 섞고, 달걀을 풀어 물과 섞는다.','0400_3.jpg'),(1661,309,'양파를 튀김가루-달걀물 순으로 2번 묻힌다.\n꼼꼼히 묻혀야 튀김옷이 떨어지지 않아요.','0400_4.jpg'),(1662,309,'빵가루를 묻힌 후 에어프라이어 바스켓에 넣고 소량의 기름을 뿌린다,','0400_5.jpg'),(1663,309,'170도 온도에서 20분간 구운 후 소스를 곁들여 완성한다.\n에어프라이어','0400_6.jpg'),(1664,310,'끓는 물에 닭모래집을 넣고 약 1분간 데친다.','0401_1.jpg'),(1665,310,'찬물에 헹군다.','0401_2.jpg'),(1666,310,'데친 닭모래집은 칼집을 낸다.','0401_3.jpg'),(1667,310,'튀김가루를 묻힌다.','0401_4.jpg'),(1668,310,'튀김가루: 물=1:1 동량으로 섞어 반죽물을 만든다.','0401_5.jpg'),(1669,310,'반죽물을 묻혀 예열된 기름에 넣고 노릇하게 튀긴다.','0401_6.jpg'),(1670,310,'기름을 제거하고 접시에 담는다.','0401_7.jpg'),(1671,310,'소스를 곁들여 완성한다.','0401_8.jpg'),(1672,311,'가지는 속을 파내고 파낸 속은 다진다.','0402_1.jpg'),(1673,311,'베이컨은 1cm 길이로 썬다.','0402_2.jpg'),(1674,311,'달군 팬에 올리브유를 두르고 베이컨을 노릇하게 볶다가 다진 가지 속을 넣고 볶는다.\n네오플램 노블레스 프라이팬','0402_3.jpg'),(1675,311,'볼에 볶은 재료, 생크림, 빵가루, 파마산치즈가루를 넣고 섞는다.','0402_4.jpg'),(1676,311,'가지 속을 채운 후 소금, 후추를 뿌려 피자치즈를 얹는다.','0402_5.jpg'),(1677,311,'190도로 예열된 오븐에 20분간 구워 완성한다.\n오븐','0402_6.jpg'),(1678,312,'닭 날개는 깨끗이 씻어 우유에 10분간 담가 물에 헹궈 물기를 제거한다.\n닭날개를 우유에 담가주면 누린내가 제거돼요.','0404_1.jpg'),(1679,312,'닭날개에 칼집을 낸다.','0404_2.jpg'),(1680,312,'볼에 소스 재료를 넣고 소스를 만든다.','0404_3.jpg'),(1681,312,'닭날개에 소스를 넣고 10분간 재운다.','0404_4.jpg'),(1682,312,'에어프라이어에 180도에서 10분간 굽고 뒤집어 5분간 더 구워 완성한다.\n에어프라이어','0404_5.jpg'),(1683,313,'양배추, 오이, 당근, 깻잎은 채썰어 준비한다.','0406_1.jpg'),(1684,313,'볼에 양념장을 모두 넣고 섞어 준비한다.','0406_2.jpg'),(1685,313,'쫄면은 가닥가닥 잘 때어 끓는 물에 넣고 식초 1숟가락을 넣고 5분정도 삶아 건져 내 찬물에 씻어 물기를 뺀다.\n식초를 넣고 삶아주면 쫄면의 특유의 향을 잡아 주어요.','0406_3.jpg'),(1686,313,'물기 뺀 쫄면에 참기름 1숟가락을 넣어 버무린다.','0406_4.jpg'),(1687,313,'접시에 쫄면을 놓고 야채를 올리고 양념장을 올린 후 달걀을 올려 완성 한다.','0406_5.jpg'),(1688,314,'내열용기에 찰쌀가루, 설탕, 소금을 넣고 골고루 섞는다.','0407_1.jpg'),(1689,314,'우유를 넣고 날가루가 보이지 않도록 섞는다.','0407_2.jpg'),(1690,314,'랩을 씌운 후 전자레인지에 2분간 돌린 후 치댄다. 이 과정을 2~3번 반복한다.\n전자레인지','0407_3.jpg'),(1691,314,'초콜릿을 중탕한다.','0407_4.jpg'),(1692,314,'전분을 깔아 반죽을 얹어 빚기 좋은 크기로 만든다.\n전분을 충분히 뿌리면 손에 달라붙지 않아요','0407_5.jpg'),(1693,314,'반죽에 땅콩버터를 감싸 둥글 납작하게 만든다.','0407_6.jpg'),(1694,314,'녹인 초콜릿을 묻혀 완성한다.','0407_7.jpg'),(1695,315,'다크초콜릿, 버터를 중탕으로 녹인후 휘핑크림을 넣고 섞는다.','0408_1.jpg'),(1696,315,'반죽흰자재료를 넣고 핸드믹서로 머랭을 만든다.\n설탕을 2~3번 나누어 넣어주세요','0408_2.jpg'),(1697,315,'반죽노른자재료를 넣고 핸드빅서로 아이보리색이 될때까지 휘핑한다.','0408_3.jpg'),(1698,315,'코코아파우더, 박력쌀가루를 체쳐 1번에 섞는다.','0408_4.jpg'),(1699,315,'노른자반죽을 넣고 고루 섞은 뒤 머랭을 나누어 가볍게 섞는다.','0408_5.jpg'),(1700,315,'틀에 담아 170도 예열된 오븐에 25분간 구워 완성한다.\n오븐\n슈가파우더를 뿌려 완성하면 더 이뻐요','0408_6.jpg'),(1701,316,'고구마줄기 껍질은 벗긴다.','0410_1.jpg'),(1702,316,'끓는 물에 소금을 넣고 5분 동안 고구마줄기를 데친다.','0410_2.jpg'),(1703,316,'데친 고구마 줄기를 찬물에 씻고 채반에 받쳐 물기를 뺀다.','0410_3.jpg'),(1704,316,'고구마줄기를 4cm 길이로 썬다.','0410_4.jpg'),(1705,316,'끓는 물 2L에 소금을 넣고 스파게티 면을 11분간 삶는다.\n면수는 버리지 말고 1종이컵 가량 남겨주세요.','0410_5.jpg'),(1706,316,'팬에 올리브유를 두르고 약불에 다진마늘을 볶는다.','0410_6.jpg'),(1707,316,'마늘이 갈색으로 변하면 다진고기를 넣는다.','0410_7.jpg'),(1708,316,'4)에 간장 2숟가락, 맛술 2숟가락을 넣고 센불에서 볶는다.','0410_8.jpg'),(1709,316,'중불에 고구마줄기, 파스타 면수 1종이컵, 치킨파우더 1숟가락, 들깨가루 2숟가락을 넣고 볶는다.','0410_9.jpg'),(1710,316,'링귀니면을 넣고 볶다가 소금, 후추로 간을 맞춰 완성한다.','0410_10.jpg'),(1711,317,'달걀에 소금, 후추를 넣고 섞는다.','0411_1.jpg'),(1712,317,'달걀물에 밥을 넣고 잘 섞는다.\n15분간 냉장고에 넣어 주세요.','0411_2.jpg'),(1713,317,'팬에 식용유를 두르고 대파를 볶아 파기름을 만든다.\n파는 쓰지 않을거에요.','0411_3.jpg'),(1714,317,'파기름에 밥을 넣고 골고루 볶은 후 참기름을 넣고 섞어 완성한다.','0411_4.jpg'),(1715,318,'통마늘은 편으로 썰고, 베이컨은 1cm 간격으로 썰고 쪽파는 송송 썰어 준비한다.\n베이컨 4장, 통마늘 4개, 쪽파 2T','0413_1.jpg'),(1716,318,'예열된 팬에 기름을 넣고 마늘을 볶는다.\n팬','0413_2.jpg'),(1717,318,'마늘이 노릇해지면 베이컨을 넣고 볶는다.','0413_3.jpg'),(1718,318,'베이컨이 노릇해지면 양파를 넣어 볶는다.\n양파 1/4개','0413_4.jpg'),(1719,318,'재료가 다 볶아지면 달걀을 넣어 볶는다.\n달걀 1개','0413_5.jpg'),(1720,318,'마지막으로 밥을 넣고 기호에 따라 간장으로 간을 한다.\n밥 1공기, 간장 1T','0413_6.jpg'),(1721,318,'쪽파와 참깨를 뿌려 완성한다.\n참깨 1/2T','0413_7.jpg'),(1722,319,'대파는 송송 썰고 양배추, 양파, 파프리카, 베이컨은 큼직하게 다져서 준비한다.','0414_1.jpg'),(1723,319,'예열된 팬에 기름을 두르고 대파, 양파를 볶는다.','0414_2.jpg'),(1724,319,'파프리카, 베이컨, 양배추 순서로 볶는다.','0414_3.jpg'),(1725,319,'채소들이 볶아지면 달걀을 넣어 스크램블 한다.','0414_4.jpg'),(1726,319,'양념 재료를 넣어 살짝 더 볶는다.','0414_5.jpg'),(1727,319,'밥을 넣어 볶아 완성한다.','0414_6.jpg'),(1728,320,'크래미는 결대로 찢어 준비한다.\n크래미 90g','0415_1.jpg'),(1729,320,'양파, 파프리카는 다져 준비하고 쪽파는 송송 썰어 준비한다.\n양파 30g, 파프리카 1/4개, 쪽파 2T','0415_2.jpg'),(1730,320,'팬에 기름을 두르고 쪽파, 양파, 파프리카를 볶는다.\n팬','0415_3.jpg'),(1731,320,'볶던 재료를 한 쪽으로 밀고 달걀 한 개를 넣어 스크램블을 만든다.','0415_4.jpg'),(1732,320,'볶아진 재료에 크래미, 밥, 굴소스를 넣고 볶아 완성한다.\n밥 1공기, 굴소스 2T','0415_5.jpg'),(1733,321,'마늘 1/2은 곱게 다지고, 1/2는 3mm로 슬라이스 썰기\n마늘 6쪽(30g)','0416_1.jpg'),(1734,321,'달군 팬에 기름을 두르고 편마늘을 노릇하게 볶다가 건져내고, 다진마늘과 다진 양파를 볶는다.\n양파 1/4개(80g)\n팬\n마늘을 볶으면, 매운맛은 사라지고, 단맛이 강해져요','0416_2.jpg'),(1735,321,'연두를 넣고 살짝 볶다가 밥을 넣고 뭉치지 않게 볶아준다.\n연두순 2작은술(10g), 밥 2공기(400g)\n마늘과 연두가 만나면, 마늘의 단맛이 더 강해지고, 닭고기 풍미가 생겨나요','0416_3.jpg'),(1736,321,'밥이 다 볶아지면 편마늘(볶아둔것)과 통깨를 넣고 마무리 한다.\n통깨 1작은술(2g)','0416_4.jpg'),(1737,322,'김치와 대파는 송송 썰고 햄은 사방 1cm 크기로 썰어 준비한다.\n김치 1cup, 대파 10cm, 햄/스팸 1cup','0417_1.jpg'),(1738,322,'볼에 달걀 4개, 피자치즈 2T를 넣고 잘 풀어 준비한다.\n볼','0417_2.jpg'),(1739,322,'팬에 기름을 두르고 송송썬 대파를 넣어 노릇하게 볶는다.\n팬','0417_3.jpg'),(1740,322,'볶아진 파에 송송썬 김치와 햄을 넣고 볶는다.','0417_4.jpg'),(1741,322,'간장 1T , 고춧가루1/2T , 후추 약간을 넣어 간을 해 볶는다','0417_5.jpg'),(1742,322,'밥과 김가루를 넣고 잘 섞어 볶는다.\n밥 2인분, 김가루 약간','0417_6.jpg'),(1743,322,'마지막에 불을 끄고 참기름 1T를 넣는다.','0417_7.jpg'),(1744,322,'팬에 그대로 볶음밥을 모아 봉우리를 만들고 가운데 홈을 파고 밑에까지 길을 만들어 준다.\n냉면기에 담아 모양을 잡아 팬에 넣으면 편리해요.','0417_8.jpg'),(1745,322,'볶아 놓은 볶음밥 위로 준비한 달걀물을 붓는다.','0417_9.jpg'),(1746,322,'약불에 서서히 달걀을 익혀 완성한다.\n약불','0417_10.jpg'),(1747,323,'스팸은 작게 깍둑썰기해서 준비한다.\n작은 스팸 1캔',''),(1748,323,'기름 두른 팬에 쪽파를 볶는다.\n쪽파 2대','0418_2.jpg'),(1749,323,'쪽파가 어느정도 익으면 스팸을 넣고 같이 볶는다.','0418_3.jpg'),(1750,323,'3을 한쪽으로 밀고 스크램블을 만든다.\n달걀 1개','0418_4.jpg'),(1751,323,'4에 밥을 넣고 섞는다.\n밥 1공기','0418_5.jpg'),(1752,323,'굴소스를 넣어 볶아 완성한다.\n굴소스 1T','0418_6.jpg'),(1753,324,'대파는 송송 썰고 통마늘은 편으로 썰어 준비한다.','0419_1.jpg'),(1754,324,'팬에 삼겹살을 노릇하게 굽고 한 입 크기로 자른다.','0419_2.jpg'),(1755,324,'삼겹살을 구운 팬에 대파, 마늘을 넣고 볶는다.','0419_3.jpg'),(1756,324,'마늘이 노릇해지면 밥, 쌈장을 넣고 볶아 완성한다.','0419_4.jpg'),(1757,325,'소고기는 한입 크기로 썰고 통마늘은 편으로 썰고, 양파, 대파는 1cm크기로 썰어 준비한다.\n소고기 200g, 통마늘 4개, 대파 10cm, 양파 1/4개','0420_1.jpg'),(1758,325,'예열된 팬에 올리브유를 넣고 마늘과 대파를 넣어 볶는다.\n올리브유 1T','0420_2.jpg'),(1759,325,'마늘과 대파 향이 올라오면 고기와 버터를 넣고 후추를 넣어 익힌다.\n버터 1T, 후추 약간','0420_3.jpg'),(1760,325,'고기의 겉면이 익으면 양파를 넣어 볶는다.','0420_4.jpg'),(1761,325,'밥을 넣고 스테이크 소스와 굴소스를 넣어 간을 하여 볶는다.\n밥 1공기, 스테이크 소스 2T, 굴소스 1T','0420_5.jpg'),(1762,325,'달걀 후라이와 쪽파를 올려 완성한다.\n달걀 1개, 쪽파 1T','0420_6.jpg'),(1763,326,'밥은 접시에 펼쳐 식힌다.\n밥 1공기','0421_1.jpg'),(1764,326,'대파는 송송 썰어 준비하고, 파인애플은 먹기 좋은 크기로 잘라 준비한다. 건새우도 작은 크기로 잘라 준비한다.\n통조림 파인애플 2개, 대파 1/2cup, 건새우 약간','0421_2.jpg'),(1765,326,'땅콩은 기름 없는 팬에 볶은 후 다져서 준비한다.\n땅콩 약간\n팬','0421_3.jp