,'식빵을 베이컨으로 말아준다,','0430_4.jpg'),(1802,332,'에어프라이어에 넣고 180도 온도에서 10분간 돌려 완성한다.\n에어프라이어','0430_5.jpg'),(1803,333,'양배추는 채 썰고 청양고추는 송송 썬다.','0432_1.jpg'),(1804,333,'감자, 양파, 당근은 다진다.\n멀티 차퍼','0432_2.jpg'),(1805,333,'볼에채 썬 야채와 다진 야채, 달걀, 소금, 후추를 넣고 섞는다.','0432_3.jpg'),(1806,333,'달군 팬에 마가린을 녹인 후 식빵을 앞뒤로 노릇하게 굽는다.\n네오플램 피카 프라이팬','0432_4.jpg'),(1807,333,'달군 팬에 식용유를 두르고 달걀부침을 부친다.','0432_5.jpg'),(1808,333,'구운 식빵에 슬라이스햄>달걀부침>케첩> 슬라이스햄> 청상추> 구운 식빵을 덮어 완성한다.','0432_6.jpg'),(1809,334,'통식빵은 가운데 깊게 칼집낸 뒤 두툼하게 자른다.','0433_1.jpg'),(1810,334,'볼에 달걀, 우유, 설탕, 소금을 섞어 달걀물을 만든다.','0433_2.jpg'),(1811,334,'팬에 버터(1숟가락)를 넣고 빵을 앞뒤로 구운 뒤 다시 버터(1숟가락)를 둘러 달걀물을 약한 불로 스크램블한다.\n달걀은 살짝 덜 익은 듯한 느낌일 때 불을 꺼야 부드러워요.','0433_3.jpg'),(1812,334,'팬을 가볍게 닦은 뒤 베이컨을 노릇하게 굽는다.','0433_4.jpg'),(1813,334,'칼집 낸 빵 사이에 스크램블에그, 베이컨, 치즈를 넣고 분량대로 섞은 소스를 뿌려 완성한다.','0433_5.jpg'),(1814,335,'식빵에 인절미를 올리고 꿀을 뿌린 후 식빵을 덮는다.','0434_1.jpg'),(1815,335,'에어프라이어에 넣고 180도 온도에서 10분간 돌린다.\n에어프라이어','0434_2.jpg'),(1816,335,'접시에 담은 후 볶음콩가루, 꿀, 아몬드슬라이스를 뿌려 완성한다.','0434_3.jpg'),(1817,336,'모짜렐라 치즈를 넓게 2등분 하고, 방울 토마토도 2~4등분하고, 채소는 먹기 좋게 뜯는다.','0435_1.jpg'),(1818,336,'달군팬에 버터 1숟가락을 두르고, 식빵 한쪽을 굽고, 옆에 모짜렐라치즈 , 베이컨을 함께 중약불에서 굽는다.\n모짜렐라 치즈를 앞뒤로 한번씩만 굽는다.','0435_2.jpg'),(1819,336,'식빵 조각에 모짜렐라 치즈를 올리고, 1조각 위에는 모짜렐라치즈, 체다치즈를 올린다.','0435_3.jpg'),(1820,336,'치즈가 녹도록 뚜껑을 덮어 2~3분 정도 둔다.\n중약불\n빵바닥이 타지 않도록 주의.','0435_4.jpg'),(1821,336,'치즈가 살짝 녹으면 식빵을 덮어 토스틀 만든다.','0435_5.jpg'),(1822,336,'접시에 치즈 토스트 , 베이컨, 샐러드 채소, 방울 토마토를 올린다.','0435_6.jpg'),(1823,337,'껍질을 벗긴 고구마는 한 입 크기로 썬다.','0437_1.jpg'),(1824,337,'한 입 크기로 썬 고구마에 식용유를 넣고 버무린다.','0437_2.jpg'),(1825,337,'에어프라이어에 고구마를 넣고 200도에서 20분간 굽는다.\n에어프라이어','0437_3.jpg'),(1826,337,'볼에 고구마를 담고 콩가루를 넣어 섞는다.','0437_4.jpg'),(1827,337,'접시에 콩가루를 섞은 고구마를 담고 꿀과 슬라이스아몬드를 뿌려 완성한다.','0437_5.jpg'),(1828,338,'바나나는 4등분한다.','0438_1.jpg'),(1829,338,'바나나에 밀가루> 달걀> 빵가루를 묻힌다.','0438_2.jpg'),(1830,338,'에어프라이어에 바나나 튀김을 넣고 180도에서 5분 돌린 후 뒤집어 3분 더 돌린다.\n에어프라이어','0438_3.jpg'),(1831,338,'접시에 바나나튀김을 올리고 초코시럽과 슬라이스아몬드를 뿌려 완성한다.','0438_4.jpg'),(1832,339,'피망, 슬라이스 햄을 잘게 다진다.','0440_1.jpg'),(1833,339,'달군팬에 기름을 둘러 밥, 채소 햄을 넣고 볶다가 소금, 후추로 간을 맞춘다.','0440_2.jpg'),(1834,339,'볶음밥을 동그라미 1개, 작은 타원 1개를 만들어 쌀가루-> 달걀물-> 빵가루 순으로 튀김옷을 입힌다.','0440_3.jpg'),(1835,339,'180도 예열된 오븐에 노릇하게 튀긴다.\n오븐','0440_4.jpg'),(1836,339,'체다치즈, 김, 작은크로켓으로 귀, 입, 눈을 만들어 붙여 완성한다.','0440_5.jpg'),(1837,340,'공심채는 씻어서 약 5cm 길이로 썰어서 준비한다.','0443_1.jpg'),(1838,340,'홍고추, 청고추, 대파는 송송 썰어 준비하고 통마늘은 큼직하게 다져서 준비한다.','0443_2.jpg'),(1839,340,'예열된 팬에 기름을 두르고 마늘, 대파, 청, 홍 고추를 넣어 볶는다.','0443_3.jpg'),(1840,340,'마늘향이 올라오면 공심채의 줄기부분부터 넣어 볶는다.\n– 약불로 줄여 뚜껑을 닫은 후 약 3분 정도 익혀주세요.','0443_4.jpg'),(1841,340,'줄기가 숨이 죽으면 입쪽을 넣어 볶는다.','0443_5.jpg'),(1842,340,'양념 재료를 넣어 볶아 완성한다.','0443_6.jpg'),(1843,341,'크래미는 한쪽 끄트머리를 얇게 찢어 준비한다.2. 양파는 채 썰어 준비하고 쪽파는 먹기 좋은 크기로 잘라 준비한다.\n크래미 8개 , 양파 1개 , 쪽파 1/2줌','0445_1.jpg'),(1844,341,'믹서기에 분량의 간 고추 양념재료를 넣고 굵게 갈아서 준비한다.\n홍고추 2개 , 청양고추 2개 , 통마늘 1주먹\n믹서기','0445_2.jpg'),(1845,341,'볼에 분량의 간장소스 재료를 넣고 섞어 준비한다.\n설탕 1숟가락 , 진간장 1숟가락 , 굴소스 1숟가락 , 액젓 1숟가락 , 물 3숟가락\n볼','0445_3.jpg'),(1846,341,'볼에 튀김가루, 물을 넣어 튀김 반죽을 만들어 크래미에 입힌다.\n튀김가루 2/3종이컵 , 물 1/2종이컵','0445_4.jpg'),(1847,341,'달군 식용유에 크래미를 노릇하게 튀긴다.','0445_5.jpg'),(1848,341,'팬에 식용유와 간 고추 양념 1숟가락을 넣고 볶는다.\n식용유 1/3종이컵\n팬','0445_6.jpg'),(1849,341,'양파와 간장소스 1국자 넣고 카레가루를 넣어 푼다.\n카레 가루 2숟가락','0445_7.jpg'),(1850,341,'코코넛밀크 음료를 넣고 달걀물을 풀어 넣는다.\n코코넛밀크 음료 1팩, 달걀 2개','0445_8.jpg'),(1851,341,'마지막으로 게맛살 튀김과 쪽파를 넣고 볶아 완성한다.','0445_9.jpg'),(1852,342,'부추는 10cm 길이로 썬다.','0446_1.jpg'),(1853,342,'오징어는 길게 자른 후 끓는 물에 데친다.','0446_2.jpg'),(1854,342,'반죽재료를 고루 섞는다.','0446_3.jpg'),(1855,342,'팬에 기름을 넉넉히 두르고 부추전을 부친다.','0446_4.jpg'),(1856,342,'볼에 밥, 소금, 참기름, 통깨를 넣고 밑간을 한다.','0446_5.jpg'),(1857,342,'부추전-> 밑간 한 밥 -> 데친 오징어 김발로 말아 완성한다.\n초고추장에 찍어 먹으면 좋아요','0446_6.jpg'),(1858,343,'뚝배기에 참기름을 두르고 밥을 깐다.','0447_1.jpg'),(1859,343,'고추참치, 볶음김치, 달걀, 옥수수콘, 치즈를 뿌린다.','0447_2.jpg'),(1860,343,'약불에서 10분간 익혀 완성한다.','0447_3.jpg'),(1861,344,'양파는 곱게 다진다','0449_1.jpg'),(1862,344,'씨를 제거한 아보카도는 으깬다.','0449_2.jpg'),(1863,344,'양파, 아보카도, 참치캔, 마요네즈, 간장, 후추를 넣고 고루 섞는다.','0449_3.jpg'),(1864,344,'따뜻한 밥에 밑간재료를 넣고 고루 섞는다.','0449_4.jpg'),(1865,344,'김 -> 밥-> 깻잎 -> 참치아보카도를 넣고 김발로 말아 완성한다.','0449_5.jpg'),(1866,345,'양파는 곱게 채썰고, 양상추는 채썬다.','0450_1.jpg'),(1867,345,'소불고기는 먹기 좋은 크기로 썬다.','0450_2.jpg'),(1868,345,'소고기 양념재료를 섞어 소고기에 넣고 잘 버무린다.,','0450_3.jpg'),(1869,345,'마른 팬에 또띠아를 앞뒤로 살짝 굽는다.\n구우면 또띠아가 찢어지지 않아요','0450_4.jpg'),(1870,345,'팬에 기름을 두르고 소고기를 볶는다.','0450_5.jpg'),(1871,345,'또띠아 위에 소고기, 양상추, 양파, 밥을 넣고 돌돌 말아 완성한다.','0450_6.jpg'),(1872,346,'마늘, 생강을 슬라이스하고, 쪽파는 송송 썬다.','0451_1.jpg'),(1873,346,'달군 팬에 기름을 두르지 않고 해감된 바지락을 넣고 입이 벌어질 때까지 볶은 후 건진다.\n바지락 손질법\n네오플램 노블레스 프라이팬','0451_2.jpg'),(1874,346,'팬에 기름을 두르고 사천고추, 마늘, 생강을 넣고 볶다가 간장을 넣고 향을 낸다.','0451_3.jpg'),(1875,346,'바지락, 국간장, 청주, 설탕를 가볍게 볶은 후 쪽파를 넣고 완성한다.','0451_4.jpg'),(1876,347,'소고기는 소금, 후추, 올리브유를 뿌려 마리네이드한다.','0453_1.jpg'),(1877,347,'통후추는 절구나 칼등으로 부순다.','0453_2.jpg'),(1878,347,'마리네이드한 고기를 부순 후추에 앞뒤로 묻힌다.','0453_3.jpg'),(1879,347,'팬에 올리브유를 두르고 소고기를 굽고, 방울토마토,양송이도 한쪽에서 같이 굽는다.\n중강불\n거의 다 구워질 때 버터 1숟가락 정도 넣으시면 풍미가 좋아요!','0453_4.jpg'),(1880,347,'고기를 구웠던 팬에 소스 재료를 넣고 농도가 나면 불을 끄고 완성한다.','0453_5.jpg'),(1881,348,'양파, 토마토는 링 모양으로 썬다.','0454_1.jpg'),(1882,348,'볼에 박력분, 중력분, 베이킹파우더, 소금은 체친다.','0454_2.jpg'),(1883,348,'볼에 팬케이크 재료를 넣고 고루 섞는다.','0454_3.jpg'),(1884,348,'팬에 기름을 코팅한 후 약불로 팬케이크를 부친다.','0454_4.jpg'),(1885,348,'달군 팬에 베이컨을 후추를 뿌려 노릇하게 굽는다.','0454_5.jpg'),(1886,348,'베이컨은 키친타올로 기름을 제거하여 바삭하게 만든다.','0454_6.jpg'),(1887,348,'팬케이크-> 딸기잼 -> 양상추, 베이컨, 양파, 토마토 -> 팬케이크 순으로 얹어 완성한다.','0454_7.jpg'),(1888,349,'닭다리살은 한입 크기로 잘라요.','0456_1.jpg'),(1889,349,'자른 닭다리살에 간장, 청주, 다진 마늘, 후추 , 참기름을 넣어 버무려 잠시 재워요.','0456_2.jpg'),(1890,349,'양배추는 채 썰어 준비해요.','0456_3.jpg'),(1891,349,'삶은 달걀, 피클은 다져서 준비해요.','0456_4.jpg'),(1892,349,'볼에 소스 재료를 넣고 섞어 소스를 만들어요.','0456_5.jpg'),(1893,349,'닭고기는 전분가루를 넣어 버무려요.','0456_6.jpg'),(1894,349,'예열된 기름에 닭고기를 노릇하게 튀겨요.\n네오플램 피카 프라이팬','0456_7.jpg'),(1895,349,'빵은 반 갈라 예열된 팬에 올리브유를 두르고 안쪽을 노릇하게 구워요.\n네오플램 노블레스 프라이팬','0456_8.jpg'),(1896,349,'빵 안에 양상추, 양배추, 소스, 치킨, 소스 순서로 올려 빵을 덮어 완성해요.\n기호에 따라 케찹이나 머스타드를 곁들여보세요.','0456_9.jpg'),(1897,350,'양파, 당근, 대파는 다진다.\n멀티 차퍼','0457_1.jpg'),(1898,350,'볼에 달걀을 푼다.','0457_2.jpg'),(1899,350,'달걀푼 물에 밥과 다진 채소를 넣고 섞는다.','0457_3.jpg'),(1900,350,'달군 팬에 기름을 두르고 달걀밥물을 넣어 돌돌 말아 완성한다.\n취향에 따라 케첩을 곁들여요.\n네오플램 피카 익스클루시브','0457_4.jpg'),(1901,351,'대파는 잘게썰고 게살은 찢는다.','0458_1.jpg'),(1902,351,'달걀을 고루 푼 후 대파, 게살, 소금 한꼬집을 넣고 섞는다.','0458_2.jpg'),(1903,351,'물, 계란간장, 식초, 설탕을 넣고 끓인 후 전분, 물을 섞어 살짝 끓은 후 소스를 만든다.\n네오플램 피카 프라이팬','0458_3.jpg'),(1904,351,'팬에 포도씨유를 두른 후 달걀을 넣고 익힌다.\n따뜻한 밥 위에 달걀 익힌 것을 올리고 계란간장 소스를 넣어 비벼 먹어도 좋아요','0458_4.jpg'),(1905,352,'달걀에 소금, 후추를 넣고 섞는다.','0459_1.jpg'),(1906,352,'달걀물에 밥을 넣고 잘 섞는다.\n15분간 냉장고에 넣어 주세요.','0459_2.jpg'),(1907,352,'팬에 식용유를 두르고 대파를 볶아 파기름을 만든다.\n파는 쓰지 않을거에요.','0459_3.jpg'),(1908,352,'파기름에 밥을 넣고 골고루 볶은 후 참기름을 넣고 섞어 완성한다.','0459_4.jpg'),(1909,353,'참치는 기름기를 제거한다.','0461_1.jpg'),(1910,353,'볼에 달걀, 참치, 옥수수콘, 소금, 후추를 넣어 반죽을 만든다.','0461_2.jpg'),(1911,353,'팬에 기름을 두르고 반죽을 한입크기로 부쳐 완성한다.','0461_3.jpg'),(1912,354,'끓는 물에 불린 당면을 1분간 삶는다.\n네오플램 피카 편수냄비','0462_1.jpg'),(1913,354,'삶은 당면은 간장, 설탕, 참기름을 넣고 버무린다.','0462_2.jpg'),(1914,354,'달걀, 소금을 넣고 고루 풀어준다.','0462_3.jpg'),(1915,354,'팬에 기름을 둘러 고루 푼 달걀 -> 김-> 당면을 넣고 달걀을 말아준다.\n김은 달걀말이팬에 맞춰 잘라 사용하세요\n이노쿡 모던 IH 계란말이 사각팬','0462_4.jpg'),(1916,354,'풀어둔 달걀을 추가로 넣어가며 달걀말이를 완성한다.','0462_5.jpg'),(1917,355,'방울토마토는 2등분하고 삶은 달걀은 껍질을 벗긴 후 4등분한다.\n달걀삶는법','0463_1.jpg'),(1918,355,'소스를 만든다.','0463_2.jpg'),(1919,355,'접시에 샐러드채소, 달걀, 방울토마토, 슬라이스 아몬드를 담고 소스를 뿌려 완성한다.','0463_3.jpg'),(1920,356,'바게트는 끝부분을 잘라내고 두툼하게 4등분한다.','0464_1.jpg'),(1921,356,'자른 바게트의 속을 약간 파낸다.','0464_2.jpg'),(1922,356,'소스재료를 섞어 마요소스를 만든다.','0464_3.jpg'),(1923,356,'바게트에 마요소스를 바른 후 달걀을 하나씩 깨트려 넣는다.','0464_4.jpg'),(1924,356,'에어프라이어 바스켓에 넣고 170도 온도에서 15분간 구워 완성한다.\n에어프라이어','0464_5.jpg'),(1925,357,'오이와 통조림햄은 채 썬다.','0465_1.jpg'),(1926,357,'프랑크소시지는 어슷 썰고, 버섯은 밑동을 잘라 2등분하고, 청양고추는 송송 썬다.','0465_2.jpg'),(1927,357,'중불로 달군 팬에 식용유를 두르고 오이를 제외한 손질 재료, 소금, 후추를 넣어 볶는다.','0465_3.jpg'),(1928,357,'버섯의 숨이 죽으면 달걀을 깨 넣는다.','0465_4.jpg'),(1929,357,'노른자만 터트린 뒤 밑면이 노릇해지면 뒤집어 1분 더 익혀 접시에 담는다.','0465_5.jpg'),(1930,357,'케첩을 별모양으로 뿌리고 오이를 올려 완성한다.','0465_6.jpg'),(1931,358,'닭날개의 칼집을 낸 후 밑간 재료를 넣고 10분간 재운다.\n닭날개가 누린내가 심하다면 우유에 10분간 담가 사용해요.','0469_1.jpg'),(1932,358,'볼에 소스 재료를 넣고 섞어 소스를 만든다.','0469_2.jpg'),(1933,358,'팬에 올리브유를 두른 후 밑간한 닭날개를 앞뒤로 굽는다.','0469_3.jpg'),(1934,358,'닭날개가 노릇하게 구워졌으면 소스를 넣고 소스가 졸아들때까지 약불로 졸인다.','0469_4.jpg'),(1935,358,'접시에 닭날개를 올린 뒤 다진 견과류를 뿌려 완성한다.','0469_5.jpg'),(1936,359,'스팸, 핫바, 두부는 모양대로 썬다.','0470_1.jpg'),(1937,359,'냄비에 물을 끓인 후 라면스프, 면을 넣고 끓인다.','0470_2.jpg'),(1938,359,'햄, 두부, 김치를 넣고 끓여 완성한다.','0470_3.jpg'),(1939,360,'감자는 껍질을 벗겨 약 1cm 두께로 길게 자른다.','0471_1.jpg'),(1940,360,'찬물에 담가 전분기를 빼고 물기를 제거한다.','0471_2.jpg'),(1941,360,'감자에 튀김가루를 뿌려 골고루 입힌다.','0471_3.jpg'),(1942,360,'팬에 기름을 넣고 예열 시킨 후 감자를 튀겨 낸다.\n나무젓가락을 넣었을 때 기포가 올라오면 튀기기 적당한 온도예요.','0471_4.jpg'),(1943,360,'볼에 양념 재료를 섞는다.','0471_5.jpg'),(1944,360,'섞어놓은 양념 재료에 튀긴 감자를 넣어 버무려 완성한다.\n마요네즈를 곁들여도 좋아요.','0471_6.jpg'),(1945,361,'단감은 껍질을 벗겨 한 입 크기로 썰고 쪽파는 송송 썬다.','0472_1.jpg'),(1946,361,'볼에 양념 재료를 넣고 양념장을 만든다.','0472_2.jpg'),(1947,361,'볼에 감, 양념장을 넣고 섞은 후 쪽파를 가볍게 무쳐 완성한다.','0472_3.jpg'),(1948,362,'무는 껍질을 벗기고 동그랗게 편 썬다.','0474_1.jpg'),(1949,362,'끓는물에 소금을 넣고 썰어둔 무를 넣어 살짝 데친다.\n데친 무는 물기를 제거해주세요.\n네오플램 레트로T 18양수냄비(다크그린)','0474_2.jpg'),(1950,362,'알배추는 잎을 한개씩 띠어내고 줄기 부분을 칼등으로 두드린다.\n줄기 부분에 칼집을 넣어 주셔도 좋아요.','0474_3.jpg'),(1951,362,'홍고추, 풋고추는 어슷썬다.','0474_4.jpg'),(1952,362,'반죽재료를 섞어 반죽옷을 만든다.','0474_5.jpg'),(1953,362,'배추와 데친 무에 앞뒤로 튀김가루를 뿌린다.','0474_6.jpg'),(1954,362,'배추, 무를 반죽옷에 묻힌 후 기름 두른 팬에 하나씩 올린다.\n네오플램 노블레스 프라이팬(28cm)','0474_7.jpg'),(1955,362,'홍고추, 풋고추를 올려 앞뒤로 노릇하게 부쳐 완성한다.','0474_8.jpg'),(1956,363,'돼지갈비는 뼈 부분을 제거 후 먹기 좋은 크기로 썰어 칼집을 낸다.\n돼지갈비는 찬물에 1시간 이상 담궈 핏물을 제거 해주세요.','0475_1.jpg'),(1957,363,'볼에 양념재료를 모두 넣고 섞는다.','0475_2.jpg'),(1958,363,'돼지갈비를 섞은 양념에 넣고 골고루 섞어 30분 이상 재운다.','0475_3.jpg'),(1959,363,'팬에 돼지갈비, 양념까지 모두 붓고 국물이 없을 때 까지 조린다.','0475_4.jpg'),(1960,363,'그릇에 밥을 담고 구운 갈비, 실고추를 올려 완성한다.\n원하는 고명을 올려 드셔도 좋아요.','0475_5.jpg'),(1961,364,'소갈비는 약 1시간 이상 찬물에 담가 핏물을 뺀다.채소는 큼직하게 썰어 준비한다.\n소갈비 1kg (2팩), 양파 1개 , 당근 1개 , 감자 1개 , 무 1/6개 , 표고버섯 4개 , 대파 1/3대','0476_1.jpg'),(1962,364,'냄비에 소갈비를 넣고 고기가 잠길 정도의 물과 소주를 넣어 한소끔 끓인다.끓인 소갈비는 찬물에 깨끗하게 헹군다.\n소주 1/3종이컵\n냄비','0476_2.jpg'),(1963,364,'냄비에 소갈비, 무를 넣고 재료가 잠길 정도의 물을 넣어 푹 끓인다.','0476_3.jpg'),(1964,364,'약 30분 정도 끓인 후 감자, 당근, 양파, 표고 버섯을 넣어 한소끔 끓인다.\nTip – 기름이 뜨면 걷어 주세요.','0476_4.jpg'),(1965,364,'소스재료를 넣어 국물이 자작해 질 때까지 끓인 후 대파를 넣어 완성한다.\n피코크 제대로 맛을 내는 소 갈비 찜 양념 소스 200g','0476_5.jpg'),(1966,365,'등갈비를 찬물에 1시간 정도 담가 핏물을 뺀다.','0477_1.jpg'),(1967,365,'등갈비에 칼집을 낸다.','0477_2.jpg'),(1968,365,'볼에 양념재료를 넣고 양념장을 만든다.','0477_3.jpg'),(1969,365,'냄비에 등갈비가 잠길 만큼의 물을 부은 후 된장을 푼다.','0477_4.jpg'),(1970,365,'등갈비를 넣고 10분간 데친 후 찬물에 헹궈 체에 밭친다.','0477_5.jpg'),(1971,365,'냄비에 등갈비, 마늘, 양념장을 넣고 40~50분간 중불로 조린 뒤 통깨를 뿌려 완성한다,.','0477_6.jpg'),(1972,366,'대파, 양파, 당근, 청양고추는 다져서 준비한다.\n대파 1대, 양파 1/2개, 당근 1/3개, 청양고추 2개','0478_1.jpg'),(1973,366,'볼에 다진 채소와 참치, 달걀, 부침가루, 양념재료를 넣고 섞는다.\n참치통조림 150g, 달걀 2개, 부침가루 4T [양념재료] 다진 마늘 1/2T, 소금 1/3T, 설탕 1/3T, 액젓 1T\n볼','0478_2.jpg'),(1974,366,'기름 두른 팬에 반죽을 적당량 덜어 노릇하게 구워 완성한다.\n팬','0478_3.jpg'),(1975,367,'두부는 으깨주고 당근과 양파는 다져준다.\n으깬 두부 1/2모, 다진 당근 20g, 다진 양파 20g','0480_1.jpg'),(1976,367,'분량의 재료를 지퍼팩에 넣고 주무르듯 섞는다.\n돼지고기 다짐육 200g , 달걀 1개, 다진 양파 20g, 다진 당근 20g , 다진 마늘1T , 으깬 두부 1/2모, 부침 가루 3T , 소금 약간, 후추 약간\n지퍼팩','0480_2.jpg'),(1977,367,'비닐의 모서리를 자른다.','0480_3.jpg'),(1978,367,'달군 팬에 기름을 살짝 두르고 조금의 분량을 짠다.','0480_4.jpg'),(1979,367,'숟가락으로 눌러 가며 노릇노릇하게 부친다.\n숟가락','0480_5.jpg'),(1980,368,'냉동만두는 손으로 으깬다.','0481_1.jpg'),(1981,368,'달걀 1개를 넣고 섞는다.','0481_2.jpg'),(1982,368,'달군 팬에 식용유를 두르고 으깬 만두를 한 숟가락씩 올린다.','0481_3.jpg'),(1983,368,'앞뒤로 노릇하게 익혀 완성한다.','0481_4.jpg'),(1984,369,'동그랑땡 2개는 칼로 다지고 3개는 2등분 하여 준비한다.','0482_1.jpg'),(1985,369,'끓는 물에 스파게티면을 넣어 삶는다.\n면삶은 물을 버리지 않아요.','0482_2.jpg'),(1986,369,'예열된 팬에 올리브유를 두르고 편마늘을 넣어 볶는다.','0482_3.jpg'),(1987,369,'마늘 향이 올라오면 다져놓은 동그랑땡을 넣어 볶는다.','0482_4.jpg'),(1988,369,'토마토 소스를 넣어 소스를 만든다.\n남겨놓은 면수를 넣어 농도를 조절해주세요.','0482_5.jpg'),(1989,369,'소금, 후추를 넣어 