7_1.jpg'),(2119,397,'파는 송송 썰고, 콩나물도 함께 준비한다.\n콩나물 약간, 대파 1/4대\n콩나물의 시원한 맛이 양배추의 비린맛을 줄여준답니다.','0517_2.jpg'),(2120,397,'전자레인지 용기에 모든 재료(양배추, 파, 콩나물, 물, 연두순)를 넣고 랩으로 감싼 뒤 3분간 조리하여 완성한다.\n물 1컵, 연두순 1스푼\n전자레인지\n연두 청양초를 조금 넣으면? 칼칼한 양배추 맑은 국으로 변신!','0517_3.jpg'),(2121,398,'양배추는 2cm 크기로 나박썰기 한다.\n양배추 속잎 30g','0518_1.jpg'),(2122,398,'파는 송송 썰고, 콩나물도 함께 준비한다.\n콩나물 약간, 대파 1/4대\n콩나물의 시원한 맛이 양배추의 비린맛을 줄여준답니다.','0518_2.jpg'),(2123,398,'전자레인지 용기에 모든 재료(양배추, 파, 콩나물, 물, 연두순)를 넣고 랩으로 감싼 뒤 3분간 조리하여 완성한다.\n물 1컵, 연두순 1스푼\n전자레인지\n연두 청양초를 조금 넣으면? 칼칼한 양배추 맑은 국으로 변신!','0518_3.jpg'),(2124,399,'표고버섯 하나는 4등분하고 나머지 하나는 채썰어 준비한다.\n느타리버섯은 결대로 찢어준다.\n새송이버섯은 원통으로 썰고 갓부분은 채썬다.\n배추는 한입 크기로 자르고 파는 어슷썰어 준비한다.','0519_1.jpg'),(2125,399,'육수 양념을 모두 섞어 준비한다.','0519_2.jpg'),(2126,399,'재료별로 냄비에 담고 육수를 부어 끓여준다.','0519_3.jpg'),(2127,399,'죽에 들어가는 재료를 잘게 자른다.','0519_4.jpg'),(2128,399,'전골을 즐기고 육수가 남은 냄비에 밥과 이외 재료, 물을 넣고 끓인다.\n- 남은 육수가 많을 경우, 기호에 맞게 덜어내고, 적을 경우, 물을 추가해 간을 맞춘다.','0519_5.jpg'),(2129,399,'전골요리와 죽(이유식)을 각각의 요리로 따로 만들어 즐겨도 좋다.\n[단, 죽(이유식)을 따로 만들 경우, 3시간 정도 불린 쌀을 활용하면 된다]',''),(2130,400,'[소량일때] 고구마를 하나씩 신문지로 감싼다.\n수분이 남게 되면 보관시 곰팡이가 생길 수 있어요.','0520_1.jpg'),(2131,400,'양파망에 넣어 바람이 잘 통하는 곳에 보관한다\n보관 최적온도 13~15도, 냉장 보관은 금물!','0520_2.jpg'),(2132,400,'[대량일때] 그늘에 신문지를 깔고 고구마를 1~2일 널어 말려 습기를 제거한다.\n수분이 남게 되면 보관시 곰팡이가 생길 수 있어요.','0520_3.jpg'),(2133,400,'박스에 구멍을 뚫어 준 후 신문지를 깐다\n박스에 구멍을 내면 습기가 차는 걸 방지해줘요.','0520_4.jpg'),(2134,400,'고구마를 넣는다.','0520_5.jpg'),(2135,400,'신문지 – 고구마 – 신문지 – 고구마 순으로 겹겹이 쌓은 후 서늘한 곳에 보관한다.','0520_6.jpg'),(2136,401,'1. 고구마 통째로 먹을 때\n깨끗이 씻은 고구마를 봉지에 넣는다.','0521_1.jpg'),(2137,401,'물을 1/2컵 정도 넣은 후 봉지를 묶는다.','0521_2.jpg'),(2138,401,'포크로 봉지 상단의 구멍을 뚫는다.','0521_3.jpg'),(2139,401,'전자레인지에 10분 정도 돌린다.\n전자레인지\n고구마 크기에 따라 시간을 늘려주세요.','0521_4.jpg'),(2140,401,'2. 고구마를 요리에 이용할 때\n깨끗이 씻은 고구마는 필러를 이용해 껍질을 제거한다.','0521_5.jpg'),(2141,401,'먹기 좋은 크기로 썬다.','0521_6.jpg'),(2142,401,'접시에 고구마를 올리고 랩을 씌운 후 포크로 구멍을 뚫는다.','0521_7.jpg'),(2143,401,'전자레인지에 넣어 8분 가량 돌린다.','0521_8.jpg'),(2144,402,'양배추, 양파, 청양고추, 홍고추 돼지고기는 채 썬다.','0523_1.jpg'),(2145,402,'볼에 양념 재료를 넣고 양념장을 만든다.','0523_2.jpg'),(2146,402,'달군 팬에 기름을 약간 두르고 돼지고기를 볶는다.','0523_3.jpg'),(2147,402,'돼지고기가 얼추 익으면 양파, 양배추, 청양고추, 홍고추, 양념장을 넣고 볶는다.','0523_4.jpg'),(2148,402,'통깨를 뿌려 완성한다.\n꽃빵과 곁들여 먹어도 좋아요.','0523_5.jpg'),(2149,403,'표고버섯은 채 썰고 대파는 어슷 썰고 가래떡은 한 입 크기로 썬다.','0524_1.jpg'),(2150,403,'볼에 양념 재료를 넣고 양념장을 만든다.','0524_2.jpg'),(2151,403,'불고기에 양념장을 넣고 섞은후 10~20분 재운다.','0524_3.jpg'),(2152,403,'달군 팬에 기름을 두르고 불고기를 넣어 볶다가 고기가 80%정도 익으면 가래떡과 표고버섯을 넣는다.\n네오플램 피카 익스클루시브','0524_4.jpg'),(2153,403,'고기가 다 익으면 대파를 넣어 한 번 볶아 완성한다.','0524_5.jpg'),(2154,404,'끓는 물 2L에 소금 1숟가락을 넣고 라자냐 면을 10분간 삶는다.\n네오플램 레트로T 편수냄비','0525_1.jpg'),(2155,404,'삶은 라자냐 면은 길이로 2등분 한다.\n달라 붙지 않도록 올리브유를 발라 놓으면 좋아요','0525_2.jpg'),(2156,404,'리코타치즈, 그라노파다노치즈, 달걀, 소금, 후추를 넣고 고루 섞는다.','0525_3.jpg'),(2157,404,'라자냐면 위에 치즈필링을 넣고 돌돌 만다.','0525_4.jpg'),(2158,404,'오븐 용기에 토마토소스를 넣고 4)를 담아 피자치즈, 크러쉬드페퍼를 뿌린다.','0525_5.jpg'),(2159,404,'190도 예열된 오븐에 15분간 구워 완성한다.\n오븐','0525_6.jpg'),(2160,405,'양송이버섯, 양파, 파프리카, 피망, 소고기는 큐브모양으로 썬다.\n소고기는 키친타월로 핏물을 제거한 뒤 사용해요.','0526_1.jpg'),(2161,405,'소고기는 밑간 재료를 넣고 10분간 재운다.','0526_2.jpg'),(2162,405,'볼에 소스 재료를 넣고 소스를 만든다.','0526_3.jpg'),(2163,405,'달군 팬에 버터를 두르고 소고기를 굽는다.\n네오플램 노블레스 프라이팬','0526_4.jpg'),(2164,405,'소고기의 겉면이 살짝 익으면 채소와 소스를 넣고 익혀 완성한다.','0526_5.jpg'),(2165,406,'참치통조림, 마요네즈, 소금, 후추를 넣고 고루 섞는다.','0529_1.jpg'),(2166,406,'밥에 밑간 재료를 넣고 고루 섞는다.','0529_2.jpg'),(2167,406,'밥을 동글 납작하게 만들어 참치마요를 넣고 감싸 동그랗게 만든다.','0529_3.jpg'),(2168,406,'김 중앙에 동그랗게 구멍을 만들어 주먹밥을 넣고 랩으로 감싼다.\n김을 미리 꺼내어두면 살짝 눅눅해져 감쌀 때 김이 찢어지지 않아요','0529_4.jpg'),(2169,406,'치즈-> 눈, 김 -> 수염, 입, 맛살 -> 목줄을 붙여 완성한다.\n빨대로 치즈를 자르면 좋아요','0529_5.jpg'),(2170,407,'손질된 고등어를 키친타올로 닦아 물기를 제거한다.','0530_1.jpg'),(2171,407,'반으로 자른후 소금, 레몬즙을 뿌린다.','0530_2.jpg'),(2172,407,'에어프라이어 170도 15분간 구워 완성한다.\n에어프라이어','0530_3.jpg'),(2173,408,'김치는 한입 크기로 썰고 대파는 송송 썰어 준비한다.\n김치 1cup, 대파 10cm 1대','0531_1.jpg'),(2174,408,'달군 냄비에 참기름을 넣고 다진마늘, 고춧가루를 넣어 볶는다.\n참기름 1T, 다진마늘 1T, 고춧가루 1/2T\n냄비','0531_2.jpg'),(2175,408,'2에 김치를 넣어 볶는다.','0531_3.jpg'),(2176,408,'3에 멸치다시마육수를 넣어 한소끔 끓인다.\n멸치다시마육수 500ml','0531_4.jpg'),(2177,408,'4에 순두부와 국간장을 넣어 한소끔 더 끓인다.\n순두부 1팩, 국간장 1/2T','0531_5.jpg'),(2178,408,'한소끔 끓인 냄비에 달걀과 대파를 넣어 완성한다.\n달걀 1개\n부족한 간은 소금이나 새우젓으로 더한다.','0531_6.jpg'),(2179,409,'애호박은 2등분한 후 0.5cm로 반달 썰고 양파는 채썬다.','0532_1.jpg'),(2180,409,'볼에 애호박, 소금 1/6숟가락을 넣고 10분간 절인 후 키친타월로 물기를 제거한다.','0532_2.jpg'),(2181,409,'팬에 식용유를 두르고 양파를 볶다가 양파가 투명해지면 애호박을 넣고 중불에서 2~3분 볶는다.','0532_3.jpg'),(2182,409,'애호박이 익으면 양념 재료를 넣고 1분간 볶는다.','0532_4.jpg'),(2183,409,'불을 끄고 참기름과 통깨를 뿌려 완성한다.','0532_5.jpg'),(2184,410,'떡국은 찬물에 담가 놓는다.','0533_1.jpg'),(2185,410,'대파는 송송 썰어 준비한다.','0533_2.jpg'),(2186,410,'냄비에 설렁탕을 넣어 한소끔 끓인다.','0533_3.jpg'),(2187,410,'떡국 떡을 넣고 소금으로 간을 한다.','0533_4.jpg'),(2188,410,'한소끔 끓이고 대파를 넣는다.','0533_5.jpg'),(2189,410,'그릇에 담아 삶은 고기와 달걀지단을 고명으로 올려 완성한다.','0533_6.jpg'),(2190,411,'대파와 청양고추는 송송 썬다.','0535_1.jpg'),(2191,411,'끓는물에 라면 스프, 면을 넣는다.','0535_2.jpg'),(2192,411,'다진 마늘, 콩나물, 황태, 달걀을 넣는다.','0535_3.jpg'),(2193,411,'청양고추, 대파, 고춧가루를 넣은 후 한소끔 끓여 완성한다.','0535_4.jpg'),(2194,412,'[스모어1]\n크래커 위에 초콜릿을 올리고 말랑카우를 올린다.','0537_1.jpg'),(2195,412,'전자레인지에 20초간 돌린다.\n전자레인지','0537_2.jpg'),(2196,412,'말랑카우와 초콜릿이 살짝 녹으면 크래커로 덮어 완성한다.','0537_3.jpg'),(2197,412,'[스모어2]\n초코다이제 위에 마시멜로우를 올린다.','0537_4.jpg'),(2198,412,'전자레인지에 30초간 살짝 돌리고 초코다이제로 덮어 완성한다.\n전자레인지','0537_5.jpg'),(2199,413,'낙지는 큼직하게 썰고 대파는 어슷, 양파와 양배추는 채썰어 준비한다.볼에 양념 재료를 넣고 양념장을 만든다.\n낙지 2마리, 삼겹살 4줄=500g , 양배추 1줌, 양파 1개, 대파 1대,설탕 2숟가락, 진간장 3숟가락, 고춧가루 3숟가락, 다진 마늘 1숟가락, 고추장 3숟가락, 참기름 1숟가락, 맛술 3숟가락\n볼','0540_1.jpg'),(2200,413,'양념장에 삼겹살과 낙지를 넣고 섞는다.\nTip) 20~30분 재워두면 양념이 배어 더 맛있어요.','0540_2.jpg'),(2201,413,'팬에 식용유 약간을 두르고 대파, 양파를 넣어 볶는다.\n식용유 약간\n팬','0540_3.jpg'),(2202,413,'양파가 투명해지면 삼겹살, 낙지, 양배추를 넣고 볶은 후 통깨를 뿌려 완성한다.','0540_4.jpg'),(2203,414,'콩나물은 미리 삶아 준비하고 양파 깻잎은 채 썰어 준비해요.\n네오플램 레트로T 양수냄비','0542_1.jpg'),(2204,414,'물이 끓으면 쌀면을 넣어 약 8분간 삶아요.','0542_2.jpg'),(2205,414,'예열된 팬에 주꾸미 볶음을 넣고 물을 100ml(1/2종이컵)을 넣어 볶아요.\n네오플램 피카 프라이팬','0542_3.jpg'),(2206,414,'삶은 콩나물, 양파를 함께 넣어 볶아요.','0542_4.jpg'),(2207,414,'약 5분간 볶은 후 삶아놓은 쌀면과 깻잎을 넣어 버무려요.','0542_5.jpg'),(2208,414,'그릇에 담아 참기름을 뿌려 주꾸미볶으면을 완성해요.\n주꾸미볶음면을 다 먹은 후 남은 양념에 밥, 김가루를 넣어 볶음밥을 만들어요.','0542_6.jpg'),(2209,415,'양파는 채 썰고 대파와 청양고추는 어슷 썬다.','0543_1.jpg'),(2210,415,'볼에 양념 재료를 넣고 양념장을 만든다.','0543_2.jpg'),(2211,415,'볼에 대패삼겹살과 양념장을 넣고 섞은 후 10분간 재운다.','0543_3.jpg'),(2212,415,'달군 팬에 기름을 두르고 채 썬 양파를 볶다가 양파가 투명해지면 양념에 재워둔 돼지고기를 넣어 볶는다.\n네오플램 노블레스 프라이팬','0543_4.jpg'),(2213,415,'돼지고기가 익으면 콩나물과 어슷 썬 청양고추, 대파를 넣어 볶는다.','0543_5.jpg'),(2214,415,'불을 끄고 참기름을 넣고 통깨를 뿌려 완성한다.','0543_6.jpg'),(2215,416,'달군 팬에 기름을 두르고 편마늘을 볶는다.\n네오플램 노블레스 프라이팬','0545_1.jpg'),(2216,416,'마늘향이 올라오면 곱창, 다진 양파와 송송 썬 부추, 양념 재료를 넣어 볶는다.','0545_2.jpg'),(2217,416,'양파가 투명해지면 밥을 넣고 볶는다.','0545_3.jpg'),(2218,416,'곱창이 익으면 불을 끄고 참기름을 두르고 통깨를 뿌려 완성한다.','0545_4.jpg'),(2219,417,'양파는 채 썰고 대파와 청양고추는 어슷 썬다.','0547_1.jpg'),(2220,417,'볼에 양념 재료를 넣고 양념장을 만든다.','0547_2.jpg'),(2221,417,'달군 팬에 기름을 약간 두르고 채 썬양파를 볶는다.\n네오플램 노블레스 프라이팬','0547_3.jpg'),(2222,417,'양파가 투명해지면 낙지, 양념장을 넣고 볶는다.','0547_4.jpg'),(2223,417,'낙지가 익으면 청양고추, 대파를 넣어 볶는다.','0547_5.jpg'),(2224,417,'불을 끄고 참기름과 통깨를 뿌린 뒤 밥 위에 얹어 완성한다.','0547_6.jpg'),(2225,418,'냄비에 육수, 고추장을 넣고 끓인다.','0549_1.jpg'),(2226,418,'물이 끓으면 김치, 고춧가루, 다진마늘, 국간장, 수제비를 넣고 간을 한다.','0549_2.jpg'),(2227,418,'수제비가 다 익으면 송송 썬 대파, 어슷 썬 청양고추와 홍고추를 넣고 완성한다.','0549_3.jpg'),(2228,419,'돼지 등갈비는 찬물에 담가 약 30분 이상 핏물을 뺀다.','0550_1.jpg'),(2229,419,'볼에 분량의 소스재료를 넣어 소스를 만든다.','0550_2.jpg'),(2230,419,'핏물 뺀 등갈비는 냄비에 넣어 등갈비가 잠길정도의 물을 부어 한소끔 끓여 찬물에 깨끗이 헹군다.','0550_3.jpg'),(2231,419,'준비한 등갈비는 팬에 넣어 고기가 잠길 정도로 물을 붓고 통후추, 대파, 양파, 청주, 월계수잎을 넣어 고기가 익을 때까지 푹 끓인다.','0550_4.jpg'),(2232,419,'다른 팬에 등갈비와 고기 육수 2국자를 넣고 만들어 놓은 소스를 부어 졸인다.','0550_5.jpg'),(2233,419,'양념이 졸여지면 가운데 피자치즈를 올려 뚜껑을 닫아 치즈를 녹여 완성한다.','0550_6.jpg'),(2234,420,'베이컨과 파김치는 한 입 크기로 썰고 대파와 쪽파는 송송 썬다.','0552_1.jpg'),(2235,420,'중불로 달군 팬에 식용유를 두르고 달걀프라이를 해 건진다.','0552_2.jpg'),(2236,420,'다시 식용유를 둘러 대파, 마늘, 베이컨을 볶는다.','0552_3.jpg'),(2237,420,'마늘이 노릇해지면 밥과 파김치, 김치국물을 넣어 볶는다.\n밥은 미지근하거나 찬밥을 사용하는 것이 좋아요.','0552_4.jpg'),(2238,420,'고루 섞이면 약한 불로 줄인 뒤 고추장과 고춧가루, 참기름을 넣어 조금 더 볶는다.\n맛을 보고 싱겁다면 간장으로 간을 맞추세요.','0552_5.jpg'),(2239,420,'볶음밥 위에 달걀프라이, 김가루, 날치알, 쪽파, 통깨를 뿌려 완성한다.','0552_6.jpg'),(2240,421,'가지는 편으로 썰고 토마토는 한입크기로 썰고 양파는 채 썰어 준비한다.','0554_1.jpg'),(2241,421,'예열된 팬에 올리브유를 조금 두르고 가지를 앞 뒤로 노릇하게 굽는다.','0554_2.jpg'),(2242,421,'구워진 가지에 양파, 토마토와 양념 재료를 넣어 볶는다.','0554_3.jpg'),(2243,421,'그릇에 담아 통후추를 뿌려주어 향긋함을 더한다.','0554_4.jpg'),(2244,422,'방울토마토는 2등분하고 양송이버섯과 미니새송이버섯은 통썰기한다.','0556_1.jpg'),(2245,422,'볼에 소스 재료를 넣고 소스를 만든다.\n후추를 약간 뿌리시면 더 좋아요.','0556_2.jpg'),(2246,422,'달군 팬에 올리브유를 두르고 버섯과 통마늘을 넣고 중불에서 굽듯이 2분간 볶다가 허브솔트를 뿌리고 노릇하게 굽는다.','0556_3.jpg'),(2247,422,'그릇에 샐러드채소를 담고 구운 버섯, 방울토마토를 올린다.','0556_4.jpg'),(2248,422,'4에 소스를 뿌린 뒤 파마산치즈가루를 취향껏 뿌려 완성한다.','0556_5.jpg'),(2249,423,'양배추는 채 썬 후 찬물에 담가 준다.','0558_1.jpg'),(2250,423,'깨를 곱게 갈아 볼에 담고 나머지 재료를 넣고 드레싱을 만든다.','0558_2.jpg'),(2251,423,'양배추를 그릇에 담고 연두드레싱 소스를 부어 완성한다.','0558_3.jpg'),(2252,424,'- 토마토는 씨를 제거한 후 다져서 준비한다.\n- 오렌지는 과육만 손질하여 준비한다.\n- 아보카도는 씨와 껍질을 제거하여 준비한다.','0559_1.jpg'),(2253,424,'볼에 아보카도를 넣고 으깬다.','0559_2.jpg'),(2254,424,'으깬 아보카도에 소금, 후추, 굵은 고춧가루를 넣고 섞는다.','0559_3.jpg'),(2255,424,'볼에 올리브유, 레몬즙, 소금, 후추를 넣고 샐러드드레싱을 만든다.','0559_4.jpg'),(2256,424,'어린잎 채소에 샐러드드레싱을 넣고 버무린다.','0559_5.jpg'),(2257,424,'컵에 아보카도를 넣고 토마토, 어린잎 채소, 오렌지를 올리고 굵은 고춧가루를 뿌려 완성한다.','0559_6.jpg'),(2258,425,'토핑재료의 과일을 제외한 과일은 모두 얼려 준비한다.\n냉동과일을 사용하면 좋아요','0560_1.jpg'),(2259,425,'토핑재료의 바나나를 슬라이스한다.','0560_2.jpg'),(2260,425,'아사이베리스무디, 아사이볼 재료를 각각 믹서기로 갈아준다.','0560_3.jpg'),(2261,425,'아사이베리스무디는 잔에 담아 블루베리, 애플민트를 얹어 완성한다.','0560_4.jpg'),(2262,425,'그릇에 갈은 아사이볼 재료를 담아 슬라이스바나나, 블루베리, 애플민트, 그래놀라를 얹어 완성한다.\n슈가파우더를 뿌리면 이뻐요','0560_5.jpg'),(2263,426,'바나나는 껍질을 벗겨 얇게 썬다.','0561_1.jpg'),(2264,426,'그릇에 요거트를 담는다.','0561_2.jpg'),(2265,426,'요거트 위에 바나나, 견과류를 먹기좋게 올린다.','0561_3.jpg'),(2266,426,'카카오 닙스를 뿌려 완성한다.','0561_4.jpg'),(2267,427,'레몬은 껍질을 벗기고 오이와 함께 한 입 크기로 썬다.','0562_1.jpg'),(2268,427,'믹서기에 모든 재료를 넣고 간다.','0562_2.jpg'),(2269,427,'컵에 따라 완성한다.','0562_3.jpg'),(2270,428,'케일과 껍질을 벗긴 라임은 한 입 크기로 썬다.','0563_1.jpg'),(2271,428,'믹서기에 모든 재료를 넣고 간다.','0563_2.jpg'),(2272,428,'2를 부어 완성한다.','0563_3.jpg'),(2273,429,'방울토마토와 블랙올리브는 2등분하고 삶은 달걀은 슬라이스한다.','0565_1.jpg'),(2274,429,'볼에 드레싱 재료를 넣고 드레싱을 만든다.','0565_2.jpg'),(2275,429,'그릇에 샐러드채소와 어린잎채소를 리스 모양으로 둥글게 놓는다.','0565_3.jpg'),(2276,429,'방울토마토, 블랙올리브, 삶은 달걀, 큐브치즈를 올린 후 드레싱과 치즈를 뿌려 완성한다.\n드레싱은 먹기 직전에 뿌려 드세요.','0565_4.jpg'),(2277,430,'감자는 깍뚝 썰어 전자레인지에서 10분간 조리한다.\n전자레인지','0566_1.jpg'),(2278,430,'쥬키니호박은 1cm 간격으로 칼집을 넣고 4등분 한다.','0566_2.jpg'),(2279,430,'뜨거운 감자를 으깬 후 버터 2숟가락, 소금, 후추, 파슬리를 넣고 고루 섞는다.\n버터가 충분히 녹아 매끈해질때 까지 섞어주세요','0566_3.jpg'),(2280,430,'볼에 소고기, 빵가루, 다진 양파, 넛맥, 소금, 후추를 넣고 고루 섞는다.','0566_4.jpg'),(2281,430,'쥬키니호박 사이에 소고기 반죽을 넣는다.','0566_5.jpg'),(2282,430,'오븐 용기에 감자-> 소고기 호박-> 토마토소스-> 피자치즈를 넣는다.','0566_6.jpg'),(2283,430,'170도 예열된 오븐에 30분간 구워 완성한다.\n오븐','0566_7.jpg'),(2284,431,'가지는 세로로 칼집을 넣어 4등분하여 펼친다.','0567_1.jpg'),(2285,431,'베이컨, 양파, 파프리카는 채썰고, 양송이는 편썬다.','0567_2.jpg'),(2286,431,'오븐팬에 가지를 올리고 올리브유, 소금, 후추를 뿌린다.','0567_3.jpg'),(2287,431,'토마토소스를 펴 바른다.','0567_4.jpg'),(2288,431,'손질한 재료들을 올린다.','0567_5.jpg'),(2289,431,'피자치즈, 리코타치즈를 올린다.','0567_6.jpg'),(2290,431,'190도 예열한 오븐에 10분간 구워 완성한다.\n오븐','0567_7.jpg'),(2291,432,'양파, 토마토는 굵게 다진다.\n토마토는 씨 제거 후 다져주세요.','0568_1.jpg'),(2292,432,'아보카도는 반으로 갈라 씨를 뺀 후 껍질을 제거해 으깬다.','0568_2.jpg'),(2293,432,'으깬 아보카도에 양파, 토마토, 레몬즙, 소금, 후추를 넣고 섞어 과카몰리를 만든다.','0568_3.jpg'),(2294,432,'또띠아는 삼각형 모양으로 6등분한다.','0568_4.jpg'),(2295,432,'또띠아에 피자치즈를 뿌리고 막대과자를 올려 또띠아로 덮은 후 160도 예열한 오븐에 5분간 굽는다.\n오븐','0568_5.jpg'),(2296,432,'구워진 또띠아 위에 과카몰리를 바르고 방울토마토, 파프리카, 블랙올리브로 장식하여 완성한다.','0568_6.jpg'),(2297,433,'팥은 물에 2~3번 씻는다.','0570_1.jpg'),(2298,433,'냄비에 팥, 소금을 넣고 팥이 잠길 정도의 물을 넣고 10분간 끓인다.','0570_2.jpg'),(2299,433,'물이 끓으면 체에 걸러 팥물을 버린다.','0570_3.jpg'),(2300,433,'냄비에 삶은 팥, 물 6종이컵을 붓고 중불에서 20분간 끓인다.','0570_4.jpg'),(2301,433,'물 2종이컵을 더 붓고 약불로 10분간 더 끓인다.','0570_5.jpg'),(2302,433,'믹서에 삶은 팥을 넣고 갈아준다.','0570_6.jpg'),(2303,433,'냄비에 옮겨 설탕, 소금으로 간을 한다.','0570_7.jpg'),(2304,434,'고구마는 껍질 벗겨 한 입 크기로 썬다.','0571_1.jpg'),(2305,434,'볼에 담아 랩을 씌워 전자레인지에 8~9분간 돌려 익힌다.\n전자레인지','0571_2.jpg'),(2306,434,'부드럽게 익으면 소금, 설탕을 넣어 섞은 뒤 찹쌀가루를 넣어 한번 더 섞는다.\n반죽이 너무 퍽퍽하면 우유나 물을 넣으세요.','0571_3.jpg'),(2307,434,'표면이 매끄러워지면 먹기 좋게 등분해 둥글납작하게 빚는다.\n글러브센스 주방 위생장갑','0571_4.jpg'),(2308,434,'중약 불로 달군 팬에 식용유를 두른 뒤 반죽을 앞뒤로 노릇하게 굽는다.','0571_5.jpg'),(2309,434,'참기름과 꿀, 슬라이스아몬드를 뿌려 완성한다.','0571_6.jpg'),(2310,435,'마카로니는 끓는물에 5분간 삶는다.','0573_1.jpg'),(2311,435,'미트볼은 손으로 으깬다.','0573_2.jpg'),(2312,435,'팬에 버터를 녹이고 밀가루를 넣어 볶는다\n약불로 볶아줘야 타지 않아요.','0573_3.jpg'),(2313,435,'우유를 조금씩 넣어가며 끓인다.','0573_4.jpg'),(2314,435,'슬라이스치즈, 모짜렐라치즈를 넣고 끓인다.','0573_5.jpg'),(2315,435,'후추, 마카로니, 으깬 미트볼을 넣고 섞는다.','0573_6.jpg'),(2316,435,'용기에 담고 빵가루, 파마산치즈를 뿌린다.','0573_7.jpg'),(2317,435,'190도 예열한 오븐에 10분간 구워 완성한다.\n오븐','0573_8.jpg'),(2318,436,'모닝빵은 반으로 가른다.','0574_1.jpg'),(2319,436,'양파, 토마토를 링모양으로 썬다.','0574_2.jpg'),(2320,436,'볼에 소고기패티재료를 넣고 고루 섞어 치댄다.','0574_3.jpg'),(2321,436,'달군 팬에 기름을 충분히 두르고 소고기 패티를 노릇하게 굽는다.\n네오플램 노블레스 프라이팬','0574_4.jpg'),(2322,436,'팬에 모닝빵->토마토소스-> 양상추 ->토마토, 양파 -> 피자치즈->패티->슬라이스치즈를 얹어 약불에서 5분간 구워 완성한다.\n190도로 예열된 오븐에 5~8분간 구워도 좋아요','0574_5.jpg'),(2323,437,'냄비에 버터를 넣고 녹인 후 밀가루를 넣고 루를 만든다.','0575_1.jpg'),(2324,437,'따뜻하게 데운 우유를 넣고 고루 섞는다.\n뭉치지 않게 고루 풀어주세요','0575_2.jpg'),(2325,437,'삶은 마카로니는 넣고 고루 섞은 후 체다치즈, 소금 후추를 넣고 고루 섞는다.','0575_3.jpg'),(2326,437,'피자도우에 토마토소스를 바른 후 맥앤치즈-> 피자치즈를 올린다.','0575_4.jpg'),(2327,437,'200도 예열된 오븐에 15분간 구워 완성한다.\n오븐','0575_5.jpg'),(2328,438,'식빵의 가장자리를 잘라 밀대로 납작하게 밀어준다.','0576_1.jpg'),(2329,438,'원형틀에 식빵을 동그랗게 두른다.','0576_2.jpg'),(2330,438,'토마토소스-> 베이컨-> 슬라이스치즈-> 슬라이스양송이 -> 피자치즈 순으로 2~3번 반복한다.\n베이컨은 X자로 겹쳐 쌓아주세요','0576_3.jpg'),(2331,438,'200도로 예열된 오븐에 30분간 구워 완성한다.\n오븐','0576_4.jpg'),(2332,439,'실온에 둔 버터는 볼에 담아 거품기로 잘 풀어준 뒤 바닐라 익스트랙, 설탕, 소금을 넣고 잘 섞는다.\n서걱거림이 느껴지지 않을 때까지 섞어요.','0578_1.jpg'),(2333,439,'실온에 둔 달걀을 2번에 나눠 넣어가며 섞는다.','0578_2.jpg'),(2334,439,'박력분과 베이킹파우더, 말차가루를 체 쳐 넣은 뒤 주걱으로 섞어요.','0578_3.jpg'),(2335,439,'우유를 넣어 반죽농도를 맞추고 유산지컵을 깔은 머핀틀에 나눠 담는다.','0578_4.jpg'),(2336,439,'180도로 예열한 오븐에 20~25분간 구운 후 식힌다.\n오븐\n꼬치로 찔렀을 때 묻어나지 않으면 다 익은거예요.','0578_5.jpg'),(2337,439,'볼에 크림치즈를 넣고 전동거품기로 잘 풀어준 뒤 생크림을 넣고 휘핑한다.','0578_6.jpg'),(2338,439,'설탕을 2~3번에 나눠 넣어가며 휘핑한 뒤 짤주머니에 담아 식힌 머핀에 짜올린다.','0578_7.jpg'),(2339,439,'초코칩으로 눈과 코를 장식해 완성한다.','0578_8.jpg'),(2340,440,'딸기, 설탕을 넣고 으깬다.\n냉동딸기를 사용해도 좋아요','0580_1.jpg'),(2341,440,'얼음, 우유, 아이스크림을 넣고 믹서기로 스무디를 만든다.','0580_2.jpg'),(2342,440,'잔에 초코시럽 -> 으깬딸기-> 스무디를 담는다.','0580_3.jpg'),(2343,440,'돼지바를 꽂아 완성한다.','0580_4.jpg'),(2344,441,'초콜릿은 조각조각 자른다.','0581_1.jpg'),(2345,441,'용기에 초콜릿을 깔고 마시멜로우를 올린다,','0581_2.jpg'),(2346,441,'에어프라이어에 넣고 180도 온도에서 10분간 돌려 완성한다.\n에어프라이어\n크래커를 찍어 드시면 좋아요.','0581_3.jpg'),(2347,442,'실온에 둔 말랑한 버터를 볼에 넣고 고무주걱으로 잘 풀어준다.\n발효버터는 유산균으로 발효하여 만든 버터로 특유의 구수한 풍미가 있어 쿠키류를 만들 때 사용하면 좋아요.\n스위스 투가르투 ALL 실리콘 주걱\n스위스 투가르투 ALL 실리콘 스푼','0583_1.jpg'),(2348,442,'슈가파우더와 소금을 넣고 고무주걱으로 살살 저으면서 섞어준다.','0583_2.jpg'),(2349,442,'달걀노른자를 넣고 버터와 잘 섞일 수 있도록 고무주걱으로 잘 저어준다.\n노른자는 계량 후 실온에 그냥 두면 표면이 말라 덩어리가 생겨요. 꼭 랩을 씌워 보관하세요.','0583_3.jpg'),(2350,442,'체친 박력분을 넣고 고무주걱으로 자르듯이 섞어 한덩어리가 되도록 한다.','0583_4.jpg'),(2351,442,'반죽이 볼에 묻어나지 않을 정도로 섞이면 얼그레이 티를 넣고 잘 섞어준다.','0583_5.jpg'),(2352,442,'반죽을 유산지 위에 올리고 각을 잡아 삼각형으로 성형한다.','0583_6.jpg'),(2353,442,'유산지로 반죽을 잘 감싸 냉동고에서 20분 정도 굳힌다.','0583_7.jpg'),(2354,442,'휴지 된 반죽을 유산지 벗기고 설탕에 굴려준다.','0583_8.jpg'),(2355,442,'1.3cm 정도 두께로 일정하게 자른 다음 오븐팬에 테프론 시트를 깔고 팬닝한다.','0583_9.jpg'),(2356,442,'170도로 예열한 오븐에 17~20분 구워준다.\n오븐\n구워진 쿠키를 뒤집어 보았을 때 바닥이 노릇하게 색이 나오면 완성입니다.','0583_10.jpg'),(2357,442,'다 구워진 쿠키는 팬에서 꺼내 식힘망에 식힌다.','0583_11.jpg'),(2358,443,'버터는 휘핑기로 풀어 부드럽게 만든다.\n파켈만 프리미엄 거품기','0584_1.jpg'),(2359,443,'슈가파우더를 나누어 넣고 고루 섞는다.','0584_2.jpg'),(2360,443,'고루 푼 달걀을 나누어 넣고 바닐라 에센스를 넣고 섞는다.','0584_3.jpg'),(2361,443,'박력분을 체친 후 소금을 넣고 고무주걱으로 고루 섞는다.\n스위스 투가르투 ALL 실리콘 스푼','0584_4.jpg'),(2362,443,'반죽을 15g 떼어 동그랗게 만든 후 170도 예열된 오븐에 12~14분간 구워 식힌다.\n오븐\n색이 나지 않도록 주의해 주세요','0584_5.jpg'),(2363,443,'물, 빨간색소를 풀어 진한 복숭아색으로 만든다.','0584_6.jpg'),(2364,443,'쿠키 뒷면에 구멍을 뚫는다.','0584_7.jpg'),(2365,443,'쿠키 부스러기1/2종이컵, 누텔라 1종이컵을 넣고 섞은 후 구멍을 낸 쿠키에 채운다.','0584_8.jpg'),(2366,443,'2개의 쿠키를 뒷면이 마주보게 붙여 복숭아색 색소물에 묻힌 후 3분간 말린다.','0584_9.jpg'),(2367,443,'설탕을 충분히 묻혀 애플민트로 잎을 만들어 완성한다.','0584_10.jpg'),(2368,444,'젤라틴은 찬물에 넣어 약 15분간 불려요.','0585_1.jpg'),(2369,444,'냄비에 냉동 블루베리와 설탕을 넣어 끓여요.','0585_2.jpg'),(2370,444,'끓어오르면 레몬즙을 넣어 약 10분간 더 끓여요.','0585_3.jpg'),(2371,444,'지퍼팩에 통밀비스켓을 담고 방망이를 이용해 잘게 부셔요.','0585_4.jpg'),(2372,444,'부셔놓은 비스켓에 녹인 버터를 넣고 비스켓에 잘 스며들도록 주물러요.','0585_5.jpg'),(2373,444,'무스링에 비스켓을 담아 평평하게 눌러 냉장실에 보관해요.','0585_6.jpg'),(2374,444,'볼에 생크림, 설탕을 넣어 뿔이생길때 까지 휘핑해요.','0585_7.jpg'),(2375,444,'다른 볼에 크림치즈와 플레인 요거트를 넣어 풀어요.','0585_8.jpg'),(2376,444,'크림치즈에 레몬즙을 넣어 다시한번 휘핑해요.','0585_9.jpg'),(2377,444,'불린 젤라틴은 손으로 물기를 짜고 전자레인지에 5~10초 정도 녹여요.\n전자레인지','0585_10.jpg'),(2378,444,'크림치즈반죽에 녹인 젤라틴을 넣어 휘핑해요.','0585_11.jpg'),(2379,444,'블루베리 필링을 3숟가락 넣어 섞어요.','0585_12.jpg'),(2380,444,'휘핑해 놓은 생크림을 넣어 주걱으로 섞어요.','0585_13.jpg'),(2381,444,'무스 링에 넣어 크림치즈 필링을 넣어요.\n중간에 블루베리 필링을 조금씩 넣어주어요.','0585_14.jpg'),(2382,444,'냉장고에 넣어 3시간 이상 넣어 굳혀요.','0585_15.jpg'),(2383,444,'냉장고에서 꺼내어 무스틀을 빼고 블루베리필링을 조금 올려 장식해 완성해요.\n무스틀은 뜨거운 수건을 감싸 빼주세요.','0585_16.jpg'),(2384,445,'깻잎은 얇게 채썬다.','0586_1.jpg'),(2385,445,'식용유를 제외한 양념은 고루 섞는다.','0586_2.jpg'),(2386,445,'180도로 달군 기름에 치즈떡, 김말이 튀김을 튀겨 기름을 제거한다\n네오플램 피카 프라이팬','0586_3.jpg'),(2387,445,'완성그릇에 피자치즈를 넣고 전자레인지에 3분간 조리한다.\n전자레인지','0586_4.jpg'),(2388,445,'달군 팬에 식용유를 둘러 양념장을 넣고 바글바글 끓인다.','0586_5.jpg'),(2389,445,'튀긴 떡, 김말이튀김을 넣고 중약불에서 버무린다.','0586_6.jpg'),(2390,445,'녹인 치즈에 머무린 떡, 튀김, 깻잎, 통깨를 얹어 완성한다.','0586_7.jpg'),(2391,446,'팬에 올리브유를 두른 뒤 양파와 다진 마늘을 노릇해질 때까지 중약 불로 볶는다.','0587_1.jpg'),(2392,446,'으깬 홀토마토와 이탈리안시즈닝, 소금, 후추를 넣고 걸쭉해질 때까지 끓여 식혀 피자소스를 만든다.\n피자소스 만들기가 번거롭다면 시판 피자소스나 파스타소스를 사용해도 좋아요.','0587_2.jpg'),(2393,446,'피자도우에 피자소스를 얇게 바르고 피자치즈를 고루 뿌린다.','0587_3.jpg'),(2394,446,'페퍼로니를 돌려 담는다.','0587_4.jpg'),(2395,446,'210도로 예열한 오븐에 6~7분간 굽는다.\n오븐','0587_5.jpg'),(2396,446,'파슬리가루를 뿌리고 피자커터로 먹기 좋게 잘라 완성한다.\n취향에 따라 크러쉬드 페퍼, 핫소스, 파마산치즈 등을 곁들이세요.','0587_6.jpg'),(2397,447,'찐고구마에 우유를 넣어 으깬다.','0588_1.jpg'),(2398,447,'면을 삶아준 후 물기를 제거한다.','0588_2.jpg'),(2399,447,'면에 달걀을 넣어 섞는다.','0588_3.jpg'),(2400,447,'팬에 앞뒤로 굽는다.','0588_4.jpg'),(2401,447,'불닭소스, 토마토소스를 섞는다.','0588_5.jpg'),(2402,447,'구운 면에 소스를 바르고 구운 닭가슴살, 피망, 치즈를 올린다.','0588_6.jpg'),(2403,447,'고구마 으깬것을 올려 170도 오븐에 10분간 구워 완성한다.','0588_7.jpg'),(2404,448,'한 입 크기로 썬 닭다리살에 밑간 재료를 섞어 10~20분간 재운다.','0589_1.jpg'),(2405,448,'볼에 닭다리살을 넣고 찹쌀가루를 묻힌 후 털어낸다.','0589_2.jpg'),(2406,448,'찹쌀가루를 묻힌 닭다리살을 에어프라이어에 넣고 180도에서 15분간 익힌 후 뒤집어 5분간 더 익힌다.\n에어프라이어','0589_3.jpg'),(2407,448,'익힌 닭다리살에 콩가루를 묻힌다.\n이때 인절미를 같이 추가해도 좋아요.','0589_4.jpg'),(2408,448,'접시에 콩가루를 묻힌 닭다리살과 인절미를 담고 꿀을 뿌려 완성한다.','0589_5.jpg'),(2409,449,'식빵에 누텔라를 바른다.','0590_1.jpg'),(2410,449,'마시멜로우를 올리고 누텔라 바른 식빵으로 덮는다.','0590_2.jpg'),(2411,449,'팬에 버터를 녹이고 식빵을 양쪽으로 구워 완성한다.','0590_3.jpg'),(2412,450,'등뼈는 찬물에 약 1시간 담가 핏물을 제거한다.','0591_1.jpg'),(2413,450,'중간중간 물을 교체해주세요.','0591_2.jpg'),(2414,450,'끓는 물에 등뼈를 넣고 5분간 삶아 찬물에 헹군다.','0591_3.jpg'),(2415,450,'냄비에 삶은 등뼈, 물 2리터, 삶는 재료를 넣고 끓인다.\n중불에서 뚜껑을 닫고 삶아요.','0591_4.jpg'),(2416,450,'다 삶은 등뼈국물은 걸러준다.','0591_5.jpg'),(2417,450,'시래기는 양념재료를 넣고 버무린다.','0591_6.jpg'),(2418,450,'냄비에 등뼈, 양념한 시래기, 등뼈국물을 넣고 30분간 삶는다.','0591_7.jpg'),(2419,450,'감자, 대파, 청양고추, 홍고추, 깻잎을 넣고 한소끔 끓여 완성한다.','0591_8.jpg'),(2420,451,'슬라이스 훈제연어 1개에 크림치즈 1/2숟가락을 넣어 돌돌 만다.','0594_1.jpg'),(2421,451,'후추와 발사믹 그레이즈를 뿌린다.','0594_2.jpg'),(2422,451,'파슬리가루를 뿌려 완성한다.\n레몬즙을 약간 뿌리면 상큼해요.','0594_3.jpg'),(2423,452,'소시지, 베이컨, 양송이는 한입 크기로 썰고 청양고추, 마늘은 송송 썰고 양파는 다져서 준비한다.','0595_1.jpg'),(2424,452,'팬에 올리브유를 두르고 다진 양파를 넣고 볶는다.','0595_2.jpg'),(2425,452,'양파가 투명해지면 편마늘, 베이컨, 소세지, 양송이, 청양고추를 넣고 볶다가 버터를 넣는다.','0595_3.jpg'),(2426,452,'볶아진 재료에 토마토 소스, 우유를 넣고 5분 끓인다.','0595_4.jpg'),(2427,452,'달걀과 모짜렐라 치즈를 넣고 소금, 후추로 간을 한다.','0595_5.jpg'),(2428,452,'달걀이 반숙으로 익으면 불을 끄고 바질을 올려 완성한다.','0595_6.jpg'),(2429,453,'팬에 빵을 굽는다.','0596_1.jpg'),(2430,453,'방울토마토는 십자로 칼집을 낸다.','0596_2.jpg'),(2431,453,'끓는물에 데친 후 찬물에 헹궈 껍질을 벗긴다.','0596_3.jpg'),(2432,453,'씨를 제거하여 굵직하게 다진다.','0596_4.jpg'),(2433,453,'올리브, 바질을 굵직하게 다진다.','0596_5.jpg'),(2434,453,'소스재료를 만든다.','0596_6.jpg'),(2435,453,'소스에 준비한 재료를 모두 넣고 섞는다.','0596_7.jpg'),(2436,453,'빵위에 한 숟가락씩 올린다.','0596_8.jpg'),(2437,453,'발사믹크림을 뿌려 완성한다.','0596_9.jpg'),(2438,454,'까망베르 치즈 위에 다진 견과류를 올리고 꿀을 뿌린다.','0597_1.jpg'),(2439,454,'180도로 예열된 오븐에 10분 정도 굽는다.\n오븐','0597_2.jpg'),(2440,454,'마지막으로 시나몬 가루, 꿀을 뿌려 완성한다.','0597_3.jpg'),(2441,455,'두부는 물기를 제거하고 으깬다.\n두부 1/2모','0599_1.jpg'),(2442,455,'두부에 양파, 옥수수, 당근, 빵가루 5숟가락, 흰자, 소금, 후추를 넣고 치댄다.\n다진 양파 2숟가락 , 캔 옥수수 2숟가락 , 다진 당근 2숟가락 , 빵가루 1종이컵,달걀(흰자) 3숟가락,소금 약간 , 후추 약간','0599_2.jpg'),(2443,455,'손으로 모양을 잡아 빵가루를 묻힌다.','0599_3.jpg'),(2444,455,'예열된 기름에 노릇하게 튀겨 완성한다.\n식용유 5종이컵','0599_4.jpg'),(2445,456,'피망, 슬라이스 햄을 잘게 다진다.','0600_1.jpg'),(2446,456,'달군팬에 기름을 둘러 밥, 채소 햄을 넣고 볶다가 소금, 후추로 간을 맞춘다.','0600_2.jpg'),(2447,456,'볶음밥을 동그라미 1개, 작은 타원 1개를 만들어 쌀가루-> 달걀물-> 빵가루 순으로 튀김옷을 입힌다.','0600_3.jpg'),(2448,456,'180도 예열된 오븐에 노릇하게 튀긴다.\n오븐','0600_4.jpg'),(2449,456,'체다치즈, 김, 작은크로켓으로 귀, 입, 눈을 만들어 붙여 완성한다.','0600_5.jpg'),(2450,457,'매운소스 만들기\n분량의 소스 재료를 믹서기에 넣어 갈아서 준비한다.','0601_1.jpg'),(2451,457,'상온에 12시간 숙성 후 냉장 보관한다.','0601_2.jpg'),(2452,457,'크로켓 만들기\n곱창은 기름에 1~2분 노릇하게 튀겨 잘게 다진다.','0601_3.jpg'),(2453,457,'다진 곱창, 소고기, 다진 양파, 다진 마늘, 후추, 참기름, 매운 소스를 섞어 동그랗게 만든다.','0601_4.jpg'),(2454,457,'만들어진 재료에 튀김가루, 달걀, 빵가루 순서로 튀김옷을 입힌다.','0601_5.jpg'),(2455,457,'170도로 예열된 기름에 튀겨 완성한다.','0601_6.jpg'),(2456,458,'찐고구마는 뜨거울 때 으깨서 다진양파, 옥수수를 넣고 소금, 후추로 간한다.\n찐 밤고구마 3개 , 다진양파 3숟가락 , 캔 옥수수 3숟가락 ,찐 밤고구마 3개 , 다진양파 3숟가락 , 캔 옥수수 3숟가락','0602_1.jpg'),(2457,458,'가운데 치즈를 넣고 손으로 둥글게 모양을 만든다.\n스트링치즈 4개','0602_2.jpg'),(2458,458,'밀가루- 달걀물- 빵가루 순으로 묻힌다.\n밀가루 5숟가락 , 달걀 1개 , 빵가루 1종이컵','0602_3.jpg'),(2459,458,'튀김기름에 넣고 튀긴다.','0602_4.jpg'),(2460,458,'디핑소스를 곁들여 완성한다.\n케찹 1숟가락 , 머스터드 1숟가락','0602_5.jpg'),(2461,459,'양파, 파프리카, 당근은 다져서 준비한다.\n양파 20g, 파프리카 1/4개, 당근 20g','0603_1.jpg'),(2462,459,'찐 감자는 으깨서 준비한다.\n찐 감자 4개','0603_2.jpg'),(2463,459,'팬에 다진 양파, 다진 파프리카, 다진 당근을 볶는다.\n팬','0603_3.jpg'),(2464,459,'으깬 감자에 양념재료를 넣고 섞는다.\n[양념재료] 마요네즈 1T, 소금 약간, 후추 약간','0603_4.jpg'),(2465,459,'볶은 재료들을 으깬 감자와 함께 섞는다.','0603_5.jpg'),(2466,459,'감자를 동그랗게 빚은 후 넓적하게 만들어 안에 피자치즈를 넣고 다시 동그랗게 빚는다.\n피자치즈 1Cup','0603_6.jpg'),(2467,459,'동그랗게 빚은 감자를 밀가루, 달걀, 빵가루 순으로 묻힌다.\n빵가루 1Cup, 밀가루 1/2Cup, 달걀 1개','0603_7.jpg'),(2468,459,'예열된 기름에 노릇하게 튀겨 완성한다.\n[선택재료] 파슬리가루 1T','0603_8.jpg'),(2469,460,'양파는 곱게 다지고, 크래미는 잘게 찢는다.','0604_1.jpg'),(2470,460,'시판용 크림소스, 맛살, 파마산치즈가루, 소금, 후추, 양파를 넣고 동그랗게 모양을 잡는다.\n반죽이 질 경우 모양을 잡아 냉동실에 굳혀 튀김옷을 입혀 주세요','0604_2.jpg'),(2471,460,'밀가루 -> 달걀 -> 빵가루 순으로 튀김옷을 입혀 170도로 예열된 오븐에 노릇하게 튀겨 완성한다.\n오븐\n타르타르소스와 곁들여 먹어도 좋아요','0604_3.jpg'),(2472,461,'[달콤하지롤]\n과일들은 깨끗히 세척 후 손질한다.','0608_1.jpg'),(2473,461,'접시에 롤케이크를 담고 손질한 과일을 올려 완성한다.','0608_2.jpg'),(2474,461,'[레몬, 너한테 피치나]\n얼음컵에 크랜베리 주스를 넣고 북숭아 스파클링 음료를 넣는다.','0608_3.jpg'),(2475,461,'레모나를 뿌려 완성한다.','0608_4.jpg'),(2476,462,'우유를 전자렌지에 넣고 2분간 돌려 따뜻하게 데운다.','0609_1.jpg'),(2477,462,'치킨을 잘게 찢은 후 전자레인지에 30초간 돌린다.\n전자레인지','0609_2.jpg'),(2478,462,'파스타면에 데운 우유를 붓고 뚜껑을 덮어 전자레인지에 3분간 돌린다.\n전자레인지','0609_3.jpg'),(2479,462,'면이 익으면 스프를 뿌린 후 섞는다.','0609_4.jpg'),(2480,462,'섞은 면위에 치즈를 올리고 전자레인지에 30초간 돌린 후 찢은 치킨을 올려 완성한다,\n전자레인지','0609_5.jpg'),(2481,463,'미트볼은 전자레인지에 1분 30초간 데운다.\n전자레인지','0611_1.jpg'),(2482,463,'데운 미트볼은 으깬다.','0611_2.jpg'),(2483,463,'만두에 물을 약간 넣고 전자레인지에 3분간 데운다.\n전자레인지','0611_3.jpg'),(2484,463,'그릇에 만두를 담고 미트볼을 올린다.','0611_4.jpg'),(2485,463,'모짜렐라 치즈를 뿌린 후 전자레인지에 1분 30초간 돌려 완성한다.\n전자레인지','0611_5.jpg'),(2486,464,'[무쌈에 무쵸]\n소시지바는 전자레인지에 30초간 데운 후 어슷썬다.\n전자레인지','0613_1.jpg'),(2487,464,'까르보불닭의 면에 뜨거운 물을 부어 4분간 익힌다.','0613_2.jpg'),(2488,464,'면이 익으면 물을 버린 후 액상스프와 분말스프를 넣고 섞는다.','0613_3.jpg'),(2489,464,'쌈무 위에 면과 소시지를 올린 후 말아 먹는다.','0613_4.jpg'),(2490,464,'[소피말았소]\n식빵 위에 체다치즈를 올린 후 소시지를 잘라 올린다.','0613_5.jpg'),(2491,464,'모짜렐라 치즈를 듬뿍 뿌린 후 전자레인지에 1분 30초간 돌린다.\n전자레인지','0613_6.jpg'),(2492,464,'케첩을 뿌려 완성한다.','0613_7.jpg'),(2493,465,'[아이스맛카롱]\n아이스크림을 과자 크기로 자른다.\n원하는 맛의 아이스크림으로 만들어 보세요!','0614_1.jpg'),(2494,465,'달걀 과자 사이에 자른 아이스크림을 샌드하여 완성한다.','0614_2.jpg'),(2495,465,'[요리죠리라떼]\n바닐라아이스크림은 전자레인지에 20초 데운다.\n전자레인지','0614_3.jpg'),(2496,465,'컵에 커피가루, 소량의 뜨거운 물을 넣고 섞어 커피원액을 만든다.','0614_4.jpg'),(2497,465,'컵에 죠리퐁, 우유를 넣고 섞은 후 우유가 진해지면 과자는 건져먹는다.','0614_5.jpg'),(2498,465,'진해진 우유에 데운 아이스크림, 커피원액을 넣어 섞는다.','0614_6.jpg'),(2499,465,'죠리퐁을 올려 완성한다.','0614_7.jpg'),(2500,466,'[에그머니빵]\n빵은 봉지를 살짝 뜯은 후 전자레인지에 1분간 돌린다.\n전자레인지','0615_1.jpg'),(2501,466,'데운 빵은 반으로 자른다.','0615_2.jpg'),(2502,466,'달걀샐러드를 으깬 후 빵 속에 넣어 에그머니빵을 완성한다.','0615_3.jpg'),(2503,466,'[요거트가 만난지 얼마나 오렌지]\n얼음컵에 오렌지주스를 붓는다.','0615_4.jpg'),(2504,466,'플레인요구르트를 넣어 주스를 완성한다.','0615_5.jpg'),(2505,467,'1. 막창국수\n쌀국수 컵라면에 뜨거운 물을 부어 면을 익힌다.','0616_1.jpg'),(2506,467,'막창은 전자레인지에 2분 30초간 데운다.\n전자레인지','0616_2.jpg'),(2507,467,'쌀국수의 면만 건져 데운 막창에 섞어 완성한다.\n쌀국수 국물은 1종이컵 정도 남겨주세요.','0616_3.jpg'),(2508,467,'2. 달걀찜\n달걀에 남겨둔 쌀국수 국물을 넣고 섞는다.\n달걀과 쌀국수 국물의 비율은 1:1로 해주세요.','0616_4.jpg'),(2509,467,'전자레인지에 3분간 돌려 완성한다.\n전자레인지\n1분씩 3번 나눠 돌려주세요.','0616_5.jpg'),(2510,468,'화자오 3t, 마자오, 건고추, 팔각을 미지근한 물에 5분가량 불린 후 채에 걸러 물기를 제거한다.','0617_1.jpg'),(2511,468,'뜨거운 팬 위에 식용유와 물기를 거른 향신료와 대파, 생강을 넣고 중불에 천천히 볶는다.','0617_2.jpg'),(2512,468,'볼 위에 고추가루와 화자오 2t, 건고추를 넣어 준비한다.','0617_3.jpg'),(2513,468,'뜨겁게 볶아 준비된 마라유를 채에 걸러 3에 넣는다.','0617_4.jpg'),(2514,468,'준비된 마라고추기름 위에 된장, 굴소스를 넣고 골고루 섞은 후 식혀서 밀폐용기에 보관한다.','0617_5.jpg'),(2515,468,'다시팩에 만능마라팩 재료들을 잘 채워 만능마라팩을 만든다.\n활용 가능 요리 : 라면, 어묵탕, 해산물 전골류, 국수, 해물 짬뽕 등','0617_6.jpg'),(2516,468,'손질된 장어에 잘게 칼집을 넣어 (2~3cm) 먹기 좋은 크기로 자른다.\n장어에 잔 칼집을 넣으면, 식감과 양념이 잘 스며들어, 맛을 더욱 풍부하게 느낄 수 있다.','0617_7.jpg'),(2517,468,'냄비위에 물 5컵 700ml 가량 넣은 후 준비된 다시팩을 넣어 끓여인다.','0617_8.jpg'),(2518,468,'7~10가량 충분히 끓여준 후 마라 만능 소스를 넣는다.','0617_9.jpg'),(2519,468,'국물이 충분히 끓으면 장어와 채소를 넣고 끓인다.','0617_10.jpg'),(2520,468,'들깨가루와 미나리를 넣고 한소끔 끓이면 완성\n생강을 얇게 채 썰어 준 후 소금 한소끔 넣고 물, 식초, 설탕을 1:1:1 비율로 생강 초절임을 하여 채소와 장어를 같이 드시면 매운탕을 더욱 맛있게 즐길 수 있음.','0617_11.jpg'),(2521,469,'전복은 손질 하여 편으로 썰어고 내장은 다져서 준비한다.\n내장은 1개만 다져서 준비하세요.','0618_1.jpg'),(2522,469,'양파, 당근은 다져서 준비하고 대파는 송송 썰어 준비한다.\n예열된 팬에 기름을 두르고 대파를 넣어 볶는다.','0618_2.jpg'),(2523,469,'양파, 당근, 전복 순서로 넣어 볶는다.','0618_3.jpg'),(2524,469,'밥을 넣고 내장을 함께 넣어 섞는다.','0618_4.jpg'),(2525,469,'맛술, 굴소스, 간장으로 간을 하고 볶는다.','0618_5.jpg'),(2526,469,'불을 끄고 참기름, 통깨를 넣어 섞어 완성한다.','0618_6.jpg'),(2527,470,'아스파라거스는 밑둥을 제거하고 필러로 껍질을 살짝 벗긴다,','0619_1.jpg'),(2528,470,'2cm 간격으로 썰어 준비한다.','0619_2.jpg'),(2529,470,'막창에 아스파라거스를 끼운다.','0619_3.jpg'),(2530,470,'에어프라이어 바스켓에 넣고 180도 온도에서 10분간 돌린다.\n에어프라이어','0619_4.jpg'),(2531,470,'소스재료를 섞어 곁들여 완성한다.','0619_5.jpg'),(2532,471,'닭은 끓는 물에 3분간 데친다.','0620_1.jpg'),(2533,471,'찬물에 헹군다.','0620_2.jpg'),(2534,471,'감자, 당근, 대파, 양파는 큼직하게 썬다.','0620_3.jpg'),(2535,471,'양념재료를 섞어 양념장을 만든다.','0620_4.jpg'),(2536,471,'냄비에 데친 닭, 건고추, 물 2종이컵, 양념재료를 넣고 끓인다.','0620_5.jpg'),(2537,471,'끓으면 썰어놓은 채소를 넣고 끓인다.','0620_6.jpg'),(2538,471,'물이 자박하게 졸아들면 당면을 넣고 참기름을 치고 그릇에 담는다.','0620_7.jpg'),(2539,471,'깨를 뿌려 완성한다.','0620_8.jpg'),(2540,472,'냄비에 들기름을 두르고 불린미역을 넣고 중불로 약 3분간 볶는다.','0621_1.jpg'),(2541,472,'육수를 붓고 20분간 푹 끓인다.','0621_2.jpg'),(2542,472,'들깨가루를 넣고 만두피를 손으로 찢어 넣는다.','0621_3.jpg'),(2543,472,'국간장으로 간한다.','0621_4.jpg'),(2544,473,'손질된 낙지는 끓는물에 잠시 데쳐내요.','0623_1.jpg'),(2545,473,'미나리는 5Cm로 썰고 생강은 편으로 썰어 준비해요.','0623_2.jpg'),(2546,473,'예열된 팬에 참기름과 생강을 넣어 볶아요.','0623_3.jpg'),(2547,473,'굴소스와 미나리, 부추를 넣어 볶아요.\n굴소스 대신 간장을 사용해도 좋아요.','0623_4.jpg'),(2548,473,'볶은 채소 위에 낙지와 육수를 넣어 끓여요.\n육수는 치킨스톡이나 채소 스톡을 1/2ts을 물에 섞어 사용해요.','0623_5.jpg'),(2549,473,'전분물을 넣어 볶아내요.\n물을 조금 더 넣어주어 농도를 조절해요.','0623_6.jpg'),(2550,473,'접시에 담아 미나리 잎을 올려 완성해요.\n기호에 따라 콩나물이나 숙주를 넣어 사용해도 좋아요.','0623_7.jpg'),(2551,474,'소고기는 찬물에 약 20분간 담가 핏물을 제거한다.','0624_1.jpg'),(2552,474,'소고기는 굵직하게 썬다.','0624_2.jpg'),(2553,474,'팬에 참기름을 두르고 소고기, 설탕을 넣고 볶는다.\n설탕이 고기를 부드럽게 해줘요.','0624_3.jpg'),(2554,474,'나머지 양념장재료를 모두 넣고 볶듯이 조린다.','0624_4.jpg'),(2555,474,'청양고추, 깨를 뿌려 완성한다.','0624_5.jpg'),(2556,475,'양파는 채 썰고 대파는 어슷 썰어 준비한다.','0625_1.jpg'),(2557,475,'불고기용 쇠고기는 키친타월에 밭쳐 핏물을 제거한다.','0625_2.jpg'),(2558,475,'양념 재료들을 섞어 양념장을 만든다.','0625_3.jpg'),(2559,475,'불고기와 채 썬 양파를 넣고 버무려 냉장실에서 30분 이상 숙성 한다.\n바로 조리해도 ok!','0625_4.jpg'),(2560,475,'뚝배기에 담고 중간 불로 끓인다..','0625_5.jpg'),(2561,475,'끓으면 불린 당면을 넣고 끓인다.','0625_6.jpg'),(2562,475,'다시 끓어오르면 버섯, 대파를 올려 한소끔 끓여 완성한다.','0625_7.jpg'),(2563,476,'양파는 채썰고 부추는 4cm길이로 썬다.','0627_1.jpg'),(2564,476,'팬에 오리를 앞뒤로 굽는다.','0627_2.jpg'),(2565,476,'채 썬 양파를 넣어 볶는다.','0627_3.jpg'),(2566,476,'양념재료를 넣어 볶는다.','0627_4.jpg'),(2567,476,'부추를 넣고 살짝만 볶는다.\n부추는 불을 끄고 넣어 살짝만 볶아주세요.','0627_5.jpg'),(2568,476,'밥위에 올려 완성한다.','0627_6.jpg');
